INSERT INTO `tbNodes` (`id`, `oldid`, `code`, `title`, `extra`, `aside`, `sametime`, `nodegroup`, `groupchoices`, `codedesc`, `codeexp`, `coderules`, `inactive`)
VALUES
	(1,'2789f0','1','How does the event begin?',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL),
	(2,'52731b','1-1','Student addresses Peer','Peer ID',NULL,NULL,NULL,NULL,'Beginning of an interaction where the student whose data we are analyzing addresses a peer, adult, or group of people','Help seeking:\n\"Hey, can you help me?\"\n\"Rachel, can you help me?\"\n\"I need help.\" (especially if followed by more directed help seeking behavior)\n\nStudent: \"Ms. X, can you help?\"\nAdult: \"Okay let\'s see. [turns to class management] Everyone needs to work at voice level one! [turns back to the student] Okay, what did you change?\"\n\nComputing related comment (Excitement, frustration, general conversation):\n\"Rachel, look what I did!\"','Ten second rule:If any independent work takes place between interaction attempts (end of one attempt to the start of the next), code as two separate interactions with independent work between\n\nElse if >= 10 seconds between attempts, code as two separate interactionsElse, code as same interactionIncidental interactionsOne call-and-response socialization interaction does not get coded.\n\nA more extended interaction, or a pattern of short interactions, do get coded.\n\nPattern of interactions: [TENTATIVE] if you see three one-off interactions of any kind within three minutes, code all one-off interactions, and keep coding future one-offs until three minutes have passed without a one-off.\n\nSupport seeking/offering behavior is always coded unless it\'s potentially self-talk in the form of a question.If adult/peer leaves temporarily and comes back to the conversation that the student has started, code as same interaction instead of 1-1 and 1-3.',NULL),
	(3,'21b330','1-2','Peer addresses Student','Peer ID',NULL,NULL,NULL,NULL,'Beginning of an interaction wherein a peer or an adult addresses the student whose video we are analyzing. ','Peer: Hey, that\'s cool. How\'d you do that? \nStudent responds\n\nPeer: Hey, Can you help me with this? \nStudent responds\n\nAdult: Hey, that\'s cool. How\'d you do that? \nStudent responds\n\nAdult: \"Hey, can you get back into the project?\" \nStudent \"I\'m stuck. It\'s too hard.\" \nAdult, \"Ok. Let\'s see what\'s going on.\"','Don\'t code initial exposition interaction (\"What is your computer number, what are you working on\") unless:Interaction lasts more than a minuteInteraction moves to a problem (\"How do I log in?\" \"are you seeing this movie this weekend?\"). Then timestamp/start coding when the student asks for help.If confused whether student is help-seeking or self-talking, look for evidence of an interaction attempt. If no evidence exists, code as independent work.',NULL),
	(4,'8e716f','1-3','Student addresses Adult','Adult ID',NULL,NULL,NULL,NULL,'Beginning of an interaction where the student whose data we are analyzing addresses a peer, adult, or group of people','Help seeking:\n\"Hey, can you help me?\"\n\"Rachel, can you help me?\"\n\"I need help.\" (especially if followed by more directed help seeking behavior)\n\nStudent: \"Ms. X, can you help?\"\nAdult: \"Okay let\'s see. [turns to class management] Everyone needs to work at voice level one! [turns back to the student] Okay, what did you change?\"\n\nComputing related comment (Excitement, frustration, general conversation):?\"Rachel, look what I did!\"','Ten second rule:If any independent work takes place between interaction attempts (end of one attempt to the start of the next), code as two separate interactions with independent work between\n\nElse if >= 10 seconds between attempts, code as two separate interactionsElse, code as same interactionIncidental interactionsOne call-and-response socialization interaction does not get coded.\n\nA more extended interaction, or a pattern of short interactions, do get coded.\n\nPattern of interactions: [TENTATIVE] if you see three one-off interactions of any kind within three minutes, code all one-off interactions, and keep coding future one-offs until three minutes have passed without a one-off.\n\nSupport seeking/offering behavior is always coded unless it\'s potentially self-talk in the form of a question.If adult/peer leaves temporarily and comes back to the conversation that the student has started, code as same interaction instead of 1-1 and 1-3.',NULL),
	(5,'87dfa4','1-4','Adult addresses Student','Adult ID',NULL,NULL,NULL,NULL,'Beginning of an interaction wherein a peer or an adult addresses the student whose video we are analyzing. ','Peer: Hey, that\'s cool. How\'d you do that? \nStudent responds\n\nPeer: Hey, Can you help me with this? \nStudent responds\n\nAdult: Hey, that\'s cool. How\'d you do that? \nStudent responds\n\nAdult: \"Hey, can you get back into the project?\" \nStudent \"I\'m stuck. It\'s too hard.\" \nAdult, \"Ok. Let\'s see what\'s going on.\"','Don\'t code initial exposition interaction (\"What is your computer number, what are you working on\") unless:Interaction lasts more than a minuteInteraction moves to a problem (\"How do I log in?\" \"are you seeing this movie this weekend?\"). Then timestamp/start coding when the student asks for help.If confused whether student is help-seeking or self-talking, look for evidence of an interaction attempt. If no evidence exists, code as independent work.',NULL),
	(6,'c83b4e','1-5','Student works independently on a computing related task',NULL,NULL,NULL,NULL,NULL,'Beginning of independent path','Student is working on their computer doing work related to the task. The student may or may not use self-talk. \n\nStudent: \"Oh geez. That didn\'t work. Hmmmm. Ok.\"\nNo response from anyone.\n\nStudent works on asset development and management: E.g. Looks for an image or sound for their computational artifact\n\nRefer to node 3 on categorization of the nature of task.\nAn example can be a task on academic content, navigating software (e.g. logging in, changing levels), asset creation and management (e.g. creating/modifying/resizing images, recording/editing audio), general computer technology (e.g. mouse, monitor, adapter)','Code as soon as student starts working independently on task (as soon as mouse moves), end path when evidence of independent computing work ends (e.g. interaction begins, student works independently on non-computing task, mouse stops moving for 30 seconds, video ends)\n\nThe mouse may or may not be moving. (e.g, student may be watching a tutorial) \n\n*Take field notes about what the student is doing while working independently including: What they are working on, if they are engaged in self-talk, what are they saying (e.g. steps, frustration expression)',NULL),
	(7,'666ca8','1-6','Student works independently on a non-computing task',NULL,NULL,NULL,NULL,NULL,'Beginning of independent path','Student is on Minecraft while the class is doing a Scratch activity. ','This code refers to any off-task type behaviors. The student is not working on the expected computational activity. \n\nTake field notes on what the student is doing. ',NULL),
	(8,'b31dcc','1-7','Student joins peer conversation',NULL,NULL,NULL,NULL,NULL,'The student is heard (on their computer and/or that of a peer being observed) joining into a peer\'s conversation with a third party. Evidence may also exist in observation field notes.','Student: \"What did you just say about how you solved that puzzle?\"\nPeer responds\n\nStudent: \"I was thinking about trying to make a maze game too.  How many sprites do you have?\"\nPeer responds','Engagement in a conversation requires that there is a back and forth among at least two parties.  See rules for one-offs. \nThere has to be evidence of at least 3 people involved. ',NULL),
	(9,'effa06','2','How does the interaction with the peer or adult begin or continue?',NULL,NULL,NULL,5,1,NULL,NULL,NULL,NULL),
	(10,'da6dbb','2-1','Student clearly expresses how he or she needs help with a difficulty or problem',NULL,NULL,NULL,NULL,NULL,'Two elements must be present for this code: 1.  A statement or request for help, and 2. Some explicit description of what the student needs help with. ','For example: \nS: I found a bug, I just don\'t know how to fix it.\nT: Oh, o.k. (Teacher stops to do whole class and individual redirection)\nT: O.k., so you found the problem. So what is the problem\n\nS: There is 3 instead of 1 on Mars (?) Three instead of one.\nT: O.k., so where does the program tell it how many moons to put\n\nIn this interaction, the student did not explicitly say what the problem was at the beginning of the interaction, but with prompting and scaffolding, she explained the problem. Therefore, it was decided this instance was coded 2-0.','Code the timestamp as soon as the student asks for help, but choose between 2-0 and 2-1 after hearing more of the interaction. \n\nTake into consideration the interaction that follows the timestamp while deciding which code to choose. In other words, the chosen code should reflect the initial discussion that follows instead of considering only the very first sentence the student says. See below.\n\nIn Scratch: Student needs to verbally express the problem that they need help with, even if they only express it after prompting. (\"I want to make the guy go \'rwaaaah\'\"). Otherwise code 2-1. \"It\'s not working\" is an example of not clearly articulating the problem. \n\nStudent may seek attention (\"Hi Mr. Lash\") first without articulating the problem in the first utterance (\"I need help\"). If student then clearly expresses the problem with scaffolding, code 2-0.\n\nClear  expression should happen either in the initial call for help or after the peer/adult asks, \"what\'s up/what are you trying to do?\"\n\nIf the student only expresses the problem after discussion with adult/peer, this option will never get selected for this problem discussion.',NULL),
	(11,'2e2236','2-2','Student expresses a need for help, but is not explicit to the difficulty or problem',NULL,NULL,NULL,NULL,NULL,'Student is heard asking for help (not self talk)','Can you help me?\n\"Rachel, help me!\"\n\"Mr. Gibson, It\'s not working.\" (Directed at a peer or adult)\n\nNon-example: Student: \"It\'s not working.\" \"I don\'t know what\'s going on.\" No response from a peer/adult, no observation record of addressing peer/adult','See 2-0\nRule: The student clearly addresses a peer or adult. There has to be some evidence that the student is addressing someone and not engaged in self-talk. \nIf it is unclear whether the student is engaging in self talk vs. attempting help seeking, do not code as help seeking. ',NULL),
	(12,'4d4acd','2-3','Student discusses computing (not problem solving)',NULL,NULL,NULL,NULL,NULL,'Discussing anything related to the computing task or about any computation that is not a problem. ','Examples: \"Look at what I did. It\'s a black hole. I made a black hole.\"?\"This is cool. How did you make that?\"\n\nNon-Examples:?\"I can\'t log in\" (problem related interaction or self talk)\n\"Hmm, I wonder why this isn\'t working\" (problem related interaction or self talk)?\"What did you do this weekend?\" (Non-computing conversation)','-Evidence that the student is addressing a peer/adult and not engaged in self-talk. ?-No evidence of a problem-related conversation',NULL),
	(13,'262e59','2-4','Student engages in non-computing conversation',NULL,NULL,NULL,NULL,NULL,'Non-computing  is a conversation  outside the scope of anything related to computing/coding. It can be conversations about the weather, a person, an event, etc.','Examples: \nStudent: \"What happened to Rachel?\"\nPeer: I don\'t know. Maybe she went to the bathroom.\nStudent: I really liked her necklace. \nPeer: Yeah, I want one. \n\nNon Example (one off): \nStudent: \"Pretty necklace!\"\nPeer: \"Thanks\" End of conversation','Code as \"non-computing\" when the student and a peer/adult have a conversation that involves some back-and-forths. \nIf no one responds to the student or gives a short answer such as \"yes/or\" or \"I don\'t know\", then it may be omitted. \nDo not code if it\'s a \"one off\"=Student says something, and peer answers with short response which ends the interaction. \nOne off rule:  Student says something, and peer answers with short response which ends the interaction. Do not code.',NULL),
	(14,'f11803','2-5','Student offers support to peer (the peer did not specifically ask for help)',NULL,NULL,NULL,NULL,NULL,'The student offers unsolicited assistance to a peer as heard in the audio recording.  Visual evidence may be that the student stops working on their own computer. ','S: Looks like you need help, yo? \nS: \" Oh! I\'ve done that before.  You have to change the orientation of your sprite.\"\nP: \"How do I do that?\"\nS: Click on the sprite first on the bottom right of the screen and then change where it says, direction\". \nP: Oh, right there?','Note that this is different than the peer asking the student for help. Only code if the offer for help is unsolicited. ',NULL),
	(15,'58c900','2-6','Student says something that is unclear or inaudible',NULL,'Describe the support in the field notes.',NULL,NULL,NULL,'Coder is unable it discern what the student says. This may be due to background noise, the student speaking softly or other reason such as those having to do with tech issues.','S: I really (inaudible).  I wish someone would (inaudible) jars of pickles.','Choose this code if you cannot discern what is said or are not sure.  In the field notes, add what you think may have been said.',NULL),
	(16,'541093',NULL,'Student verbally addresses a person without expressing the offer or need for help, curiosity, excitement, accomplishment or non-computing conversation (e.g., \"Hey you...\" or \"Mrs. S...\" or \"Stop that!\")',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(17,'aeb05b','2-7','Peer offers self-regulation support to student',NULL,NULL,NULL,NULL,NULL,'While support is offered, it is not directly related to computing. This may include cheering a friend on, giving them positive affirmations, reminding them of a strategy for helping them to focus, etc. ','P: I know it is really hard.  I know you can do it.  Do you need to take a break?\"','One-off rule does not apply (just as in problem solving) Code if the interaction is peer driven (e.g. the peer initiated the discussion). Code if the support is related to self-regulation. This is not direct support in solving a computing problem on its own but may be related to a student expressing or showing frustration or  difficulty with such a problem. ',NULL),
	(18,'5ba6f5','2-8','Peer offers support to student who was working collaboratively on a problem or topic',NULL,NULL,NULL,NULL,NULL,'A third party peer joins in to an existing instance of collaboration to offer further support. ','S: I think we need to use a conditional statement here.\nP1: Why do you think that\n\nP2: You are trying to have the car sense the wall of the race track right?  \"If hits wall, then bounce.\" Make sense right\n\nS: See, that is a conditional!','Code if the interaction is peer driven and the peer initiated the discussion.',NULL),
	(19,'f93287','2-9','Peer offers computing problem solving support to student who was working independently on a problem or topic',NULL,NULL,NULL,NULL,NULL,'A peer verbally offers computing-related support or help to the student being observed.','P:  Looks like you are stuck. I\'ve done that level.  Need help\n\nS:  Sure, I\'ve been working on this forever.\n\nNon-example:\nP: Do you want to walk to the water fountain to cool off a bit before we continue? ','Code if the interaction is peer driven and the peer initiated the discussion.\nDo not use this code if the peer is offering self regulation help. ',NULL),
	(20,'fa2db2','2-10','Peer discusses computing (not problem solving)',NULL,NULL,NULL,NULL,NULL,'A peer verbally addresses the student being observed and discusses some aspect of either the student\'s or the peer\'s computing activity, not related to a problem.','P:  I love changing the speed my sprite glides by to make it really fast.  Its hilarious!\nS:  Maybe if we make it super fast it will crash the computer!','Code if the interaction is peer driven and the peer initiated the discussion.\nNo evidence of a problem solving interaction. ',NULL),
	(21,'712191','2-11','Peer engages student in non-computing conversation (heard on student\'s computer)',NULL,NULL,NULL,NULL,NULL,'A peer verbally addresses the student being observed and discusses something not related to computing (off task).','P: Whatever we are having for lunch smells awful!  \nS: Ya, I think I am going to barf.  Glad I brought my own lunch.\nP: I wish I did :(','Code if the interaction is peer driven and the peer initiated the discussion. \nThese conversations are outside of anything related to the classroom computing activity. ',NULL),
	(22,'5df510','2-12','Peer asks student for help',NULL,NULL,NULL,NULL,NULL,'A peer verbally requests help from the student being observed/recorded. ','Peer: \"Hey, how\'d you do that? I can\'t make the triangle.\" ','Consider this problem-solving. So the One-off rule does not apply. ',NULL),
	(23,'1722a1','2-13','Peer says something that is unclear or inaudible',NULL,'Describe the support in the field notes.',NULL,NULL,NULL,'A peer verbally addresses the student being observed but what is said is unclear or inaudible due to background noise, technical issues or the volume of the peer\'s voice. ','P: I\'m... (inaudible) Ashtanga Yoga... (inaudible) and a fish sandwich! \nS: Totally.  I\'m down with that!','NuLL',NULL),
	(24,'b649d2',NULL,'Peer verbally addresses the student without expressing the need/offer for help, curiosity, excitement, accomplishment or non-computing conversation (e.g. \"Hey you...\" or  \"Can you stop that!\")',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(25,'668767','2-14','Adult offers self-regulation support to student',NULL,NULL,NULL,NULL,NULL,'Self regulation strategies offer students support in either monitoring their own learning, helping with dealing with frustration, and working with their peers. ','Take a deep breath and keep trying, you are almost there.?\n\"OK, what do you need to help you get back on track?\" ?\n\"Let\'s look at your project plan and see what you can do next.\" ','While support is offered, it is not directly related to specific computing problem solving. This may include cheering the student, giving them positive affirmations, reminding them of a strategy for helping them to focus, etc. \n\nThis code is used if the adult is helping the student work with a peer/peers',NULL),
	(26,'f77c01','2-15','Adult offers support to student who was working collaboratively on a problem or topic',NULL,NULL,NULL,NULL,NULL,'This is when the adult joins the conversation to offer support when the student and a peer are knowingly working collaboratively. ?This support can be either general problem solving or self-regulation support. ','What are you two doing to get the sprite over the rock? Do you need any help with that? \nS: \"myFolder, stop touching me, It\'s not nice!\"\nTeacher intervenes: \"Let\'s see if we can get you to work together a little better. Why don\'t you take turns with who\'s the navigator during your pair programming? \"','Add/refer to field notes about what is happening in the collaboration.\n\nThis support can be for programming, asset development/management, or any other computing-related task. \n\nOne-off rule does not apply because this is considered problem solving.?',NULL),
	(27,'3f9c83','2-16','Adult offers computing problem solving support to student who was working independently on a problem or topic',NULL,NULL,NULL,NULL,NULL,'Adult is heard offering the student support (not self-regulation) in solving their computational problem. Student is not heard asking for help. ','T: \"You\'ve been working on that for a while. Let\'s see if I can help a bit. What would happen if we moved that block into the repeat loop?\" ','Here, the student must be knowingly working independently. Add/refer to field notes about the nature of the situation.\n\nOne-off rule does not apply because it\'s problem solving. \n\nThis support is not self-regulation in nature. ',NULL),
	(28,'a863a2','2-17','Adult engages in non-computing conversation',NULL,NULL,NULL,NULL,NULL,'Adult is in conversation with the student about any topic unrelated to the computing task. ','T: Did you finish your math module\n\nS: Not yet. I want to do my art assignment first.\nT: When are you planning on finishing it\n\nS: After recess. \n\n(e.g. student has to finish a math problem, check recording, go to another room)','This code can be used both for general conversations or for problem-solving unrelated to computing.\nOne-off rule does apply here.',NULL),
	(29,'8851be','2-18','Adult discusses computing (not problem solving)',NULL,NULL,NULL,NULL,NULL,'Adult verbally addresses the student being observed and discusses some aspect of the student\'s computing activity, not related to a problem.','Adult: \"Oh dang. You made that dragon HUGE. Cool.\"\nS: \"Yeah, check out how I also made it dance!\"\nAdult: \"Nice. I wonder if you can make it dab?\" \nS: \"Ha, Ha. That\'s so lame and 2018. ','Code if the interaction is adult driven and the adult initiated the discussion.\nNo evidence of a problem solving interaction. ',NULL),
	(30,'cdc9a8',NULL,'Adult engages in non-computing conversation [heard on student\'s computer]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(31,'ec7320','2-19','Adult says something that is unclear or inaudible',NULL,NULL,NULL,NULL,NULL,'Coder is unable it discern what the adult says. This may be due to background noise, the student speaking softly or other reason such as those having to do with tech issues.','Adult: I really (inaudible).  I wish someone would (inaudible) jars of pickles.','Choose this code if you cannot discern what is said or are not sure.  In the field notes, add what you think may have been said. ',NULL),
	(32,'5ac2f4',NULL,'Adult verbally addresses the student without expressing the offer for help, curiosity, excitement, accomplishment or non-computing conversation (e.g., \"Can you please stop that!\")',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(33,'0b4e2a','2-20','Adult directs student to a computing task',NULL,NULL,NULL,NULL,NULL,'This code essentially refers to the adult redirecting the student away from a non-computing task, toward  computing related work.','A: \"Hey Lando, finish up your tunacolada, throw it away and come help me figure out how to finish this Angry Bird puzzle.\"\nS: \"O.k., cool.  I\'ll be right there.\"','Use this code only when the teacher is redirecting the student back to being on-task for the computing activity. \nOne-off rule does not apply. ',NULL),
	(34,'585692','2-21','Student\'s cursor stops moving for more than 30 seconds, or the student leaves station (> 30 seconds) and returns to independently work [end path]',NULL,NULL,NULL,NULL,NULL,'Student\'s cursor stops moving because student stopped working on what they were doing. No conversation is heard. ','Student moves to another student\'s computer. \nStudent stops working. \nNo evidence of computing-related \"off computer\" work. ','Refer to the field notes whether student is required to finish paper-based task with a peer, which is likely why student\'s cursor stops moving. In such a case, do not code this choice but keep coding it as interaction.\n\nThere may be multiple reasons for the mouse to stop moving (e.g. student watches a video in the computing environment, student works on pseudocode on paper, student goes to peer\'s computer). Only use this code if the student leaves the computer or is clearly off task. Do not use this code if the student is watching a relevant video or doing something off-computer that is related to the computing task. ',NULL),
	(35,'d92d7d','2-22','Interaction terminates [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(36,'ef8f7e','2-23','The video record ends [end path]',NULL,NULL,NULL,NULL,NULL,'Video recording stops',NULL,NULL,NULL),
	(37,'42c942',NULL,'[empty node]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(38,'73ae21','3','What was the problem? (This is referring to the difficulty not the subtask)',NULL,NULL,NULL,6,NULL,NULL,NULL,NULL,NULL),
	(39,'bcc9dd','3-1','Difficulty or problem or topic is related to programming',NULL,NULL,NULL,NULL,NULL,'Difficulty related to understanding the programming blocks (e.g. how to repeat, use conditional, etc.), or use other features that result in a student wanting to do a specific computing task (e.g. shrink a sprite, finding a Sprite in Scratch). ',NULL,'In Scratch, there are challenges with understanding the blocks, understanding order of blocks, etc. There are other features in the interface such as shrink that can also influence the program and should be considered computing/programming challenges.',NULL),
	(40,'81b16e','3-2','Difficulty or problem or topic is related to academic content',NULL,'Indicate the relevant categories in the field notes using the following keywords: \"computing/programming\", \"academic content\", \"navigating software\", \"asset creation/management\", \"general computer technology\", \"other\"',NULL,NULL,NULL,'The difficulty/problem is pertaining to the subject area of interest, such as math or science. Decide what the content area of interest is before you decide if a problem/topic is related.','If math is the content area of interest, then not knowing that a right angle is 90 degrees is related to \"academic content\". If science is the content area of interest, then it may be considered as related to computing/programming. ','Tentative: IF trying to decide between computing/programming and academic content, choose computing/programming unless academic content is keeping student from being able to perform project. A spelling question wouldn\'t qualify; a misunderstanding about angles that prevents the student from solving a code.org would qualify.\n\nIf the student specifically asked a question about academic content, code academic content.',NULL),
	(41,'2926b7','3-3','Difficulty or problem or topic is related to navigating software',NULL,NULL,NULL,NULL,NULL,'The difficulty/problem pertains to understanding how the programming software runs. Once a student logs into the program and demonstrates basic interface navigation, this code will be less likely to appear. ','Understanding what the tools do in the image editor when initially using Scratch (e.g. logging in, changing levels)','This code may be difficult to tell until watching the video for a while. Sometimes it seems that there is one difficulty, but the video continues and the problem may be need to be reevaluated. ',NULL),
	(42,'eb0e22','3-4','Difficulty or problem or topic is related to asset creation and management',NULL,NULL,NULL,NULL,NULL,'Student has difficulty creating/modifying/resizing images, recording/editing audio','e.g. , Working on the visuals of a sprite instead of the code\nStudent can\'t find where the sprites are in the Scratch environment, ','NuLL',NULL),
	(43,'0f1899','3-5','Difficulty or problem or topic is related to general computer technology',NULL,NULL,NULL,NULL,NULL,'Student has difficulty using the computer in general. This is unrelated to programming or navigating software. ','E.g. turning up the volume on the computer  (e.g. mouse, monitor, adapter)','NuLL',NULL),
	(44,'59bef4','3-6','Difficulty or problem or topic is related to multiple of the above categories',NULL,NULL,NULL,NULL,NULL,'Student is having difficulty across multiple areas. ',NULL,'Indicate the relevant categories in the field notes using the following keywords: ?computing/programming, academic content, navigating software, general computer technology, other',NULL),
	(45,'0dd1f9',NULL,'Other (Please add additional notes)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(46,'645409','4','What did the interaction between the Peer or Adult and the student look like?',NULL,NULL,NULL,6,1,NULL,NULL,NULL,NULL),
	(47,'70374a','4-1','Peer and student discuss the difficulty or problem',NULL,NULL,NULL,NULL,NULL,'A back-and-forth discussion of the issue takes place (that isn\'t a recitation of the solution)','What have you already tried? \"Tell me what\'s going on.\"\nS: there were three instead of one. \nA: okay, where is the program tell how many moons it has.','Timestamp at the same point that the student addresses the peer, because that\'s when the discussion begins.\nIf classroom management happens in the middle of student/teacher interactions---lump classroom management into the existing interaction we are coding, and use transcripts to quantify student/teacher interaction times. ',NULL),
	(48,'4190ff','4-2','Peer and student discuss the difficulty or problem, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'When a third person joins the conversation before the problem is solved. ','Peer: I\'m not sure why \nStudents: \" I am not very sure. Do we want to delete the code to try again?\"\nThird person (another peer or adult): \"what problem do you have? Do you need help?\"','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins problem-solving with back-and-forth conversation.\nJoining with on problem-solving or with one-off comment on problem-solving does not get coded.',NULL),
	(49,'b99510','4-3','Peer recites all steps of a solution at once (e.g. Peer does not give the student the chance to talk)',NULL,NULL,NULL,NULL,NULL,'The peer/adult gives the solution without any collaboration.','Put in a turn block with 90 degrees, and then move forward 20, and then... ','Timestamp when the peer/adult begins reciting steps',NULL),
	(50,'dc3aea','4-4','Peer recites all steps of a solution, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'The peer gives the solution without any collaboration. During the interaction, another person joins.','Peer: \"Put in a turn block with 90 degrees, and then move forward 20, and then... \"\n3rd person: \"No you have to do 90 and then forward 60.\"\nS/P: \"60?\"...','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins the discussion with problem-solving comments.\nJoining with non problem-solving comments does not get coded.\nThe solution does not need to be a correct solution. It\'s just the solution that is offered. ',NULL),
	(51,'1b7cb8','4-5','Peer physically shows by taking over the student\'s computer, and no problem solving discussions are occurring',NULL,NULL,NULL,NULL,NULL,' Peer does the computing work for the student.  There is no problem-solving conversation heard. ','Peer does the work for the student.\nPeer: Here, Let me do this for you. \nStudent: Thanks. What are you doing tomorrow?\nPeer: (while working on the student\'s computer) says, \"Nothing much\"','Can\'t code this unless observation notes indicate the peer took over. Timestamp when the physical takeover happens.\nThere may be conversations taking place, but these are unrelated to the work. ',NULL),
	(52,'a3c5c4','4-6','Peer physically shows by taking over the student\'s computer, no problem solving discussions are occurring, and another person(s) joins the discussion',NULL,NULL,NULL,NULL,NULL,'Peer does the computing work for the student. Another person is heard joining the two students as this is taking place. ','dialog clearly indicates it (\"Just do it for me\" / \"Let me show you\"/\"let me try it\"\nField notes can support this as well. \nAs the peer is doing the work for the student, a third student says, \"Hey, you shouldn\'t do that for her. Let her do it.\"\nPeer 1: Ok. What did you try already?\nStudent: I was trying to make a triangle.\nPeer 2: Cool. Did you use the repeat block? ','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins the discussion with problem-solving comments.\nJoining with non problem-solving comments does not get coded.',NULL),
	(53,'ec1587','4-7','Peer physically shows by taking over the student\'s computer, and problem solving discussions are occurring',NULL,NULL,NULL,NULL,NULL,'While peer is doing the computing task for the student, the peer is talking through the steps for problem solving. ','Discussion clearly indicates that the peer is providing guided step-by-step directions while doing the work. \nPeer: \"Let me show you\"/\"let me try it\"\nPeer: You need to drag the repeat block over here. \nPeer: Now, bring over the walk block. See? Like this.\nField notes can support this as well. ','Can\'t code this unless it is clearly heard that the peer is talking about what he or she is doing while doing the work for the student. Observation notes indicate the peer took over. If no audio or observation note confirmation is available, do not code. \nTimestamp when the physical takeover happens',NULL),
	(54,'ac5964','4-8','Peer physically shows by taking over the student\'s computer, discussions are occurring, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'While peer is doing the computing task for the student, the peer is talking through the steps for problem solving. During the discussion, another person joins the conversation.','Discussion clearly indicates that the peer is providing guided step-by-step directions while doing the work. \nPeer: \"Let me show you\"/\"let me try it\"\nPeer: You need to drag the repeat block over here. \nPeer: Now, bring over the walk block. See? Like this.\nField notes can support this as well. ','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins the discussion with problem-solving comments.\nJoining with non problem-solving comments does not get coded.',NULL),
	(55,'ddae53','4-9','Peer and student discuss the difficulty or problem, and then Peer directs student to another peer or adult',NULL,NULL,NULL,NULL,NULL,'This interaction begins with a discussion initiated by either the peer or the student. The peer then directs the student to another person for assistance.','S: I\'m wondering why that sprite isn\'t cloning  like I want it to... \nP:Clones are pretty advanced. This looks right to me, but you may want to talk to Ms. Tuscadero about that.  She is great with cloning.','Use same decision rule as \"and another person joins\" - use instead of 4-0 if it applies.',NULL),
	(56,'109ab7','4-10','Adult and student discuss the difficulty or problem',NULL,NULL,NULL,NULL,NULL,'A back-and-forth discussion of the issue takes place (that isn\'t a recitation of the solution)','What have you already tried? \"Tell me what\'s going on.\"\nS: there were three instead of one. \nA: okay, where is the program tell how many moons it has.','See 4-0\nTimestamp at the same point that the student addresses the peer, because that\'s when the discussion begins.\nIf classroom management happens in the middle of student/teacher interactions---lump classroom management into the existing interaction we are coding, and use transcripts to quantify student/teacher interaction times.',NULL),
	(57,'2b3163','4-11','Adult and student discuss the difficulty or problem, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'When a third person joins the conversation before the problem is solved','S: I\'m just not sure what to do here to get the backgrounds to change when I want them to..\nA: When do you want them to change?  What blocks have you tried?\nP: Have you looked in the purple blocks?  Might find something there that would help...just saying!','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins the discussion with problem-solving comments.\nJoining with non problem-solving comments does not get coded.',NULL),
	(58,'084bba','4-12','Adult recites all steps of a solution at once',NULL,NULL,NULL,NULL,NULL,'The peer/adult gives the solution without any collaboration\n(e.g. Adult does not give the student the chance to talk)','S: I can\'t get this to work... \nA: That\'s because you are asking it to go right and left at the same time.  If you really want it to go right and then left, put a wait block between the two.','Use this code if there is no discussion about how to solve the problem or the student\'s problem solving process.  The adult simply provides the solution. \nTimestamp when the adult begins reciting steps.',NULL),
	(59,'822843','4-13','Adult recites all steps of a solution, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'The adult gives the solution without any collaboration. During the interaction, another person joins. ','Adult: \"Put in a turn block with 90 degrees, and then move forward 20, and then... \"\n3rd person: \"No you have to do 90 and then forward 60.\"\nStudent: \"60?\"...','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins the discussion with problem-solving comments.\nJoining with non problem-solving comments does not get coded.\nThe solution does not need to be a correct solution. It\'s just the solution that is offered.',NULL),
	(60,'8e0204','4-14','Adult physically shows by taking over the student\'s computer, and no problem solving discussions are occurring',NULL,NULL,NULL,NULL,NULL,'Here, the adult solves the problem for the student without reciting steps or discussing the solution strategy. There is no problem-solving conversation heard. ','A: You are close, but I can see you are getting frustrated.  Here, let me show you what is missing.\nS: Oh, that was it.  I thought I was close!','Can\'t code this unless observation notes indicate the adult took over OR dialog clearly indicates it (\"Just do it for me\" / \"Let me show you\")\nIf we do not have verbal confirmation of the takeover, continue without using this code and provide field notes regarding any suspicions of the adult taking over the computer. \nTimestamp when the physical takeover happens',NULL),
	(61,'f95e7d','4-15','Adult physically shows by taking over the student\'s computer, no problem solving discussions are occurring, and another person(s) joins the discussion',NULL,NULL,NULL,NULL,NULL,'Adult does the computing work for the student. Another person is heard joining the two student and adult as this is taking place.','dialog clearly indicates it (\"Just do it for me\" / \"Let me show you\"/\"let me try it\"\nField notes can support this as well.\nAs the peer is doing the work for the student, a third person joins the interaction.\nAdult: Here, let me show you how to do that. \nStudent: I was trying to make a triangle.\nAdult: Just watch.\nPeer: Cool. Did you use the repeat block?','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins the discussion with problem-solving comments.',NULL),
	(62,'f40ad7','4-16','Adult physically shows by taking over the student\'s computer, and problem solving discussions are occurring',NULL,NULL,NULL,NULL,NULL,'The adult takes over the students computer, but does so while offering an explanation or providing support through discussion. ','S: I\'ve been on this level for days!\nA: I see what the problem is.  Let me show you.  See this right here?  What number do you have inside your loop?\nS: 3\nA: Right, but watch what happens when I change it to a 4... \nS: It works!','Can\'t code this unless observation notes indicate the adult took over OR dialog clearly indicates it.\nTimestamp the takeover.\nIf we do not have verbal confirmation of the takeover, continue without using this code and provide field notes regarding any suspicions of the adult taking over the computer',NULL),
	(63,'3846e2','4-17','Adult physically shows by taking over the student\'s computer, problem solving discussions are occurring, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'The adult takes over the students computer, but does so while offering an explanation or providing support through discussion. During the discussion, a peer or another adult joins. ','Discussion clearly indicates that the adult is providing guided step-by-step directions while doing the work. \nAdult: \"Let me show you\"/\"let me try it\"\nAdult: You need to drag the repeat block over here. \nAdult: Now, bring over the walk block. See? Like this.\nField notes can support this as well. ','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins the discussion with problem-solving comments.\nJoining with non problem-solving comments does not get coded.',NULL),
	(64,'16f275','4-18','Adult and student discuss the difficulty or problem, and then Adult directs student to another peer or adult',NULL,NULL,NULL,NULL,NULL,'This interaction begins with a discussion initiated by either the adult or the student. The adult then directs the student to another person for assistance.','S: I\'m wondering why that sprite isn\'t cloning  like I want it to... \nA:Clones are pretty advanced. This looks right to me, but you may want to talk to Ms. Tuscadero about that.  She is great with cloning.','Timestamp when the adult directs the student to a peer or another adult.',NULL),
	(65,'a5c984','4-19','Peer directs student to talk to another peer or adult',NULL,NULL,NULL,NULL,NULL,'Peer directs the student to someone else. Peer may or may not state that they can\'t/won\'t help the student. ','I don\'t know how. Go ask the teacher.\n\"I\'m still working on my project. I don\'t really want to stop. myFolder is way ahead. Can you ask her?\" ','Code only if peer/adult redirects without any discussion of problem. If a discussion happens before redirection, code 4-0 or similar.',NULL),
	(66,'0ae378','4-20','Peer clearly states that he or she does not know how to help',NULL,NULL,NULL,NULL,NULL,NULL,'I have no idea.\n\"I don\'t know...\"','Only code this if there is no redirecting happening.',NULL),
	(67,'69f908','4-21','Peer clearly states that he or she does not want to help',NULL,NULL,NULL,NULL,NULL,NULL,'I am not allowed to.\n\"I\'m busy now. Sorry.\"','Only code this if there is no redirecting happening.',NULL),
	(68,'1c2726','4-22','Adult directs student to talk to another peer or adult',NULL,NULL,NULL,NULL,NULL,'Adult directs the student to someone else.  Adult may or may not state that they can\'t/won\'t help the student. ','S: I\'m so frustrated!\nA: Did you ask a friend to help yet? \nS: Not yet. \nA: Go ask Javonn for help.  He finished a bit earlier. ','This interaction DOES NOT begin with a discussion initiated by either the adult or the student. The adult simply directs the student to another person for assistance.',NULL),
	(69,'098f26','4-23','Adult clearly states that he or she does not know how to help',NULL,NULL,NULL,NULL,NULL,'Adult states that they don\'t know how to help the student. ','S: Can you help me with this Mr. Gibson. \nA: Listen kid, I don\'t know how to do that and I\'m reading my paper. ','Only code this if there is no redirecting happening.',NULL),
	(70,'1960c3','4-24','Adult clearly states that he or she does not want to help',NULL,NULL,NULL,NULL,NULL,NULL,'S: I am so stuck! Mr. Greenjeans, can you help me?\nA: Sorry kid, Bask in your frustration! I help you enough.\nS: You are SO MEAN all the time. ','Only code this if there is no redirecting happening.\nNote that the adult here verbally states that they do not want to help or are unwilling.  They may or may not know how to help, but that it not vocalized here. ',NULL),
	(71,'53256d',NULL,'Adult verbally comments on student\'s work',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(72,'90fa95',NULL,'Student dismisses his or her attempt for interacting (e.g. student does not call the person again) [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(73,'7d8292',NULL,'Peer dismisses his or her attempt for interacting (e.g. peer does not call the student again) [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(74,'0e599e',NULL,'Adult dismisses his or her attempt for interacting (e.g. adult does not call the student again) [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(75,'b8645c','4-25','Student ignored or cannot hear or code student\'s response to peer',NULL,NULL,NULL,NULL,NULL,'The student ignores the question/response.\nOr the audio of the response is not clear enough to hear and code.',NULL,'Use if you hear a response but cannot code it (unintelligible) or if there is evidence that the student is ignoring the peer.\nWe likely cannot tell the difference between ignored or can\'t hear unless we have observation notes to tell us that the student ignored the peer. ',NULL),
	(76,'29bc47','4-26','Student ignored or cannot hear or code student\'s response to adult',NULL,NULL,NULL,NULL,NULL,'The student ignores the questions/response.\nOr the audio of the response is not clear enough to hear and code.',NULL,'Use if you hear a response but cannot code it (unintelligible) or if there is evidence that the student is ignoring the adult from field notes.',NULL),
	(77,'cfcfc7','4-27','Peer ignored or cannot hear or code peer\'s response to student',NULL,NULL,NULL,NULL,NULL,'The peer ignores the questions/response.\nOr the audio of the response is not clear enough to hear and code.',NULL,'Use if you hear a response but cannot code it (unintelligible) or if there is evidence that the peer is ignoring the student.',NULL),
	(78,'c88493','4-28','Adult ignored or cannot hear or code adult\'s response to student',NULL,NULL,NULL,NULL,NULL,'The adult ignores the question/response.\nOr the audio of the response is not clear enough to hear and code.',NULL,'Use if you hear a response but cannot code it (unintelligible) or if there is evidence that the adult is ignoring the student.',NULL),
	(79,'bc7f6c',NULL,'Can\'t code interaction [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(80,'0eb295','4-29','Student and peer discuss a difficulty or problem',NULL,NULL,NULL,NULL,NULL,'A back-and-forth discussion of the issue takes place (that isn\'t a recitation of the solution)','What have you already tried? \"Tell me what\'s going on.\"\nS: there were three instead of one. \nP: okay, where is the program tell how many moons it has.','Timestamp at the same point that the student addresses the peer, because that\'s when the discussion begins.\nIf classroom management happens in the middle of student/teacher interactions---lump classroom management into the existing interaction we are coding, and use transcripts to quantify student/teacher interaction times. ',NULL),
	(81,'09d441','4-30','Student and peer discuss a difficulty or problem, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'When a third person joins the conversation before the problem is solved. ','Student: I\'m not sure why \nPeer: \" I am not very sure. Do we want to delete the code to try again?\"\nThird person (another peer or adult): \"what problem do you have? Do you need help?\"','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins problem-solving with back-and-forth conversation.\nJoining with on problem-solving or with one-off comment on problem-solving does not get coded.',NULL),
	(82,'a29d87','4-31','Student recites all steps of a solution at once',NULL,NULL,NULL,NULL,NULL,'The student gives the solution without any collaboration.\n(e.g. Student does not give the student the chance to talk)','Put in a turn block with 90 degrees, and then move forward 20, and then... ','Timestamp when the student begins reciting steps',NULL),
	(83,'685c02','4-32','Student recites all steps of a solution, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'The student gives the solution without any collaboration. Another person joins the interaction during the recitation. \n(e.g. Student does not give the student the chance to talk)','Peer: I can\'t get this to work... \nStudent: That\'s because you are asking it to go right and left at the same time.  If you really want it to go right and then left, put a wait block between the two.','Use this code if there is no discussion about how to solve the problem or the student\'s problem solving process.  The adult simply provides the solution. ',NULL),
	(84,'bf68f9','4-33','Student physically shows by taking over the peer\'s computer, and no problem solving discussions are occurring',NULL,NULL,NULL,NULL,NULL,'Here, the student solves the problem for the student without reciting steps or discussing the solution strategy. Peer does the computing work for the student.  There is no problem-solving conversation heard. ','Student  does the work for the peer.\nStudent: Here, Let me do this for you. \nPeer: Thanks. What are you doing tomorrow?\nStudent: (while working on the peer\'s computer) says, \"Nothing much\"','If no direct audio evidence exists, refer to field notes on whether student actually takes over peer\'s computer.\nCan\'t code this unless observation notes indicate the peer took over. Timestamp when the physical takeover happens.\nThere may be conversations taking place, but these are unrelated to the work. ',NULL),
	(85,'393f1b','4-34','Student physically shows by taking over the peer\'s computer, no problem solving discussions are occurring, and another person(s) joins the discussion',NULL,NULL,NULL,NULL,NULL,'Student does the computing work for the peer. Another person is heard joining the two students as this is taking place.','Dialog clearly indicates it (\"Just do it for me\" / \"Let me show you\"/\"let me try it\"\nField notes can support this as well.\nAs the student is doing the work for the peer, a third person joins the interaction.\nAdult: Here, let me show you how to do that. \nStudent: I was trying to make a triangle.\nAdult: Just watch.\nPeer: Cool. Did you use the repeat block?','If no direct audio evidence exists, refer to field notes on whether student actually takes over peer\'s computer. ',NULL),
	(86,'ec1187','4-35','Student physically shows by taking over the peer\'s computer, and problem solving discussions are occurring',NULL,NULL,NULL,NULL,NULL,'The student takes over the peer\'s computer, but does so while offering an explanation or providing support through discussion. ','Student: Here, let me show you how I did it.\nPeer: Sure, be my guest.\nStudent: See where I am getting this block from?','If  no direct audio evidence exists refer to field notes on whether student actually takes over peer\'s computer.',NULL),
	(87,'9d4e4e','4-36','Student physically shows by taking over the peer\'s computer, problem solving discussions are occurring, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'While the student is doing the computing task for the peer, the student is talking through the steps for problem solving. During the discussion, another person joins the conversation.','S: Here, let me show you how I did it.\nP: Sure, be my guest.\nS: See where I am getting this block from?\nP2: Yep, you can use that , but there is another way to do it as well.\nS and P(in unison): For reals\n\n?',' If no direct audio evidence exists refer to field notes on whether student actually takes over peer\'s computer.\nTimestamp when the other person(s) joins the discussion.\nCode this only when the third person joins the discussion with problem-solving comments.\nJoining with non problem-solving comments does not get coded.',NULL),
	(88,'81d8cf','4-37','Student and peer discuss a difficulty or problem, and then student directs peer to another peer or adult',NULL,NULL,NULL,NULL,NULL,'This interaction begins with a discussion initiated by either the peer or the student. The student then directs the peer to another person for assistance.','S: I\'m wondering why that sprite isn\'t cloning  like I want it to... \nP:Clones are pretty advanced. \nS: This looks right to me, but you may want to talk to Ms. Tuscadero about that.  She is great with cloning.','Timestamp when the adult directs the student to a peer or another adult.',NULL),
	(89,'c1225a','4-38','Student directs peer to talk to another peer or adult',NULL,NULL,NULL,NULL,NULL,'This interaction DOES NOT begin with a discussion initiated by either the student or the peer. The student simply directs the peer to another person for assistance.','Peer: \"I can\'t make it move...\"\nStudent: \"Go ask Mrs. Murrey.\"','This interaction is not a continuation of discussion between peer and student. ',NULL),
	(90,'55c726','4-39','Student clearly states that he or she does not know how to help',NULL,NULL,NULL,NULL,NULL,NULL,'I have no idea how to solve this problem.\n\"It confused me too...\"','Only code this if there is no redirecting happening.',NULL),
	(91,'1f25e9','4-40','Student clearly states that he or she does not want to help',NULL,NULL,NULL,NULL,NULL,NULL,'Sorry, I have to work on my task now.\n\"You\'re supposed to figure it out by yourself.\"','Only code this if there is no redirecting happening.',NULL),
	(92,'20377b','4-41','Student\'s cursor stops moving for more than 30 seconds, or the student leaves station (> 30 seconds) and returns to independently work [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Timestamp this code at the point where the student leaves the station or the student\'s cursor stops moving. Begin the next path at the point where the student returns to their station or the cursor begins moving.',NULL),
	(93,'6c93ea','4-42','Interaction terminates [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(94,'125cd7','5','Was the problem solved or not solved? (Was the difficulty solved?)',NULL,NULL,NULL,6,NULL,NULL,NULL,NULL,NULL),
	(95,'ecb144','5-1','Problem was not solved',NULL,NULL,NULL,NULL,NULL,'The problem or difficulty that the student faced was not solved. ','Scratch: Student works independently on one problem/difficulty (making the sprite move) and then shifts to another task (working on the background). ','Pick this choice when, at the end of an interaction or independent work (which may involve several attempts of problem-solving), the problem is not solved.\n\nCode if:\nInteraction or independent work ends without the problem being solvedInteraction changes to socialization/non-problem-solving without problem being solvedAnother party joins without the problem being solvedVideo ended but the problem remained unsolved.Student stopped working on the problem.Timestamp the same time as the code immediately preceding\n\nSwapping from (problem-solving) interaction to independent work:\nWhen we see 10 seconds of independent work without interaction, then we go back to the end of the interaction and (same timestamp for each):?code \"problem not solved\"\nthen interaction termination?then immediately start coding independent work',NULL),
	(96,'990d2d','5-2','Problem was solved',NULL,NULL,NULL,NULL,NULL,'The problem/difficulty the student faced was perceived to be solved by the student. This may not necessarily mean that the problem was solved correctly, more efficiently, or optimally. It is about the student\'s perception of \"problem solved\" Use field notes to describe the problem solving solution in detail.  ','Possible evidence:  The conversation indicates that the problem was solved (e.g. student successfully located the shrink button, saying \"Oh! Thank you!\")Evidence on the screen (e.g. Code.org success feedback; the code successfully worked as expected).','Pick this choice when, at the end of an interaction or independent work (which may involve several attempts of problem-solving).\n\nCode as soon as there is evidence to show that the problem is perceived solved (success screen on code.org, etc). If it is a programming challenge, a piece of evidence could be the student successfully running the program. The problem does not need to be solved correctly -- the student only needs to believe the problem was solved correctly, even if s/he is incorrect. (e.g. confuses left/right, counts incorrectly, etc.)\n\nIf the student believes that the problem is solved and there is no functional difference in their technically incorrect solution (student asked for spelling help and ended up spelling something wrong), code as problem solved.',NULL),
	(97,'3710bb','6','What is the nature of the student\'s computing-related communication with the peer or adult?',NULL,NULL,1,7,1,NULL,NULL,NULL,NULL),
	(98,'41cade','6-1','Student questions peer about something associated with peer\'s work',NULL,NULL,NULL,NULL,NULL,'Student asked questions about peer\'s work. This is not part of a problem-solving discussion. ','Wow...that\'s cool. How did you make it ? \"How many sprites you have in your program?\" \"Which block did you choose?\"\n\nEvidence on screen: e.g. student may or may not stop working, and we hear that the student is asking some questions. ','Code this when ?student asked any kind of questions related to peer\'s work without a request for help, even if it may lead to a problem-solving conversation. \nOne-off rule applies. There has to be evidence of an interaction. ',NULL),
	(99,'6f1a57','6-2','Student verbally comments about his/her own work, e.g. accomplishment',NULL,NULL,NULL,NULL,NULL,'Student commented on his/her own work, showing excitement/accomplishment to the peer or adult about his/her own work. ','S: \"It is cool right?\"\nP: Yeah, cool. \nS: \"Look what I did! I made a fun story!\"\nP: How\'d you do that\n\nS: Comments on what they did. ','Code this when ?student comment (show how he/she feels or what he/she did on his/her work); there is no clear request for problem-solving, even if it may lead to a problem-solving conversation.\nEvidence of back-and-forth must be present. One-off rule applies. ',NULL),
	(100,'9ec392','6-3','Student verbally comments about something associated with peer\'s work',NULL,NULL,NULL,NULL,NULL,'Student made comments on peer\'s work without the intention for help-seeking or discussion.','S: \"That\'s nice.\"\nP: \"Oh it\'s a cool animation!\"\nS: \"I like your background.\"?\"You can add another sprite...\"','Code this when student generally talks about how he/she feels about the peer\'s work, or the suggestions he/she have regarding peer\'s work which may lead to a help-seeking path. \nEvidence of back-and-forth must be present. One-off rule applies. ?',NULL),
	(101,'4d95d2','6-4','Student expresses dissatisfaction or frustration',NULL,NULL,NULL,NULL,NULL,'The student verbally expresses their frustration or dissatisfaction with their work.','E.g.1\nS:\"This sucks!\"\nPeer: \"What?\"\n?e.g.2\nS:\"This is boring\" \nP: \"Sorry man. Life sucks sometimes.\"','Code this when a student expresses frustration without a specific, verbal request for help, even if the frustration leads to a problem-solving response from peer/adult. This may be self-talk. \nOne-off rule DOES NOT apply. Code this even it is an one-off (see example).',NULL),
	(102,'7c3097','6-5','Student says something that is unclear or inaudible',NULL,NULL,NULL,NULL,NULL,'Choose this code when the recording did not capture what student was saying; or if the audio is unclear.','S: Heyyyyyy! Okay, okay, so , I know I went there, now I got to go (inaudible). (Inaudible self-talk)\nNoise','Choose this code when the recording did not capture what student was saying; or if the audio is unclear.',NULL),
	(103,'d518e6','6-6','Peer questions student about something associated with student\'s work',NULL,NULL,NULL,NULL,NULL,'Peer asked questions about student\'s work. This is not part of a problem-solving discussion. ','Examples: \"Where did you find this sprite?\"?\"Which level are you working on?\"?\"How did you make it move like that?\"?\"How did you draw that sprite?\"\n\nNon:examples: What are you doing this weekend? Is our science test today?','Code this when ?student asked any kind of questions related to peer\'s work without a request for help, even if it may lead to a problem-solving conversation. \nOne-off rule applies. There has to be evidence of an interaction.',NULL),
	(104,'2ad3e4','6-7','Peer verbally comments about something associated with his/her own work, e.g. accomplishment',NULL,NULL,NULL,NULL,NULL,'Peer commented on his/her own work, showing excitement/accomplishment to the student or adult about his/her own work. ','P: \"It is cool right?\"\nS: Yeah, cool. \nP: \"Look what I did! I made a fun story!\"\nS: How\'d you do that\n\nP: Comments on what they did.','Code this when ?peer comment (show how he/she feels or what he/she did on his/her work); there is no clear request for problem-solving, even if it may lead to a problem-solving conversation.\nEvidence of back-and-forth must be present. One-off rule applies.',NULL),
	(105,'3e74d1','6-8','Peer verbally comments about something associated with student\'s work',NULL,NULL,NULL,NULL,NULL,'Peer made comments on student\'s work without the intention for help-seeking or discussion.','Examples:\nP: \"That\'s nice.\"\nS: \"Oh it\'s a cool animation!\"\nP: \"I like your background.\"?\"You can add another sprite...\"\n\nNon-Example: \"How did you do that?\" ','Code this when the peer generally talks about how he/she feels about the student\'s work, or the suggestions he/she have regarding peer\'s work which may lead to a help-seeking path. \nEvidence of back-and-forth must be present. One-off rule applies.',NULL),
	(106,'be878a','6-9','Peer expresses dissatisfaction or frustration',NULL,NULL,NULL,NULL,NULL,'Frustration-expressing path. Any verbalization that indicates the peer is distressed, confused, etc. about the computing ask (does not need to be programming)?The peer verbally expresses their frustration or dissatisfaction with their work.','E.g.1\nP:\"This sucks!\"\nS: \"What?\"\nP: I hate coding\nS: Why? I love making this rocket ship. Look... .\n\ne.g.2\nP:\"This is boring\" \nS: \"Sorry man. Life sucks sometimes.\"\nP: You are not being a very sympathetic friend\nS: Ok. I\'ll do better. ','Code this when a peer expresses frustration without a specific, verbal request for help, even if the frustration leads to a problem-solving response from peer/adult. This may be self-talk. \nOne-off rule applies.',NULL),
	(107,'53e98d','6-10','Peer says something that is unclear or inaudible',NULL,NULL,NULL,NULL,NULL,'Choose this code when the recording did not capture what the peer was saying; or if the audio is unclear.','S: Heyyyyyy! Okay, okay, so , I know I went there, now I got to go (inaudible). Now I\'ve got to move forward. Move forward (adds another block), now how am I going to get down? (Inaudible self-talk)\nNoise','Choose this code when the recording did not capture what student was saying; or if the audio is unclear.',NULL),
	(108,'e7d1ec','7','What is the student/peer/adult\'s response to the initial computing-related communication?',NULL,NULL,1,7,NULL,NULL,NULL,NULL,NULL),
	(109,'242880','7-1','Peer verbally responds to the student\'s comment about student\'s work (e.g. curiosity, excitement, or frustration)',NULL,NULL,NULL,NULL,NULL,'The peer responds to something the student said about the student\'s computing wor (e.g.curiosity, excitement and frustration about the project, the peer responded). ','S: \"Don\'t you think it\'s awesome?\"?\"I know, that\'s cool.\"\nS: \"It\'s so hard for me to focus on my code.\"\nP: \"Me too/I agree.\"','The discussion is not related to the process of problem solving. \nIf this interaction leads into problem solving, switch to problem solving path.\nIf already in a problem solving path and a peer expresses curiosity, exitecement or frustration, note that in field notes and continue to code in the problem solving path. ',NULL),
	(110,'629874','7-2','Adult verbally responds to the student\'s comment about student\'s work (e.g. curiosity, excitement, or frustration)',NULL,NULL,NULL,NULL,NULL,'When the student engaged in the interaction with adult and express curiosity, excitement and frustration about the project, AND the adult responded. ','S: \" What\'s this character, a creep dog?\"\nA: \"Yes, It\'s not creep. It\'s just a kind of dog.\"\n\nS: \"I don\'t want to do this. I am exhausted now.\"\nA: \"You can have one minute break and try it again. Or you can try another project.\"','The curiosity, excitement and frustration is not related to the process of problem solving. \nIf this leads into problem solving, switch to problem solving path.\nIf already in a problem solving path and a peer expersses curiosity, exitecement or frustration, note that in field notes and continue to code in the problem solving path. ',NULL),
	(111,'1fb40a','7-3','Interaction terminates [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(112,'947465','7-4','Student/peer/adult ignored or cannot hear or code the response',NULL,NULL,NULL,NULL,NULL,'The student/peer/adult ignores the questions.?Or the audio of the response is not clear enough to hear and code.','S: \"How can I code this?\"\nOthers: ... ..','When using this code, make sure there is no response and inaudible. \nIgnore : 10 seconds\nInaudible: No need for 10 seconds\nIf the peer/adult responds, but it\'s after 10 seconds, that\'s ok. Just put it in field notes. ',NULL),
	(113,'1ded37','7-5','Student/peer/adult says something that is unclear or inaudible',NULL,NULL,NULL,NULL,NULL,'You cannot hear what the student/peer/adult said clearly.','Recording cannot be heard.','The audio is unclear to code. ',NULL),
	(114,'35cacd','7-6','Student verbally responds to the peer\'s comment about student\'s work (e.g. curiosity, excitement, or frustration)',NULL,NULL,NULL,NULL,NULL,'When the student engages in the interaction with peer and the peer expresses curiosity, excitement and frustration about the project, AND the student responds. ','P: \"Which character are you coding\n\nS: \"The cat. See? I\'m making her into a zombie cat.\nP: Cool. I like her red eyes.\nS: Yeah,','The curiosity, excitement and frustration is not related to the process of problem solving. \nIf this leads into problem solving, switch to problem solving path.\nIf already in a problem solving path and a peer expersses curiosity, exitecement or frustration, note that in field notes and continue to code in the problem solving path. ',NULL),
	(115,'8c2517','7-7','Student offers support to peer (the peer did not specifically ask for help)',NULL,NULL,NULL,NULL,NULL,'The student provides help for peers while the peer is working on his/her project.','Example 1: \nP: working independently and occasionally sighing. \"Hhhhhhhh\" \nS: \"Can I help you to solve the problem?\"\nP: That would be amazing. Thanks. \n\nExample 2:\n\nP: Works independently. Sighs. \"Hhhhhhh\"\nS: Do you want help? \nP: Not heard on computer, ignored, or says no','The peer does not ask the student for the help. Student provides help voluntarily.\nOne-off rule does not apply (example 1). ',NULL),
	(116,'0232f5',NULL,'[empty node]',NULL,'Timestamp this code at the point where the student leaves the station or the student\'s cursor stops moving. Begin the next path at the point where the student returns to their station or the cursor begins moving.',NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(117,'9da550','8','How did the student/peer respond to the non-computing conversation?',NULL,NULL,1,8,NULL,NULL,NULL,NULL,NULL),
	(118,'ed0549','8-1','Peer verbally responds to student\'s non-computing conversation',NULL,NULL,NULL,NULL,NULL,'Peer and student in the conversation. And peer response to the student. The conversation is not related to computing.','S: \"When will the class be over\n\nP: \"10 am\"\nS: Cool. I can\'t wait for recess!\nP: Yeah, let\'s go to the monkey bars!','The conversation is NOT related to the process of problem solving or computing. \nIf this interaction leads into problem solving, switch to problem solving path.\nIf already in a problem solving path and a peer expresses curiosity, exitecement or frustration, note that in field notes and continue to code in the problem solving path. \nOne-off rule applies here. ',NULL),
	(119,'434981','8-2','Adult verbally responds to student\'s non-computing conversation',NULL,'Timestamp this code when the interaction begins. Create a new path for the interaction and start it ',NULL,NULL,NULL,'Adult and student in the conversation. Adult responses to the student. The conversation is not related to the computing.','S: When is recess\n\nAdult: In 10 minutes\nS: Why can\'t it be NOW!!!!\nAdult: Time doesn\'t work that way. \nS: Ok. ','The conversation is NOT related to the process of problem solving or computing. \nIf this interaction leads into problem solving, switch to problem solving path.\nIf already in a problem solving path and a peer expresses curiosity, exitecement or frustration, note that in field notes and continue to code in the problem solving path. \nOne-off rule applies here.',NULL),
	(120,'7b114c','8-3','Interaction terminates [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(121,'798662','8-4','Student/peer/adult ignores or cannot hear or code response',NULL,NULL,NULL,NULL,NULL,'The student/peer/adult ignores the questions.?Or the audio of the response is not clear enough to hear and code.','Ignore:\nS: How many minutes left for this class\n\nP/A ignores the question and does not respond.','When using this code, make sure there is no response and inaudible. \n\nIgnore : 10 seconds\nInaudible: No need for 10 seconds\nIf the peer/adult responds, but it\'s after 10 seconds, that\'s ok. Just put it in field notes. ',NULL),
	(122,'6b445c','8-5','Peer or adult redirects student to the computing task',NULL,NULL,NULL,NULL,NULL,'Peer or adult interacts with student and tells the student to get back to the computing project.','P: \"Let\'s get back to the Scratch activity. How about we try the \'when\' block.\"','One-off rule does not apply here.',NULL),
	(123,'360fc7','8-6','Student/peer/adult says something that is unclear or inaudible',NULL,NULL,NULL,NULL,NULL,'You cannot hear what the student/peer/adult said clearly.','Recording cannot be heard.','NuLL',NULL),
	(124,'ebcb13','8-7','Student verbally responds to peer\'s non-computing conversation',NULL,NULL,NULL,NULL,NULL,'Student responds and engages in non-computing conversation.','P: \"I am going to Disney this weekend.\"\nS: \"That\'s awesome. Which park will you go to\n\nP: I think Animal Kingdom.','The conversation is NOT related to the process of problem solving or computing. \nIf this interaction leads into problem solving, switch to problem solving path.\nIf already in a problem solving path and a peer expresses curiosity, exitecement or frustration, note that in field notes and continue to code in the problem solving path.\nOne-off rule applies',NULL),
	(125,'0885ff','8-8','Student redirects peer to the computing task',NULL,NULL,NULL,NULL,NULL,'Student interacts with peer and leads peer(s) back to the computing project.','P: \"Will you adopt a cute cat?\"\nS: \" Can you continue your coding?\"','One-off rule does apply here. If the peer is a participant. \nTake close field notes that can then be used to help code the peer\'s video including timestamps. ',NULL),
	(126,'7db3b1',NULL,'[empty node]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(127,'7ac70e',NULL,'[empty node]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(128,'9591c0','9','How does the event end or continue? (Independent Path)',NULL,NULL,NULL,2,NULL,NULL,NULL,NULL,NULL),
	(129,'08cfb9','9-1','Student\'s cursor stops moving for more than 30 seconds, or the student leaves station (> 30 seconds) and returns to independently work [end path]',NULL,'Timestamp this code at the point where the student leaves the station or the student\'s cursor stops moving. Begin the next path at the point where the student returns to their station or the cursor begins moving.',NULL,NULL,NULL,NULL,NULL,'Timestamp this code at the point where the student leaves the station or the student\'s cursor stops moving. Begin the next path at the point where the student returns to their station or the cursor begins moving.',NULL),
	(130,'ea409a','9-2','The video record ends [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(131,'3fcc28','9-3','Student independently solves a problem previously discussed during an interaction [end path]',NULL,NULL,NULL,NULL,NULL,'Student goes back to a problem that they previously did not solve and works on this problem. This problem may or may not get solved during this independent work time. ','Example: Student works collaboratively on Problem #2 and says, \"Hold up. I can do this to my Cow sprite!\" Interaction terminates. Student goes to the Cow Sprite and fixes the code independently. ','How to code this scenario: \nOnly way to get to Node 9 is through Node 1. In these cases, go to \"Other\" and use field notes to describe. \"Other\" will take you to Node 1 and then go to subcode choices 1-4 or 1-5.  \nMake sure that you label the path with the corresponding problem (e.g. problem 1 vs problem 2).\nThe 30-second independent work rule MAY OR MAY NOT apply here. (eg. students work collaboratively on something, they switch to the independent work).',NULL),
	(132,'e75b96','9-4','Interaction begins [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Timestamp this code when the interaction begins. Create a new path for the interaction and start it at the same timestamp.',NULL),
	(133,'90973c','9-5','Student switches to a computing related task while working independently [self loop]',NULL,NULL,NULL,NULL,NULL,'Initially, the student is doing non-computing independent work. The student then switches to independently working on the computing task.','Example: Student was playing Minecraft and then switched to Scratch. \nNon-example: Student was playing the finished Scratch project and switched to Scratch programming. (put in the field notes that student is running previous code).','Switch from 1-5 to 9-4:\nInitially, the student is doing non-computing independent work. The student then switches to independently working on the computing task.',NULL),
	(134,'5c3968','9-6','Student switches to a non-computing task while working independently [self loop]',NULL,NULL,NULL,NULL,NULL,'Initially, the student is doing computing independent work. The student then switches to non-computing independent activity','Example: Student was working in Scratch and then switched to Minecraft. \nNon-example: Student was working on a Code.org puzzle and then switched to a previously completed Code.org puzzle to play that puzzle. (Put in field notes that the student is rerunning previous code) ','Switch from 1-4 to 9-5:\nInitially, the student is doing computing independent work. The student then switches to non-computing independent activity\nOnly use this code when the student switches to something completely unrelated to the computing task such as a YouTube video, other video game, drawing something on paper evident from field notes, etc. ',NULL),
	(135,'2789f0',NULL,'How does the event begin?',NULL,NULL,NULL,9,NULL,NULL,NULL,NULL,NULL),
	(136,'52731b','1-1','Student addresses Peer','Peer ID',NULL,NULL,NULL,NULL,'Beginning of an interaction where the student whose data we are analyzing addresses a peer, adult, or group of people','Help seeking:\n\"Hey, can you help me?\"\n\"Rachel, can you help me?\"\n\"I need help.\" (especially if followed by more directed help seeking behavior)\n\nStudent: \"Ms. X, can you help?\"\nAdult: \"Okay let\'s see. [turns to class management] Everyone needs to work at voice level one! [turns back to the student] Okay, what did you change?\"\n\nComputing related comment (Excitement, frustration, general conversation):?\"Rachel, look what I did!\"','Ten second rule:If any independent work takes place between interaction attempts (end of one attempt to the start of the next), code as two separate interactions with independent work between\n\nElse if >= 10 seconds between attempts, code as two separate interactionsElse, code as same interactionIncidental interactionsOne call-and-response socialization interaction does not get coded.\n\nA more extended interaction, or a pattern of short interactions, do get coded.\n\nPattern of interactions: [TENTATIVE] if you see three one-off interactions of any kind within three minutes, code all one-off interactions, and keep coding future one-offs until three minutes have passed without a one-off.\n\nSupport seeking/offering behavior is always coded unless it\'s potentially self-talk in the form of a question.If adult/peer leaves temporarily and comes back to the conversation that the student has started, code as same interaction instead of 1-1 and 1-3.',NULL),
	(137,'21b330','1-2','Peer addresses Student','Peer ID',NULL,NULL,NULL,NULL,'Beginning of an interaction wherein a peer or an adult addresses the student whose video we are analyzing. ','Peer: Hey, that\'s cool. How\'d you do that? \nStudent responds\n\nPeer: Hey, Can you help me with this? \nStudent responds\n\nAdult: Hey, that\'s cool. How\'d you do that? \nStudent responds\n\nAdult: \"Hey, can you get back into the project?\" \nStudent \"I\'m stuck. It\'s too hard.\" \nAdult, \"Ok. Let\'s see what\'s going on.\"','Don\'t code initial exposition interaction (\"What is your computer number, what are you working on\") unless:Interaction lasts more than a minuteInteraction moves to a problem (\"How do I log in?\" \"are you seeing this movie this weekend?\"). Then timestamp/start coding when the student asks for help.If confused whether student is help-seeking or self-talking, look for evidence of an interaction attempt. If no evidence exists, code as independent work.',NULL),
	(138,'8e716f','1-3','Student addresses Adult','Adult ID',NULL,NULL,NULL,NULL,'Beginning of an interaction where the student whose data we are analyzing addresses a peer, adult, or group of people','Help seeking:\n\"Hey, can you help me?\"\n\"Rachel, can you help me?\"\n\"I need help.\" (especially if followed by more directed help seeking behavior)\n\nStudent: \"Ms. X, can you help?\"\nAdult: \"Okay let\'s see. [turns to class management] Everyone needs to work at voice level one! [turns back to the student] Okay, what did you change?\"\n\nComputing related comment (Excitement, frustration, general conversation):?\"Rachel, look what I did!\"','Ten second rule:If any independent work takes place between interaction attempts (end of one attempt to the start of the next), code as two separate interactions with independent work between\n\nElse if >= 10 seconds between attempts, code as two separate interactionsElse, code as same interactionIncidental interactionsOne call-and-response socialization interaction does not get coded.\n\nA more extended interaction, or a pattern of short interactions, do get coded.\n\nPattern of interactions: [TENTATIVE] if you see three one-off interactions of any kind within three minutes, code all one-off interactions, and keep coding future one-offs until three minutes have passed without a one-off.\n\nSupport seeking/offering behavior is always coded unless it\'s potentially self-talk in the form of a question.If adult/peer leaves temporarily and comes back to the conversation that the student has started, code as same interaction instead of 1-1 and 1-3.',NULL),
	(139,'87dfa4','1-4','Adult addresses Student','Adult ID',NULL,NULL,NULL,NULL,'Beginning of an interaction wherein a peer or an adult addresses the student whose video we are analyzing. ','Peer: Hey, that\'s cool. How\'d you do that? \nStudent responds\n\nPeer: Hey, Can you help me with this? \nStudent responds\n\nAdult: Hey, that\'s cool. How\'d you do that? \nStudent responds\n\nAdult: \"Hey, can you get back into the project?\" \nStudent \"I\'m stuck. It\'s too hard.\" \nAdult, \"Ok. Let\'s see what\'s going on.\"','Don\'t code initial exposition interaction (\"What is your computer number, what are you working on\") unless:Interaction lasts more than a minuteInteraction moves to a problem (\"How do I log in?\" \"are you seeing this movie this weekend?\"). Then timestamp/start coding when the student asks for help.If confused whether student is help-seeking or self-talking, look for evidence of an interaction attempt. If no evidence exists, code as independent work.',NULL),
	(140,'c83b4e','1-5','Student works independently on a computing related task',NULL,NULL,NULL,NULL,NULL,'Beginning of independent path','Student is working on their computer doing work related to the task. The student may or may not use self-talk. \n\nStudent: \"Oh geez. That didn\'t work. Hmmmm. Ok.\"\nNo response from anyone.\n\nStudent works on asset development and management: E.g. Looks for an image or sound for their computational artifact\n\nRefer to node 3 on categorization of the nature of task.\nAn example can be a task on academic content, navigating software (e.g. logging in, changing levels), asset creation and management (e.g. creating/modifying/resizing images, recording/editing audio), general computer technology (e.g. mouse, monitor, adapter)','Code as soon as student starts working independently on task (as soon as mouse moves), end path when evidence of independent computing work ends (e.g. interaction begins, student works independently on non-computing task, mouse stops moving for 30 seconds, video ends)\n\nThe mouse may or may not be moving. (e.g, student may be watching a tutorial) \n\n*Take field notes about what the student is doing while working independently including: What they are working on, if they are engaged in self-talk, what are they saying (e.g. steps, frustration expression)',NULL),
	(141,'666ca8','1-6','Student works independently on a non-computing task',NULL,NULL,NULL,NULL,NULL,'Beginning of independent path','Student is on Minecraft while the class is doing a Scratch activity. ','This code refers to any off-task type behaviors. The student is not working on the expected computational activity. \n\nTake field notes on what the student is doing. ',NULL),
	(142,'b31dcc','1-7','Student joins peer conversation',NULL,NULL,NULL,NULL,NULL,'The student is heard (on their computer and/or that of a peer being observed) joining into a peer\'s conversation with a third party. Evidence may also exist in observation field notes.','Student: \"What did you just say about how you solved that puzzle?\"\nPeer responds\n\nStudent: \"I was thinking about trying to make a maze game too.  How many sprites do you have?\"\nPeer responds','Engagement in a conversation requires that there is a back and forth among at least two parties.  See rules for one-offs. \nThere has to be evidence of at least 3 people involved. ',NULL),
	(143,'effa06',NULL,'How does the interaction with the peer or adult begin or continue?',NULL,NULL,NULL,13,1,NULL,NULL,NULL,NULL),
	(144,'da6dbb','2-1','Student clearly expresses how he or she needs help with a difficulty or problem',NULL,NULL,NULL,NULL,NULL,'Two elements must be present for this code: 1.  A statement or request for help, and 2. Some explicit description of what the student needs help with. ','For example: \nS: I found a bug, I just don\'t know how to fix it.\nT: Oh, o.k. (Teacher stops to do whole class and individual redirection)\nT: O.k., so you found the problem. So what is the problem\n\nS: There is 3 instead of 1 on Mars (?) Three instead of one.\nT: O.k., so where does the program tell it how many moons to put\n\nIn this interaction, the student did not explicitly say what the problem was at the beginning of the interaction, but with prompting and scaffolding, she explained the problem. Therefore, it was decided this instance was coded 2-0.','Code the timestamp as soon as the student asks for help, but choose between 2-0 and 2-1 after hearing more of the interaction. \n\nTake into consideration the interaction that follows the timestamp while deciding which code to choose. In other words, the chosen code should reflect the initial discussion that follows instead of considering only the very first sentence the student says. See below.\n\nIn Scratch: Student needs to verbally express the problem that they need help with, even if they only express it after prompting. (\"I want to make the guy go \'rwaaaah\'\"). Otherwise code 2-1. \"It\'s not working\" is an example of not clearly articulating the problem. \n\nStudent may seek attention (\"Hi Mr. Lash\") first without articulating the problem in the first utterance (\"I need help\"). If student then clearly expresses the problem with scaffolding, code 2-0.\n\nClear  expression should happen either in the initial call for help or after the peer/adult asks, \"what\'s up/what are you trying to do?\"\n\nIf the student only expresses the problem after discussion with adult/peer, this option will never get selected for this problem discussion.',NULL),
	(145,'2e2236','2-2','Student expresses a need for help, but is not explicit to the difficulty or problem',NULL,NULL,NULL,NULL,NULL,'Student is heard asking for help (not self talk)','Can you help me?\n\"Rachel, help me!\"?\"Mr. Gibson, It\'s not working.\" (Directed at a peer or adult)\n\nNon-example: Student: \"It\'s not working.\" \"I don\'t know what\'s going on.\" No response from a peer/adult, no observation record of addressing peer/adult','See 2-0\nRule: The student clearly addresses a peer or adult. There has to be some evidence that the student is addressing someone and not engaged in self-talk. \nIf it is unclear whether the student is engaging in self talk vs. attempting help seeking, do not code as help seeking. ',NULL),
	(146,'4d4acd','2-3','Student discusses computing (not problem solving)',NULL,NULL,NULL,NULL,NULL,'Discussing anything related to the computing task or about any computation that is not a problem. ','Examples: \"Look at what I did. It\'s a black hole. I made a black hole.\"?\"This is cool. How did you make that?\"\n\nNon-Examples:?\"I can\'t log in\" (problem related interaction or self talk)\n\"Hmm, I wonder why this isn\'t working\" (problem related interaction or self talk)?\"What did you do this weekend?\" (Non-computing conversation)','-Evidence that the student is addressing a peer/adult and not engaged in self-talk. ?-No evidence of a problem-related conversation',NULL),
	(147,'262e59','2-4','Student engages in non-computing conversation',NULL,'Describe the support in the field notes.',NULL,NULL,NULL,'Non-computing  is a conversation  outside the scope of anything related to computing/coding. It can be conversations about the weather, a person, an event, etc.','Examples: \nStudent: \"What happened to Rachel?\"\nPeer: I don\'t know. Maybe she went to the bathroom.\nStudent: I really liked her necklace. \nPeer: Yeah, I want one. \n\nNon Example (one off): \nStudent: \"Pretty necklace!\"\nPeer: \"Thanks\" End of conversation','Code as \"non-computing\" when the student and a peer/adult have a conversation that involves some back-and-forths. \nIf no one responds to the student or gives a short answer such as \"yes/or\" or \"I don\'t know\", then it may be omitted. \nDo not code if it\'s a \"one off\"=Student says something, and peer answers with short response which ends the interaction. \nOne off rule:  Student says something, and peer answers with short response which ends the interaction. Do not code.',NULL),
	(148,'f11803','2-5','Student offers support to peer (the peer did not specifically ask for help)',NULL,NULL,NULL,NULL,NULL,'The student offers unsolicited assistance to a peer as heard in the audio recording.  Visual evidence may be that the student stops working on their own computer. ','S: Looks like you need help, yo? \nS: \" Oh! I\'ve done that before.  You have to change the orientation of your sprite.\"\nP: \"How do I do that?\"\nS: Click on the sprite first on the bottom right of the screen and then change where it says, direction\". \nP: Oh, right there?','Note that this is different than the peer asking the student for help. Only code if the offer for help is unsolicited. ',NULL),
	(149,'58c900','2-6','Student says something that is unclear or inaudible',NULL,NULL,NULL,NULL,NULL,'Coder is unable it discern what the student says. This may be due to background noise, the student speaking softly or other reason such as those having to do with tech issues.','S: I really (inaudible).  I wish someone would (inaudible) jars of pickles.','Choose this code if you cannot discern what is said or are not sure.  In the field notes, add what you think may have been said.',NULL),
	(150,'541093',NULL,'Student verbally addresses a person without expressing the offer or need for help, curiosity, excitement, accomplishment or non-computing conversation (e.g., \"Hey you...\" or \"Mrs. S...\" or \"Stop that!\")',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(151,'aeb05b','2-7','Peer offers self-regulation support to student',NULL,NULL,NULL,NULL,NULL,'While support is offered, it is not directly related to computing. This may include cheering a friend on, giving them positive affirmations, reminding them of a strategy for helping them to focus, etc. ','P: I know it is really hard.  I know you can do it.  Do you need to take a break?\"','One-off rule does not apply (just as in problem solving) Code if the interaction is peer driven (e.g. the peer initiated the discussion). Code if the support is related to self-regulation. This is not direct support in solving a computing problem on its own but may be related to a student expressing or showing frustration or  difficulty with such a problem. ',NULL),
	(152,'5ba6f5','2-8','Peer offers support to student who was working collaboratively on a problem or topic',NULL,NULL,NULL,NULL,NULL,'A third party peer joins in to an existing instance of collaboration to offer further support. ','S: I think we need to use a conditional statement here.\nP1: Why do you think that\n\nP2: You are trying to have the car sense the wall of the race track right?  \"If hits wall, then bounce.\" Make sense right\n\nS: See, that is a conditional!','Code if the interaction is peer driven and the peer initiated the discussion.',NULL),
	(153,'f93287','2-9','Peer offers computing problem solving support to student who was working independently on a problem or topic',NULL,NULL,NULL,NULL,NULL,'A peer verbally offers computing-related support or help to the student being observed.','P:  Looks like you are stuck. I\'ve done that level.  Need help\n\nS:  Sure, I\'ve been working on this forever.\n\nNon-example:\nP: Do you want to walk to the water fountain to cool off a bit before we continue? ','Code if the interaction is peer driven and the peer initiated the discussion.\nDo not use this code if the peer is offering self regulation help. ',NULL),
	(154,'fa2db2','2-10','Peer discusses computing (not problem solving)',NULL,NULL,NULL,NULL,NULL,'A peer verbally addresses the student being observed and discusses some aspect of either the student\'s or the peer\'s computing activity, not related to a problem.','P:  I love changing the speed my sprite glides by to make it really fast.  Its hilarious!\nS:  Maybe if we make it super fast it will crash the computer!','Code if the interaction is peer driven and the peer initiated the discussion.\nNo evidence of a problem solving interaction. ',NULL),
	(155,'712191','2-11','Peer engages student in non-computing conversation (heard on student\'s computer)',NULL,'Describe the support in the field notes.',NULL,NULL,NULL,'A peer verbally addresses the student being observed and discusses something not related to computing (off task).','P: Whatever we are having for lunch smells awful!  \nS: Ya, I think I am going to barf.  Glad I brought my own lunch.\nP: I wish I did :(','Code if the interaction is peer driven and the peer initiated the discussion. \nThese conversations are outside of anything related to the classroom computing activity. ',NULL),
	(156,'5df510','2-12','Peer asks student for help',NULL,NULL,NULL,NULL,NULL,'A peer verbally requests help from the student being observed/recorded. ','Peer: \"Hey, how\'d you do that? I can\'t make the triangle.\" ','Consider this problem-solving. So the One-off rule does not apply. ',NULL),
	(157,'1722a1','2-13','Peer says something that is unclear or inaudible',NULL,NULL,NULL,NULL,NULL,'A peer verbally addresses the student being observed but what is said is unclear or inaudible due to background noise, technical issues or the volume of the peer\'s voice. ','P: I\'m... (inaudible) Ashtanga Yoga... (inaudible) and a fish sandwich! \nS: Totally.  I\'m down with that!','NuLL',NULL),
	(158,'b649d2',NULL,'Peer verbally addresses the student without expressing the need/offer for help, curiosity, excitement, accomplishment or non-computing conversation (e.g. \"Hey you...\" or  \"Can you stop that!\")',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(159,'668767','2-14','Adult offers self-regulation support to student',NULL,NULL,NULL,NULL,NULL,'Self regulation strategies offer students support in either monitoring their own learning, helping with dealing with frustration, and working with their peers. ','Take a deep breath and keep trying, you are almost there.?\n\"OK, what do you need to help you get back on track?\" ?\n\"Let\'s look at your project plan and see what you can do next.\" ','While support is offered, it is not directly related to specific computing problem solving. This may include cheering the student, giving them positive affirmations, reminding them of a strategy for helping them to focus, etc. \n\nThis code is used if the adult is helping the student work with a peer/peers',NULL),
	(160,'f77c01','2-15','Adult offers support to student who was working collaboratively on a problem or topic',NULL,NULL,NULL,NULL,NULL,'This is when the adult joins the conversation to offer support when the student and a peer are knowingly working collaboratively. ?This support can be either general problem solving or self-regulation support. ','What are you two doing to get the sprite over the rock? Do you need any help with that? \nS: \"myFolder, stop touching me, It\'s not nice!\"\nTeacher intervenes: \"Let\'s see if we can get you to work together a little better. Why don\'t you take turns with who\'s the navigator during your pair programming? \"','Add/refer to field notes about what is happening in the collaboration.\n\nThis support can be for programming, asset development/management, or any other computing-related task. \n\nOne-off rule does not apply because this is considered problem solving.?',NULL),
	(161,'3f9c83','2-16','Adult offers computing problem solving support to student who was working independently on a problem or topic',NULL,NULL,NULL,NULL,NULL,'Adult is heard offering the student support (not self-regulation) in solving their computational problem. Student is not heard asking for help. ','T: \"You\'ve been working on that for a while. Let\'s see if I can help a bit. What would happen if we moved that block into the repeat loop?\" ','Here, the student must be knowingly working independently. Add/refer to field notes about the nature of the situation.\n\nOne-off rule does not apply because it\'s problem solving. \n\nThis support is not self-regulation in nature. ',NULL),
	(162,'a863a2','2-17','Adult engages in non-computing conversation',NULL,NULL,NULL,NULL,NULL,'Adult is in conversation with the student about any topic unrelated to the computing task. ','T: Did you finish your math module\n\nS: Not yet. I want to do my art assignment first.\nT: When are you planning on finishing it\n\nS: After recess. \n\n(e.g. student has to finish a math problem, check recording, go to another room)','This code can be used both for general conversations or for problem-solving unrelated to computing.\nOne-off rule does apply here.',NULL),
	(163,'8851be','2-18','Adult discusses computing (not problem solving)',NULL,NULL,NULL,NULL,NULL,'Adult verbally addresses the student being observed and discusses some aspect of the student\'s computing activity, not related to a problem.','Adult: \"Oh dang. You made that dragon HUGE. Cool.\"\nS: \"Yeah, check out how I also made it dance!\"\nAdult: \"Nice. I wonder if you can make it dab?\" \nS: \"Ha, Ha. That\'s so lame and 2018. ','Code if the interaction is adult driven and the adult initiated the discussion.\nNo evidence of a problem solving interaction. ',NULL),
	(164,'cdc9a8',NULL,'Adult engages in non-computing conversation [heard on student\'s computer]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(165,'ec7320','2-19','Adult says something that is unclear or inaudible',NULL,NULL,NULL,NULL,NULL,'Coder is unable it discern what the adult says. This may be due to background noise, the student speaking softly or other reason such as those having to do with tech issues.','Adult: I really (inaudible).  I wish someone would (inaudible) jars of pickles.','Choose this code if you cannot discern what is said or are not sure.  In the field notes, add what you think may have been said. ',NULL),
	(166,'5ac2f4',NULL,'Adult verbally addresses the student without expressing the offer for help, curiosity, excitement, accomplishment or non-computing conversation (e.g., \"Can you please stop that!\")',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(167,'0b4e2a','2-20','Adult directs student to a computing task',NULL,NULL,NULL,NULL,NULL,'This code essentially refers to the adult redirecting the student away from a non-computing task, toward  computing related work.','A: \"Hey Lando, finish up your tunacolada, throw it away and come help me figure out how to finish this Angry Bird puzzle.\"\nS: \"O.k., cool.  I\'ll be right there.\"','Use this code only when the teacher is redirecting the student back to being on-task for the computing activity. \nOne-off rule does not apply. ',NULL),
	(168,'585692','2-21','Student\'s cursor stops moving for more than 30 seconds, or the student leaves station (> 30 seconds) and returns to independently work [end path]',NULL,NULL,NULL,NULL,NULL,'Student\'s cursor stops moving because student stopped working on what they were doing. No conversation is heard. ','Student moves to another student\'s computer. \nStudent stops working. \nNo evidence of computing-related \"off computer\" work. ','Refer to the field notes whether student is required to finish paper-based task with a peer, which is likely why student\'s cursor stops moving. In such a case, do not code this choice but keep coding it as interaction.\n\nThere may be multiple reasons for the mouse to stop moving (e.g. student watches a video in the computing environment, student works on pseudocode on paper, student goes to peer\'s computer). Only use this code if the student leaves the computer or is clearly off task. Do not use this code if the student is watching a relevant video or doing something off-computer that is related to the computing task. ',NULL),
	(169,'d92d7d','2-22','Interaction terminates [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Select when no answer from peer or adult is heard. ??Timestamp as soon as the last words spoken. ??Wait 30 seconds to make the judgement about whether the interaction ends. ',NULL),
	(170,'ef8f7e','2-23','The video record ends [end path]',NULL,NULL,NULL,NULL,NULL,'Videorecording stops. ',NULL,NULL,NULL),
	(171,'73ae21',NULL,'What was the problem? (This is referring to the difficulty not the subtask)',NULL,NULL,NULL,14,NULL,NULL,NULL,NULL,NULL),
	(172,'bcc9dd','3-1','Difficulty or problem or topic is related to programming',NULL,NULL,NULL,NULL,NULL,'Difficulty related to understanding the programming blocks (e.g. how to repeat, use conditional, etc.), or use other features that result in a student wanting to do a specific computing task (e.g. shrink a sprite, finding a Sprite in Scratch). ',NULL,'In Scratch, there are challenges with understanding the blocks, understanding order of blocks, etc. There are other features in the interface such as shrink that can also influence the program and should be considered computing/programming challenges.',NULL),
	(173,'81b16e','3-2','Difficulty or problem or topic is related to academic content',NULL,'Indicate the relevant categories in the field notes using the following keywords: \"computing/programming\", \"academic content\", \"navigating software\", \"asset creation/management\", \"general computer technology\", \"other\"',NULL,NULL,NULL,'The difficulty/problem is pertaining to the subject area of interest, such as math or science. Decide what the content area of interest is before you decide if a problem/topic is related.','If math is the content area of interest, then not knowing that a right angle is 90 degrees is related to \"academic content\". If science is the content area of interest, then it may be considered as related to computing/programming. ','Tentative: IF trying to decide between computing/programming and academic content, choose computing/programming unless academic content is keeping student from being able to perform project. A spelling question wouldn\'t qualify; a misunderstanding about angles that prevents the student from solving a code.org would qualify.\n\nIf the student specifically asked a question about academic content, code academic content.',NULL),
	(174,'2926b7','3-3','Difficulty or problem or topic is related to navigating software',NULL,NULL,NULL,NULL,NULL,'The difficulty/problem pertains to understanding how the programming software runs. Once a student logs into the program and demonstrates basic interface navigation, this code will be less likely to appear. ','Understanding what the tools do in the image editor when initially using Scratch (e.g. logging in, changing levels)','This code may be difficult to tell until watching the video for a while. Sometimes it seems that there is one difficulty, but the video continues and the problem may be need to be reevaluated. ',NULL),
	(175,'eb0e22','3-4','Difficulty or problem or topic is related to asset creation and management',NULL,NULL,NULL,NULL,NULL,'Student has difficulty creating/modifying/resizing images, recording/editing audio','e.g. , Working on the visuals of a sprite instead of the code\nStudent can\'t find where the sprites are in the Scratch environment, ','NuLL',NULL),
	(176,'0f1899','3-5','Difficulty or problem or topic is related to general computer technology',NULL,NULL,NULL,NULL,NULL,'Student has difficulty using the computer in general. This is unrelated to programming or navigating software. ','E.g. turning up the volume on the computer  (e.g. mouse, monitor, adapter)','NuLL',NULL),
	(177,'59bef4','3-6','Difficulty or problem or topic is related to multiple of the above categories',NULL,NULL,NULL,NULL,NULL,'Student is having difficulty across multiple areas. ',NULL,'Indicate the relevant categories in the field notes using the following keywords: ?computing/programming, academic content, navigating software, general computer technology, other',NULL),
	(178,'0dd1f9',NULL,'Other (Please add additional notes)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(179,'645409',NULL,'What did the interaction between the Peer or Adult and the student look like?',NULL,NULL,NULL,14,1,NULL,NULL,NULL,NULL),
	(180,'70374a','4-1','Peer and student discuss the difficulty or problem',NULL,NULL,NULL,NULL,NULL,'A back-and-forth discussion of the issue takes place (that isn\'t a recitation of the solution)','What have you already tried? \"Tell me what\'s going on.\"\nS: there were three instead of one. \nA: okay, where is the program tell how many moons it has.','Timestamp at the same point that the student addresses the peer, because that\'s when the discussion begins.\nIf classroom management happens in the middle of student/teacher interactions---lump classroom management into the existing interaction we are coding, and use transcripts to quantify student/teacher interaction times. ',NULL),
	(181,'4190ff','4-2','Peer and student discuss the difficulty or problem, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'When a third person joins the conversation before the problem is solved. ','Peer: I\'m not sure why \nStudents: \" I am not very sure. Do we want to delete the code to try again?\"\nThird person (another peer or adult): \"what problem do you have? Do you need help?\"','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins problem-solving with back-and-forth conversation.\nJoining with on problem-solving or with one-off comment on problem-solving does not get coded.',NULL),
	(182,'b99510','4-3','Peer recites all steps of a solution at once (e.g. Peer does not give the student the chance to talk)',NULL,NULL,NULL,NULL,NULL,'The peer/adult gives the solution without any collaboration.','Put in a turn block with 90 degrees, and then move forward 20, and then... ','Timestamp when the peer/adult begins reciting steps',NULL),
	(183,'dc3aea','4-4','Peer recites all steps of a solution, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'The peer gives the solution without any collaboration. During the interaction, another person joins.','Peer: \"Put in a turn block with 90 degrees, and then move forward 20, and then... \"\n3rd person: \"No you have to do 90 and then forward 60.\"\nS/P: \"60?\"...','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins the discussion with problem-solving comments.\nJoining with non problem-solving comments does not get coded.\nThe solution does not need to be a correct solution. It\'s just the solution that is offered. ',NULL),
	(184,'1b7cb8','4-5','Peer physically shows by taking over the student\'s computer, and no problem solving discussions are occurring',NULL,NULL,NULL,NULL,NULL,' Peer does the computing work for the student.  There is no problem-solving conversation heard. ','Peer does the work for the student.\nPeer: Here, Let me do this for you. \nStudent: Thanks. What are you doing tomorrow\n\nPeer: (while working on the student\'s computer) says, \"Nothing much\"','Can\'t code this unless observation notes indicate the peer took over. Timestamp when the physical takeover happens.\nThere may be conversations taking place, but these are unrelated to the work. ',NULL),
	(185,'a3c5c4','4-6','Peer physically shows by taking over the student\'s computer, no problem solving discussions are occurring, and another person(s) joins the discussion',NULL,NULL,NULL,NULL,NULL,'Peer does the computing work for the student. Another person is heard joining the two students as this is taking place. ','dialog clearly indicates it (\"Just do it for me\" / \"Let me show you\"/\"let me try it\"\nField notes can support this as well. \nAs the peer is doing the work for the student, a third student says, \"Hey, you shouldn\'t do that for her. Let her do it.\"\nPeer 1: Ok. What did you try already\n\nStudent: I was trying to make a triangle.\nPeer 2: Cool. Did you use the repeat block? ','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins the discussion with problem-solving comments.\nJoining with non problem-solving comments does not get coded.',NULL),
	(186,'ec1587','4-7','Peer physically shows by taking over the student\'s computer, and problem solving discussions are occurring',NULL,NULL,NULL,NULL,NULL,'While peer is doing the computing task for the student, the peer is talking through the steps for problem solving. ','Discussion clearly indicates that the peer is providing guided step-by-step directions while doing the work. \nPeer: \"Let me show you\"/\"let me try it\"\nPeer: You need to drag the repeat block over here. \nPeer: Now, bring over the walk block. See? Like this.\nField notes can support this as well. ','Can\'t code this unless it is clearly heard that the peer is talking about what he or she is doing while doing the work for the student. Observation notes indicate the peer took over. If no audio or observation note confirmation is available, do not code. \nTimestamp when the physical takeover happens',NULL),
	(187,'ac5964','4-8','Peer physically shows by taking over the student\'s computer, discussions are occurring, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'While peer is doing the computing task for the student, the peer is talking through the steps for problem solving. During the discussion, another person joins the conversation.','Discussion clearly indicates that the peer is providing guided step-by-step directions while doing the work. \nPeer: \"Let me show you\"/\"let me try it\"\nPeer: You need to drag the repeat block over here. \nPeer: Now, bring over the walk block. See? Like this.\nField notes can support this as well. ','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins the discussion with problem-solving comments.\nJoining with non problem-solving comments does not get coded.',NULL),
	(188,'ddae53','4-9','Peer and student discuss the difficulty or problem, and then Peer directs student to another peer or adult',NULL,NULL,NULL,NULL,NULL,'This interaction begins with a discussion initiated by either the peer or the student. The peer then directs the student to another person for assistance.','S: I\'m wondering why that sprite isn\'t cloning  like I want it to... \nP:Clones are pretty advanced. This looks right to me, but you may want to talk to Ms. Tuscadero about that.  She is great with cloning.','Use same decision rule as \"and another person joins\" - use instead of 4-0 if it applies.',NULL),
	(189,'109ab7','4-10','Adult and student discuss the difficulty or problem',NULL,NULL,NULL,NULL,NULL,'A back-and-forth discussion of the issue takes place (that isn\'t a recitation of the solution)','What have you already tried? \"Tell me what\'s going on.\"\nS: there were three instead of one. \nA: okay, where is the program tell how many moons it has.','See 4-0\nTimestamp at the same point that the student addresses the peer, because that\'s when the discussion begins.\nIf classroom management happens in the middle of student/teacher interactions---lump classroom management into the existing interaction we are coding, and use transcripts to quantify student/teacher interaction times.',NULL),
	(190,'2b3163','4-11','Adult and student discuss the difficulty or problem, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'When a third person joins the conversation before the problem is solved','S: I\'m just not sure what to do here to get the backgrounds to change when I want them to..\nA: When do you want them to change?  What blocks have you tried\n\nP: Have you looked in the purple blocks?  Might find something there that would help...just saying!','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins the discussion with problem-solving comments.\nJoining with non problem-solving comments does not get coded.',NULL),
	(191,'084bba','4-12','Adult recites all steps of a solution at once',NULL,NULL,NULL,NULL,NULL,'The peer/adult gives the solution without any collaboration?(e.g. Adult does not give the student the chance to talk)','S: I can\'t get this to work... \nA: That\'s because you are asking it to go right and left at the same time.  If you really want it to go right and then left, put a wait block between the two.','Use this code if there is no discussion about how to solve the problem or the student\'s problem solving process.  The adult simply provides the solution. \nTimestamp when the adult begins reciting steps.',NULL),
	(192,'822843','4-13','Adult recites all steps of a solution, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'The adult gives the solution without any collaboration. During the interaction, another person joins. ','Adult: \"Put in a turn block with 90 degrees, and then move forward 20, and then... \"\n3rd person: \"No you have to do 90 and then forward 60.\"\nStudent: \"60?\"...','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins the discussion with problem-solving comments.\nJoining with non problem-solving comments does not get coded.\nThe solution does not need to be a correct solution. It\'s just the solution that is offered.',NULL),
	(193,'8e0204','4-14','Adult physically shows by taking over the student\'s computer, and no problem solving discussions are occurring',NULL,NULL,NULL,NULL,NULL,'Here, the adult solves the problem for the student without reciting steps or discussing the solution strategy. There is no problem-solving conversation heard. ','A: You are close, but I can see you are getting frustrated.  Here, let me show you what is missing.\nS: Oh, that was it.  I thought I was close!','Can\'t code this unless observation notes indicate the adult took over OR dialog clearly indicates it (\"Just do it for me\" / \"Let me show you\")\nIf we do not have verbal confirmation of the takeover, continue without using this code and provide field notes regarding any suspicions of the adult taking over the computer. \nTimestamp when the physical takeover happens',NULL),
	(194,'f95e7d','4-15','Adult physically shows by taking over the student\'s computer, no problem solving discussions are occurring, and another person(s) joins the discussion',NULL,NULL,NULL,NULL,NULL,'Adult does the computing work for the student. Another person is heard joining the two student and adult as this is taking place.','dialog clearly indicates it (\"Just do it for me\" / \"Let me show you\"/\"let me try it\"\nField notes can support this as well.\nAs the peer is doing the work for the student, a third person joins the interaction.\nAdult: Here, let me show you how to do that. \nStudent: I was trying to make a triangle.\nAdult: Just watch.\nPeer: Cool. Did you use the repeat block?','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins the discussion with problem-solving comments.',NULL),
	(195,'f40ad7','4-16','Adult physically shows by taking over the student\'s computer, and problem solving discussions are occurring',NULL,NULL,NULL,NULL,NULL,'The adult takes over the students computer, but does so while offering an explanation or providing support through discussion. ','S: I\'ve been on this level for days!\nA: I see what the problem is.  Let me show you.  See this right here?  What number do you have inside your loop\n\nS: 3\nA: Right, but watch what happens when I change it to a 4... \nS: It works!','Can\'t code this unless observation notes indicate the adult took over OR dialog clearly indicates it.\nTimestamp the takeover.\nIf we do not have verbal confirmation of the takeover, continue without using this code and provide field notes regarding any suspicions of the adult taking over the computer',NULL),
	(196,'3846e2','4-17','Adult physically shows by taking over the student\'s computer, problem solving discussions are occurring, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'The adult takes over the students computer, but does so while offering an explanation or providing support through discussion. During the discussion, a peer or another adult joins. ','Discussion clearly indicates that the adult is providing guided step-by-step directions while doing the work. \nAdult: \"Let me show you\"/\"let me try it\"\nAdult: You need to drag the repeat block over here. \nAdult: Now, bring over the walk block. See? Like this.\nField notes can support this as well. ','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins the discussion with problem-solving comments.\nJoining with non problem-solving comments does not get coded.',NULL),
	(197,'16f275','4-18','Adult and student discuss the difficulty or problem, and then Adult directs student to another peer or adult',NULL,NULL,NULL,NULL,NULL,'This interaction begins with a discussion initiated by either the adult or the student. The adult then directs the student to another person for assistance.','S: I\'m wondering why that sprite isn\'t cloning  like I want it to... \nA:Clones are pretty advanced. This looks right to me, but you may want to talk to Ms. Tuscadero about that.  She is great with cloning.','Timestamp when the adult directs the student to a peer or another adult.',NULL),
	(198,'a5c984','4-19','Peer directs student to talk to another peer or adult',NULL,NULL,NULL,NULL,NULL,'Peer directs the student to someone else. Peer may or may not state that they can\'t/won\'t help the student. ','I don\'t know how. Go ask the teacher.?\"I\'m still working on my project. I don\'t really want to stop. myFolder is way ahead. Can you ask her?\" ','Code only if peer/adult redirects without any discussion of problem. If a discussion happens before redirection, code 4-0 or similar.',NULL),
	(199,'0ae378','4-20','Peer clearly states that he or she does not know how to help',NULL,NULL,NULL,NULL,NULL,NULL,'I have no idea.?\"I don\'t know...\"','Only code this if there is no redirecting happening.',NULL),
	(200,'69f908','4-21','Peer clearly states that he or she does not want to help',NULL,NULL,NULL,NULL,NULL,NULL,'I am not allowed to.?\"I\'m busy now. Sorry.\"','Only code this if there is no redirecting happening.',NULL),
	(201,'1c2726','4-22','Adult directs student to talk to another peer or adult',NULL,NULL,NULL,NULL,NULL,'Adult directs the student to someone else.  Adult may or may not state that they can\'t/won\'t help the student. ','S: I\'m so frustrated!\nA: Did you ask a friend to help yet? \nS: Not yet. \nA: Go ask Javonn for help.  He finished a bit earlier. ','This interaction DOES NOT begin with a discussion initiated by either the adult or the student. The adult simply directs the student to another person for assistance.',NULL),
	(202,'098f26','4-23','Adult clearly states that he or she does not know how to help',NULL,NULL,NULL,NULL,NULL,'Adult states that they don\'t know how to help the student. ','S: Can you help me with this Mr. Gibson. \nA: Listen kid, I don\'t know how to do that and I\'m reading my paper. ','Only code this if there is no redirecting happening.',NULL),
	(203,'1960c3','4-24','Adult clearly states that he or she does not want to help',NULL,NULL,NULL,NULL,NULL,NULL,'S: I am so stuck! Mr. Greenjeans, can you help me\n\nA: Sorry kid, Bask in your frustration! I help you enough.\nS: You are SO MEAN all the time. ','Only code this if there is no redirecting happening.\nNote that the adult here verbally states that they do not want to help or are unwilling.  They may or may not know how to help, but that it not vocalized here. ',NULL),
	(204,'53256d',NULL,'Adult verbally comments on student\'s work',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(205,'90fa95',NULL,'Student dismisses his or her attempt for interacting (e.g. student does not call the person again) [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(206,'7d8292',NULL,'Peer dismisses his or her attempt for interacting (e.g. peer does not call the student again) [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(207,'0e599e',NULL,'Adult dismisses his or her attempt for interacting (e.g. adult does not call the student again) [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(208,'b8645c','4-25','Student ignored or cannot hear or code student\'s response to peer',NULL,NULL,NULL,NULL,NULL,'The student ignores the question/response.?Or the audio of the response is not clear enough to hear and code.',NULL,'Use if you hear a response but cannot code it (unintelligible) or if there is evidence that the student is ignoring the peer.?We likely cannot tell the difference between ignored or can\'t hear unless we have observation notes to tell us that the student ignored the peer. ',NULL),
	(209,'29bc47','4-26','Student ignored or cannot hear or code student\'s response to adult',NULL,NULL,NULL,NULL,NULL,'The student ignores the questions/response.?Or the audio of the response is not clear enough to hear and code.',NULL,'Use if you hear a response but cannot code it (unintelligible) or if there is evidence that the student is ignoring the adult from field notes.',NULL),
	(210,'cfcfc7','4-27','Peer ignored or cannot hear or code peer\'s response to student',NULL,NULL,NULL,NULL,NULL,'The peer ignores the questions/response.?Or the audio of the response is not clear enough to hear and code.',NULL,'Use if you hear a response but cannot code it (unintelligible) or if there is evidence that the peer is ignoring the student.',NULL),
	(211,'c88493','4-28','Adult ignored or cannot hear or code adult\'s response to student',NULL,NULL,NULL,NULL,NULL,'The adult ignores the question/response.?Or the audio of the response is not clear enough to hear and code.',NULL,'Use if you hear a response but cannot code it (unintelligible) or if there is evidence that the adult is ignoring the student.',NULL),
	(212,'bc7f6c',NULL,'Can\'t code interaction [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(213,'0eb295','4-29','Student and peer discuss a difficulty or problem',NULL,NULL,NULL,NULL,NULL,'A back-and-forth discussion of the issue takes place (that isn\'t a recitation of the solution)','What have you already tried? \"Tell me what\'s going on.\"\nS: there were three instead of one. \nP: okay, where is the program tell how many moons it has.','Timestamp at the same point that the student addresses the peer, because that\'s when the discussion begins.\nIf classroom management happens in the middle of student/teacher interactions---lump classroom management into the existing interaction we are coding, and use transcripts to quantify student/teacher interaction times. ',NULL),
	(214,'09d441','4-30','Student and peer discuss a difficulty or problem, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'When a third person joins the conversation before the problem is solved. ','Student: I\'m not sure why \nPeer: \" I am not very sure. Do we want to delete the code to try again?\"\nThird person (another peer or adult): \"what problem do you have? Do you need help?\"','Timestamp when the other person(s) joins the discussion.\nCode this only when the third person joins problem-solving with back-and-forth conversation.\nJoining with on problem-solving or with one-off comment on problem-solving does not get coded.',NULL),
	(215,'a29d87','4-31','Student recites all steps of a solution at once',NULL,NULL,NULL,NULL,NULL,'The student gives the solution without any collaboration.?(e.g. Student does not give the student the chance to talk)','Put in a turn block with 90 degrees, and then move forward 20, and then... ','Timestamp when the student begins reciting steps',NULL),
	(216,'685c02','4-32','Student recites all steps of a solution, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'The student gives the solution without any collaboration. Another person joins the interaction during the recitation. ?(e.g. Student does not give the student the chance to talk)','Peer: I can\'t get this to work... \nStudent: That\'s because you are asking it to go right and left at the same time.  If you really want it to go right and then left, put a wait block between the two.','Use this code if there is no discussion about how to solve the problem or the student\'s problem solving process.  The adult simply provides the solution. ',NULL),
	(217,'bf68f9','4-33','Student physically shows by taking over the peer\'s computer, and no problem solving discussions are occurring',NULL,NULL,NULL,NULL,NULL,'Here, the student solves the problem for the student without reciting steps or discussing the solution strategy. Peer does the computing work for the student.  There is no problem-solving conversation heard. ','Student  does the work for the peer.\nStudent: Here, Let me do this for you. \nPeer: Thanks. What are you doing tomorrow\n\nStudent: (while working on the peer\'s computer) says, \"Nothing much\"','If no direct audio evidence exists, refer to field notes on whether student actually takes over peer\'s computer.\nCan\'t code this unless observation notes indicate the peer took over. Timestamp when the physical takeover happens.\nThere may be conversations taking place, but these are unrelated to the work. ',NULL),
	(218,'393f1b','4-34','Student physically shows by taking over the peer\'s computer, no problem solving discussions are occurring, and another person(s) joins the discussion',NULL,NULL,NULL,NULL,NULL,'Student does the computing work for the peer. Another person is heard joining the two students as this is taking place.','Dialog clearly indicates it (\"Just do it for me\" / \"Let me show you\"/\"let me try it\"\nField notes can support this as well.\nAs the student is doing the work for the peer, a third person joins the interaction.\nAdult: Here, let me show you how to do that. \nStudent: I was trying to make a triangle.\nAdult: Just watch.\nPeer: Cool. Did you use the repeat block?','If no direct audio evidence exists, refer to field notes on whether student actually takes over peer\'s computer. ',NULL),
	(219,'ec1187','4-35','Student physically shows by taking over the peer\'s computer, and problem solving discussions are occurring',NULL,NULL,NULL,NULL,NULL,'The student takes over the peer\'s computer, but does so while offering an explanation or providing support through discussion. ','Student: Here, let me show you how I did it.\nPeer: Sure, be my guest.\nStudent: See where I am getting this block from?','If  no direct audio evidence exists refer to field notes on whether student actually takes over peer\'s computer.',NULL),
	(220,'9d4e4e','4-36','Student physically shows by taking over the peer\'s computer, problem solving discussions are occurring, and another person(s) joins the problem solving discussion',NULL,NULL,NULL,NULL,NULL,'While the student is doing the computing task for the peer, the student is talking through the steps for problem solving. During the discussion, another person joins the conversation.','S: Here, let me show you how I did it.\nP: Sure, be my guest.\nS: See where I am getting this block from\n\nP2: Yep, you can use that , but there is another way to do it as well.\nS and P(in unison): For reals\n\n?',' If no direct audio evidence exists refer to field notes on whether student actually takes over peer\'s computer.\nTimestamp when the other person(s) joins the discussion.\nCode this only when the third person joins the discussion with problem-solving comments.\nJoining with non problem-solving comments does not get coded.',NULL),
	(221,'81d8cf','4-37','Student and peer discuss a difficulty or problem, and then student directs peer to another peer or adult',NULL,NULL,NULL,NULL,NULL,'This interaction begins with a discussion initiated by either the peer or the student. The student then directs the peer to another person for assistance.','S: I\'m wondering why that sprite isn\'t cloning  like I want it to... \nP:Clones are pretty advanced. \nS: This looks right to me, but you may want to talk to Ms. Tuscadero about that.  She is great with cloning.','Timestamp when the adult directs the student to a peer or another adult.',NULL),
	(222,'c1225a','4-38','Student directs peer to talk to another peer or adult',NULL,NULL,NULL,NULL,NULL,'This interaction DOES NOT begin with a discussion initiated by either the student or the peer. The student simply directs the peer to another person for assistance.','Peer: \"I can\'t make it move...\"\nStudent: \"Go ask Mrs. Murrey.\"','This interaction is not a continuation of discussion between peer and student. ',NULL),
	(223,'55c726','4-39','Student clearly states that he or she does not know how to help',NULL,NULL,NULL,NULL,NULL,NULL,'I have no idea how to solve this problem.?\"It confused me too...\"','Only code this if there is no redirecting happening.',NULL),
	(224,'1f25e9','4-40','Student clearly states that he or she does not want to help',NULL,NULL,NULL,NULL,NULL,NULL,'Sorry, I have to work on my task now.?\"You\'re supposed to figure it out by yourself.\"','Only code this if there is no redirecting happening.',NULL),
	(225,'20377b','4-41','Student\'s cursor stops moving for more than 30 seconds, or the student leaves station (> 30 seconds) and returns to independently work [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Timestamp this code at the point where the student leaves the station or the student\'s cursor stops moving. Begin the next path at the point where the student returns to their station or the cursor begins moving.',NULL),
	(226,'6c93ea','4-42','Interaction terminates [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(227,'125cd7',NULL,'Was the problem solved or not solved? (Was the difficulty solved?)',NULL,NULL,NULL,14,NULL,NULL,NULL,NULL,NULL),
	(228,'ecb144','5-1','Problem was not solved',NULL,NULL,NULL,NULL,NULL,'The problem or difficulty that the student faced was not solved. ','Scratch: Student works independently on one problem/difficulty (making the sprite move) and then shifts to another task (working on the background). ','Pick this choice when, at the end of an interaction or independent work (which may involve several attempts of problem-solving), the problem is not solved.\n\nCode if:\nInteraction or independent work ends without the problem being solvedInteraction changes to socialization/non-problem-solving without problem being solvedAnother party joins without the problem being solvedVideo ended but the problem remained unsolved.Student stopped working on the problem.Timestamp the same time as the code immediately preceding\n\nSwapping from (problem-solving) interaction to independent work:\nWhen we see 10 seconds of independent work without interaction, then we go back to the end of the interaction and (same timestamp for each):?code \"problem not solved\"\nthen interaction termination?then immediately start coding independent work',NULL),
	(229,'990d2d','5-2','Problem was solved',NULL,NULL,NULL,NULL,NULL,'The problem/difficulty the student faced was perceived to be solved by the student. This may not necessarily mean that the problem was solved correctly, more efficiently, or optimally. It is about the student\'s perception of \"problem solved\" Use field notes to describe the problem solving solution in detail.  ','Possible evidence:  The conversation indicates that the problem was solved (e.g. student successfully located the shrink button, saying \"Oh! Thank you!\")Evidence on the screen (e.g. Code.org success feedback; the code successfully worked as expected).','Pick this choice when, at the end of an interaction or independent work (which may involve several attempts of problem-solving).\n\nCode as soon as there is evidence to show that the problem is perceived solved (success screen on code.org, etc). If it is a programming challenge, a piece of evidence could be the student successfully running the program. The problem does not need to be solved correctly -- the student only needs to believe the problem was solved correctly, even if s/he is incorrect. (e.g. confuses left/right, counts incorrectly, etc.)\n\nIf the student believes that the problem is solved and there is no functional difference in their technically incorrect solution (student asked for spelling help and ended up spelling something wrong), code as problem solved.',NULL),
	(230,'3710bb',NULL,'What is the nature of the student\'s computing-related communication with the peer or adult?',NULL,NULL,1,15,1,NULL,NULL,NULL,NULL),
	(231,'41cade','6-1','Student questions peer about something associated with peer\'s work',NULL,NULL,NULL,NULL,NULL,'Student asked questions about peer\'s work. This is not part of a problem-solving discussion. ','Wow...that\'s cool. How did you make it ? \"How many sprites you have in your program?\" \"Which block did you choose?\"\n\nEvidence on screen: e.g. student may or may not stop working, and we hear that the student is asking some questions. ','Code this when ?student asked any kind of questions related to peer\'s work without a request for help, even if it may lead to a problem-solving conversation. \nOne-off rule applies. There has to be evidence of an interaction. ',NULL),
	(232,'6f1a57','6-2','Student verbally comments about his/her own work, e.g. accomplishment',NULL,NULL,NULL,NULL,NULL,'Student commented on his/her own work, showing excitement/accomplishment to the peer or adult about his/her own work. ','S: \"It is cool right?\"\nP: Yeah, cool. \nS: \"Look what I did! I made a fun story!\"\nP: How\'d you do that\n\nS: Comments on what they did. ','Code this when ?student comment (show how he/she feels or what he/she did on his/her work); there is no clear request for problem-solving, even if it may lead to a problem-solving conversation.\nEvidence of back-and-forth must be present. One-off rule applies. ',NULL),
	(233,'9ec392','6-3','Student verbally comments about something associated with peer\'s work',NULL,NULL,NULL,NULL,NULL,'Student made comments on peer\'s work without the intention for help-seeking or discussion.','S: \"That\'s nice.\"\nP: \"Oh it\'s a cool animation!\"\nS: \"I like your background.\"?\"You can add another sprite...\"','Code this when student generally talks about how he/she feels about the peer\'s work, or the suggestions he/she have regarding peer\'s work which may lead to a help-seeking path. \nEvidence of back-and-forth must be present. One-off rule applies. ',NULL),
	(234,'4d95d2','6-4','Student expresses dissatisfaction or frustration',NULL,NULL,NULL,NULL,NULL,'The student verbally expresses their frustration or dissatisfaction with their work.','E.g.1\nS:\"This sucks!\"\nPeer: \"What?\"\n?e.g.2\nS:\"This is boring\" \nP: \"Sorry man. Life sucks sometimes.\"','Code this when a student expresses frustration without a specific, verbal request for help, even if the frustration leads to a problem-solving response from peer/adult. This may be self-talk. \nOne-off rule DOES NOT apply. Code this even it is an one-off (see example).',NULL),
	(235,'7c3097','6-5','Student says something that is unclear or inaudible',NULL,NULL,NULL,NULL,NULL,'Choose this code when the recording did not capture what student was saying; or if the audio is unclear.','S: Heyyyyyy! Okay, okay, so , I know I went there, now I got to go (inaudible). (Inaudible self-talk)\nNoise','Choose this code when the recording did not capture what student was saying; or if the audio is unclear.',NULL),
	(236,'d518e6','6-6','Peer questions student about something associated with student\'s work',NULL,NULL,NULL,NULL,NULL,'Peer asked questions about student\'s work. This is not part of a problem-solving discussion. ','Examples: \"Where did you find this sprite?\"?\"Which level are you working on?\"?\"How did you make it move like that?\"?\"How did you draw that sprite?\"\n\nNon:examples: What are you doing this weekend? Is our science test today?','Code this when ?student asked any kind of questions related to peer\'s work without a request for help, even if it may lead to a problem-solving conversation. \nOne-off rule applies. There has to be evidence of an interaction.',NULL),
	(237,'2ad3e4','6-7','Peer verbally comments about something associated with his/her own work, e.g. accomplishment',NULL,NULL,NULL,NULL,NULL,'Peer commented on his/her own work, showing excitement/accomplishment to the student or adult about his/her own work. ','P: \"It is cool right?\"\nS: Yeah, cool. \nP: \"Look what I did! I made a fun story!\"\nS: How\'d you do that\n\nP: Comments on what they did.','Code this when ?peer comment (show how he/she feels or what he/she did on his/her work); there is no clear request for problem-solving, even if it may lead to a problem-solving conversation.\nEvidence of back-and-forth must be present. One-off rule applies.',NULL),
	(238,'3e74d1','6-8','Peer verbally comments about something associated with student\'s work',NULL,NULL,NULL,NULL,NULL,'Peer made comments on student\'s work without the intention for help-seeking or discussion.','Examples:\nP: \"That\'s nice.\"\nS: \"Oh it\'s a cool animation!\"\nP: \"I like your background.\"?\"You can add another sprite...\"\n\nNon-Example: \"How did you do that?\" ','Code this when the peer generally talks about how he/she feels about the student\'s work, or the suggestions he/she have regarding peer\'s work which may lead to a help-seeking path. \nEvidence of back-and-forth must be present. One-off rule applies.',NULL),
	(239,'be878a','6-9','Peer expresses dissatisfaction or frustration',NULL,NULL,NULL,NULL,NULL,'Frustration-expressing path. Any verbalization that indicates the peer is distressed, confused, etc. about the computing ask (does not need to be programming)?The peer verbally expresses their frustration or dissatisfaction with their work.','E.g.1\nP:\"This sucks!\"\nS: \"What?\"\nP: I hate coding\nS: Why? I love making this rocket ship. Look... .\n\ne.g.2\nP:\"This is boring\" \nS: \"Sorry man. Life sucks sometimes.\"\nP: You are not being a very sympathetic friend\nS: Ok. I\'ll do better. ','Code this when a peer expresses frustration without a specific, verbal request for help, even if the frustration leads to a problem-solving response from peer/adult. This may be self-talk. \nOne-off rule applies.',NULL),
	(240,'53e98d','6-10','Peer says something that is unclear or inaudible',NULL,NULL,NULL,NULL,NULL,'Choose this code when the recording did not capture what the peer was saying; or if the audio is unclear.','S: Heyyyyyy! Okay, okay, so , I know I went there, now I got to go (inaudible). Now I\'ve got to move forward. Move forward (adds another block), now how am I going to get down? (Inaudible self-talk)\nNoise','Choose this code when the recording did not capture what student was saying; or if the audio is unclear.',NULL),
	(241,'e7d1ec',NULL,'What is the student/peer/adult\'s response to the initial computing-related communication?',NULL,NULL,1,15,NULL,NULL,NULL,NULL,NULL),
	(242,'242880','7-1','Peer verbally responds to the student\'s comment about student\'s work (e.g. curiosity, excitement, or frustration)',NULL,NULL,NULL,NULL,NULL,'The peer responds to something the student said about the student\'s computing wor (e.g.curiosity, excitement and frustration about the project, the peer responded). ','S: \"Don\'t you think it\'s awesome?\"?\"I know, that\'s cool.\"\nS: \"It\'s so hard for me to focus on my code.\"\nP: \"Me too/I agree.\"','The discussion is not related to the process of problem solving. \nIf this interaction leads into problem solving, switch to problem solving path.\nIf already in a problem solving path and a peer expresses curiosity, exitecement or frustration, note that in field notes and continue to code in the problem solving path. ',NULL),
	(243,'629874','7-2','Adult verbally responds to the student\'s comment about student\'s work (e.g. curiosity, excitement, or frustration)',NULL,NULL,NULL,NULL,NULL,'When the student engaged in the interaction with adult and express curiosity, excitement and frustration about the project, AND the adult responded. ','S: \" What\'s this character, a creep dog?\"\nA: \"Yes, It\'s not creep. It\'s just a kind of dog.\"\n\nS: \"I don\'t want to do this. I am exhausted now.\"\nA: \"You can have one minute break and try it again. Or you can try another project.\"','The curiosity, excitement and frustration is not related to the process of problem solving. \nIf this leads into problem solving, switch to problem solving path.\nIf already in a problem solving path and a peer expersses curiosity, exitecement or frustration, note that in field notes and continue to code in the problem solving path. ',NULL),
	(244,'1fb40a','7-3','Interaction terminates [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(245,'947465','7-4','Student/peer/adult ignored or cannot hear or code the response',NULL,NULL,NULL,NULL,NULL,'The student/peer/adult ignores the questions.?Or the audio of the response is not clear enough to hear and code.','S: \"How can I code this?\"\nOthers: ... ..','When using this code, make sure there is no response and inaudible. \nIgnore : 10 seconds\nInaudible: No need for 10 seconds\nIf the peer/adult responds, but it\'s after 10 seconds, that\'s ok. Just put it in field notes. ',NULL),
	(246,'1ded37','7-5','Student/peer/adult says something that is unclear or inaudible',NULL,NULL,NULL,NULL,NULL,'You cannot hear what the student/peer/adult said clearly.','Recording cannot be heard.','The audio is unclear to code. ',NULL),
	(247,'35cacd','7-6','Student verbally responds to the peer\'s comment about student\'s work (e.g. curiosity, excitement, or frustration)',NULL,NULL,NULL,NULL,NULL,'When the student engages in the interaction with peer and the peer expresses curiosity, excitement and frustration about the project, AND the student responds. ','P: \"Which character are you coding\n\nS: \"The cat. See? I\'m making her into a zombie cat.\nP: Cool. I like her red eyes.\nS: Yeah,','The curiosity, excitement and frustration is not related to the process of problem solving. \nIf this leads into problem solving, switch to problem solving path.\nIf already in a problem solving path and a peer expersses curiosity, exitecement or frustration, note that in field notes and continue to code in the problem solving path. ',NULL),
	(248,'8c2517','7-7','Student offers support to peer (the peer did not specifically ask for help)',NULL,NULL,NULL,NULL,NULL,'The student provides help for peers while the peer is working on his/her project.','Example 1: \nP: working independently and occasionally sighing. \"Hhhhhhhh\" \nS: \"Can I help you to solve the problem?\"\nP: That would be amazing. Thanks. \n\nExample 2:\n\nP: Works independently. Sighs. \"Hhhhhhh\"\nS: Do you want help? \nP: Not heard on computer, ignored, or says no','The peer does not ask the student for the help. Student provides help voluntarily.\nOne-off rule does not apply (example 1). ',NULL),
	(249,'9da550',NULL,'How did the student/peer respond to the non-computing conversation?',NULL,NULL,1,16,NULL,NULL,NULL,NULL,NULL),
	(250,'ed0549','8-1','Peer verbally responds to student\'s non-computing conversation',NULL,NULL,NULL,NULL,NULL,'Peer and student in the conversation. And peer response to the student. The conversation is not related to computing.','S: \"When will the class be over\n\nP: \"10 am\"\nS: Cool. I can\'t wait for recess!\nP: Yeah, let\'s go to the monkey bars!','The conversation is NOT related to the process of problem solving or computing. \nIf this interaction leads into problem solving, switch to problem solving path.\nIf already in a problem solving path and a peer expresses curiosity, exitecement or frustration, note that in field notes and continue to code in the problem solving path. \nOne-off rule applies here. ',NULL),
	(251,'434981','8-2','Adult verbally responds to student\'s non-computing conversation',NULL,NULL,NULL,NULL,NULL,'Adult and student in the conversation. Adult responses to the student. The conversation is not related to the computing.','S: When is recess\n\nAdult: In 10 minutes\nS: Why can\'t it be NOW!!!!\nAdult: Time doesn\'t work that way. \nS: Ok. ','The conversation is NOT related to the process of problem solving or computing. \nIf this interaction leads into problem solving, switch to problem solving path.\nIf already in a problem solving path and a peer expresses curiosity, exitecement or frustration, note that in field notes and continue to code in the problem solving path. \nOne-off rule applies here.',NULL),
	(252,'7b114c','8-3','Interaction terminates [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(253,'798662','8-4','Student/peer/adult ignores or cannot hear or code response',NULL,NULL,NULL,NULL,NULL,'The student/peer/adult ignores the questions.?Or the audio of the response is not clear enough to hear and code.','Ignore:\nS: How many minutes left for this class\n\nP/A ignores the question and does not respond.','When using this code, make sure there is no response and inaudible. \n\nIgnore : 10 seconds\nInaudible: No need for 10 seconds\nIf the peer/adult responds, but it\'s after 10 seconds, that\'s ok. Just put it in field notes. ',NULL),
	(254,'6b445c','8-5','Peer or adult redirects student to the computing task',NULL,NULL,NULL,NULL,NULL,'Peer or adult interacts with student and tells the student to get back to the computing project.','P: \"Let\'s get back to the Scratch activity. How about we try the \'when\' block.\"','One-off rule does not apply here.',NULL),
	(255,'360fc7','8-6','Student/peer/adult says something that is unclear or inaudible',NULL,'Timestamp this code at the point where the student leaves the station or the student\'s cursor stops moving. Begin the next path at the point where the student returns to their station or the cursor begins moving.',NULL,NULL,NULL,'You cannot hear what the student/peer/adult said clearly.','Recording cannot be heard.','NuLL',NULL),
	(256,'ebcb13','8-7','Student verbally responds to peer\'s non-computing conversation',NULL,NULL,NULL,NULL,NULL,'Student responds and engages in non-computing conversation.','P: \"I am going to Disney this weekend.\"\nS: \"That\'s awesome. Which park will you go to\n\nP: I think Animal Kingdom.','The conversation is NOT related to the process of problem solving or computing. \nIf this interaction leads into problem solving, switch to problem solving path.\nIf already in a problem solving path and a peer expresses curiosity, exitecement or frustration, note that in field notes and continue to code in the problem solving path.\nOne-off rule applies',NULL),
	(257,'0885ff','8-8','Student redirects peer to the computing task',NULL,NULL,NULL,NULL,NULL,'Student interacts with peer and leads peer(s) back to the computing project.','P: \"Will you adopt a cute cat?\"\nS: \" Can you continue your coding?\"','One-off rule does apply here. If the peer is a participant. \nTake close field notes that can then be used to help code the peer\'s video including timestamps. ',NULL),
	(258,'9591c0',NULL,'How does the event end or continue? (New Independent Path)',NULL,'note: Timestamp this code when the interaction begins. Create a new path for the interaction and start it at the same timestamp.',NULL,10,NULL,NULL,NULL,NULL,NULL),
	(259,'08cfb9','9-1','Student\'s cursor stops moving for more than 30 seconds, or the student leaves station (> 30 seconds) and returns to independently work [end path]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Timestamp this code at the point where the student leaves the station or the student\'s cursor stops moving. Begin the next path at the point where the student returns to their station or the cursor begins moving.',NULL),
	(260,'ea409a','9-2','The video record ends [end path]',NULL,NULL,NULL,NULL,NULL,'Video recording stops',NULL,NULL,NULL),
	(261,'3fcc28','9-3','Student independently solves a problem previously discussed during an interaction [end path]',NULL,NULL,NULL,NULL,NULL,'Student goes back to a problem that they previously did not solve and works on this problem. This problem may or may not get solved during this independent work time. ','Example: Student works collaboratively on Problem #2 and says, \"Hold up. I can do this to my Cow sprite!\" Interaction terminates. Student goes to the Cow Sprite and fixes the code independently. ','How to code this scenario: \nOnly way to get to Node 9 is through Node 1. In these cases, go to \"Other\" and use field notes to describe. \"Other\" will take you to Node 1 and then go to subcode choices 1-4 or 1-5.  \nMake sure that you label the path with the corresponding problem (e.g. problem 1 vs problem 2).\nThe 30-second independent work rule MAY OR MAY NOT apply here. (eg. students work collaboratively on something, they switch to the independent work).',NULL),
	(262,'e75b96','9-4','Interaction begins [end path.]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Timestamp this code when the interaction begins. Create a new path for the interaction and start it at the same timestamp.',NULL),
	(263,'90973c','9-5','Student switches to a computing related task while working independently [self loop]',NULL,NULL,NULL,NULL,NULL,'Initially, the student is doing non-computing independent work. The student then switches to independently working on the computing task.','Example: Student was playing Minecraft and then switched to Scratch. \nNon-example: Student was playing the finished Scratch project and switched to Scratch programming. (put in the field notes that student is running previous code).','Switch from 1-5 to 9-4:\nInitially, the student is doing non-computing independent work. The student then switches to independently working on the computing task.',NULL),
	(264,'5c3968','9-6','Student switches to a non-computing task while working independently [self loop]',NULL,NULL,NULL,NULL,NULL,'Initially, the student is doing computing independent work. The student then switches to non-computing independent activity','Example: Student was working in Scratch and then switched to Minecraft. \nNon-example: Student was working on a Code.org puzzle and then switched to a previously completed Code.org puzzle to play that puzzle. (Put in field notes that the student is rerunning previous code) ','Switch from 1-4 to 9-5:\nInitially, the student is doing computing independent work. The student then switches to non-computing independent activity\nOnly use this code when the student switches to something completely unrelated to the computing task such as a YouTube video, other video game, drawing something on paper evident from field notes, etc. ',NULL),
