	(23,2,1,5,'Square angle problem',NULL,13,1296,'They\'re saying something but I can\'t understand what it is. Followed by \"Hey, what happened with Chloe?\"(?) but not sure if we\'re coding socialization that isn\'t part of a pattern.',NULL,NULL),
	(24,2,1,5,'Square angle problem',NULL,9,1314,'\"Can you please help me? I have(?) a question.\"',NULL,NULL),
	(25,2,1,5,'Square angle problem',NULL,35,1314,'There\'s another \"_____ can you help me\" that\'s right on the 10 second border, but I\'m going to say it\'s within 10 seconds. Also I\'m going to assume the problem is related to the task because that\'s what they help the student with.',NULL,NULL),
	(26,2,1,5,'Square angle problem',NULL,42,1451,'\"[inaudible] ...bigger, you have to put a smaller number\"',NULL,NULL),
	(27,2,1,5,'Square angle problem',NULL,89,1451,'Student tries a smaller number (from 1000 to 1) in square angle. 1 obviously fails. \"Just put 10, okay?\" from peer(?). \"Or 2!\"<br />They have an argument over whether 100 is a bigger or smaller number than 20, but are now discussing side length instead of the angle. Peer seems to think smaller sides are better (\"see?\"), student is unconvinced (\"yeah, that doesn\'t work.\") <br /><br />Peer: \"See, you\'re almost close to it! So keep adding smaller numbers.\" Student changes from 10 to 30 degrees, then 50, then 100. At this point I\'m not sure if the peer is still around - is this independent work or still collaboration?<br /><br />At 24:04, student finally tries 90 degrees and succeeds. Is audibly impressed. We might want to decide when exactly we code \"problem was solved\" - I coded when the success message came up, but that won\'t be available in every problem.',NULL,NULL),
	(28,2,1,5,'Square angle problem',NULL,33,1451,'The student hasn\'t been interacting for a while, and I suspect it might have been better to retcon the end of the interaction to the last time the peer/student spoke to one another, then coded the rest as independent work.',NULL,NULL),
	(29,2,2,6,'Square ladder problem',NULL,5,1460,'Starting the \"draw 20 adjacent squares like a ladder\" problem.',NULL,NULL),
	(30,2,2,6,'Square ladder problem',NULL,116,1514,'Student says \"I\'m on 7 out of 11\" (referencing the screen on code.org), then says something inaudible. I don\'t think they\'re addressing anyone in particular.<br /><br />Student grabs the repeat block suggested by code.org prompts and enters \'10\' in \"repeat __ times.\" Watches the square draw itself 10 times in place, does nothing for 12-13 seconds, then addresses someone else.',NULL,NULL),
	(31,2,3,7,'Square ladder problem','P3',1,1514,'I think they\'re addressing a peer, don\'t know any names and can\'t really hear what they\'re saying.',NULL,NULL),
	(32,2,3,7,'Square ladder problem',NULL,13,1514,'Not sure what name they\'re saying, it sounds like a name tone-wise.',NULL,NULL),
	(33,2,3,7,'Square ladder problem',NULL,10,1519,'\"Oh, you - how do you pass that level?\"',NULL,NULL),
	(34,2,3,7,'Square ladder problem',NULL,91,1519,NULL,NULL,NULL),
	(35,2,3,7,'Square ladder problem',NULL,101,1530,'\"What level\" \"The smaller box level?\" \"Uh... the box is 90. The right is 90.\" [turn right by ____ degrees]',NULL,NULL),
	(36,2,3,7,'Square ladder problem',NULL,8,1531,'\"Okay, help me with that?\"',NULL,NULL),
	(37,2,3,7,'Square ladder problem',NULL,35,1531,'Assuming this because \"help me with that\" was immediately preceded by discussing a problem on code.org, even though it was a problem the student had already solved?',NULL,NULL),
