	(157,12,1,47,NULL,NULL,116,176,'Student googles cs first and clicks on the first link.There\'s an interaction with Todd, not sure if we should code it as a \"one off?\" The student asks Todd if they\'re in the right spot, Todd says yes and then a little later asks the student if they need their passport, and the student says no.<br /><br />Around 1:50 the student says \"this doesn\'t make any sense\" followed by \"never mind\" a few times - not sure if it was an interaction attempt or self talk.<br /><br />When watching the video, the student doesn\'t scroll down to vertically center the video and it drives me up the wall.<br /><br />Student watches a bit of the video before opening up the starter project and immediately saying \"I need help.\" (2:38) I think they don\'t realize that they need to enable Flash. Nobody responds, so I\'m not sure if it\'s an interaction attempt or more self talk.<br /><br />We need to clarify the one-off rule. Was the first \"I need help\" a one off? We said that \"a pattern of short interactions\" gets coded but never indicated how many/how to spot a pattern.',NULL,NULL),
