	(184,12,8,54,'Trying to make the rain talk',NULL,51,699,'Student: \"This... thing.\"<br />Maya?: \"What are you trying to do?\"<br />Student: \"Put this in the thing down there but it\'s not letting me scroll down.\" [gesturing with mouse pointer to code block] (I\'m not sure what the student is referring to \"down there\" - there\'s obviously nothing to scroll to in the event block section and I can\'t see any indication that there\'s scrollable content in the student code section. I may just not understand how Scratch works.)<br />Maya: \"You can\'t scroll down, that\'s weird. Are you, are you um, clicked on the right sprite?\" [student is currently clicked on rain sprite]<br />Student: [clicks on penguin sprite] \"No I need to make that go there.\" [trying to drag penguin\'s speech block into events section instead of dragging event block into student code area]<br />Maya: \"What do you want it to do?\"<br />Student: [clicks on rain, drags jackit forever loop towards penguin sprite] \"I\'m just gonna try this...\" [code block springs back to student section]<br />Maya: \"Mhmm. Well that won\'t quite work, would it?\"<br />Student: [clicks on penguin sprite, jackit loop has appeared at top of student code section]<br />Maya: \"Oh, so there\'s your - there\'s your script. Do you want to run it and see what it\'s doing?\"<br />Student: \"Well. Yeah, but I also want the rain to fall down.\" [dragging \"When flag clicked\" block into student code area and attaching it to forever loop] \"That\'s what you\'re supposed to do. And make them say stuff.\"<br />Maya: [appreciative noises] \"... What\'s your computer number?\"<br />Student: [messing with speech block in rain sprite] \"Twelve.\"',NULL,NULL),
