	(218,13,8,63,'Trying to make the rain talk',NULL,89,704,'The student is making progress at least, so I guess I\'ll call this solved.',NULL,NULL),
	(219,13,8,63,'Trying to make the rain talk',NULL,NULL,704,NULL,NULL,NULL),
	(220,13,9,64,NULL,NULL,5,704,NULL,NULL,NULL),
	(221,13,9,64,NULL,NULL,NULL,889,'Student deletes speech block from rain sprite by dragging it into event blocks section. Student runs code, penguin says \"Hello i need a jackit\".<br /><br />(11:54) Student: \"Hello I need a jacket. Yeah, yeah.\"<br /><br />Student explores sounds section, then sound blocks. Puts in various rain/thunder sound blocks, adds forever loop and flag event. I think the forever loop causes problems with the sound blocks. Student sighs.<br /><br />14:40 Student changes \"jackit\" to \"jack it.\" God bless.<br /><br />14:48 \"I need help.\" [no response]',NULL,NULL),
	(222,13,10,65,'Sound \"glitch\"','P1',1,932,NULL,NULL,NULL),
	(223,13,10,65,'Sound \"glitch\"',NULL,8,932,'(sound on student\'s program is skipping because they have too many play sound blocks in a row)<br />Student: \"Can you help me make it like that?\"<br />Peer: \"Make what?\"<br />Student: [gesturing to sprite background] \"Like it has the light but I want the black like... like lightning. ... and it does this when I do the sound.\"',NULL,NULL),
	(224,13,10,65,'Sound \"glitch\"',NULL,35,932,NULL,NULL,NULL),
	(225,13,10,65,'Sound \"glitch\"',NULL,43,1030,'Peer: \"What? I can\'t...\" [student plays skipping audio]<br />Student: \"Um, I think my computer has a glitch. Cause... listen.\"<br />Peer: \"Okay, what do you have for your code? Let me see if it is the same thing for me.\"<br />Student: \"I know but I want the rain sounds too.\"<br />Peer: \"Huh?\"<br />Student: \"I want the rain sounds, too, and it\'s not working because it\'s glitching, see? Listen.\" [student plays skipping rain sounds]<br />Peer: \"Why does it..? Okay, hold on a second.\" [The peer might take over the computer here, confirmed through later dialog] \"No, I need the... sound...\" [exploring sound menu] \"Hold on a second.\" [plays \"Rain sounds\"] \"What sound do you have?\"',NULL,NULL),
	(226,13,10,65,'Sound \"glitch\"',NULL,NULL,1030,NULL,NULL,NULL),
	(227,13,10,65,'Sound \"glitch\"',NULL,16,1030,'Coding as peer 2 joins conversation.',NULL,NULL),
	(228,13,10,65,'Sound \"glitch\"',NULL,35,1030,'Still the same sound glitch.',NULL,NULL),
	(229,13,10,65,'Sound \"glitch\"',NULL,43,1069,'[peer 2?]: \"What\'s wrong?\"<br />Peer: \"She has a diff...\" [cuts themselves off]<br />Student: \"It\'s glitching.\"<br />Peer: \"That\'s not the- Look, I just played through this one,\" [gesturing to \"Rain sounds\"] \"this is the one you want?\" [plays \"Rain sounds\"] \"See, it\'s not glitching. [indistinct] have a different one.\"<br />[peer 2?]: \"Ahh, yeah I do.\"<br />Peer: \"Which one did you have?\"<br />[someone else]: \"Rain sounds.\"<br />[I don\'t even know at this point] \"Pause it. Pause it.\"<br />[lots of messing around in the sounds interface]<br />[peer 2?]: \"Yeah, that\'s the one I\'m trying to...\"<br />[I don\'t even know at this point] \"Hold on.\"',NULL,NULL),
	(230,13,10,65,'Sound \"glitch\"',NULL,NULL,1069,NULL,NULL,NULL),
	(231,13,10,65,'Sound \"glitch\"',NULL,24,1069,'Adult joins the conversation in response to student\'s frustration. I think the second peer has left at this point.<br />(17:49)<br />[Student, I think]: [loud noise of frustration]<br />[adult?]: \"Okay, deep breath.\"<br />[peer 1]: \"What\'s- what\'s the matter?\"<br />Student: \"It\'s glitching, it keeps on glitching.\"<br />[peer 1]: \"Just stop... stop, stop. What do you have for your code?\"<br />Student: [moves back to rain sprite blocks, audibly frustrated] \"That so far. For the rain. For the rain.\"<br />[peer 1]: \"Let me see if that\'s the same code I have.\"<br />Student: [immediately] \"No, for the rain, it\'s cause I\'m trying to make sound. Rain sounds.\" [dragging more play sound blocks into forever loop]<br />[peer 1]: [authoritatively] \"Oh, that\'s too many rain sounds. Just letting you know.\" [thanks peer1] \"That\'s too many, and it, yeah, the computer...\"<br />[adult?]: \"What will happen if you put too many?\"<br />[peer 1]: \"Ah, it will, like, kinda glitch, I think...\"<br />Student: \"No, because I...\" [exasperated noise, thump]<br />[peer 1]: \"I wish my dad was here.\" [don\'t we all, peer1]<br />(18:38)<br />Student: \"It\'s not working because it\'s glitching.\" [still audibly frustrated]<br />[adult]: \"Alright, you\'re getting frustrated. Take it down a notch.\"<br />Student: [playing skipping audio] \"See?\"<br />[adult]: \"Is it this rain and thunder one?\"<br />Student: \"It\'s all of them.\"<br />[adult]: \"Take out one of them, and see what happens.\"<br />[peer 1, who is apparently still here]: \"Yeah, take out...\"<br />Student: [removes one of the rain sounds]<br />(19:02)<br />[sound immediately starts playing without skipping]<br />[peer 1]: \"That\'s... it\'s not glitching now!\"<br />[audio artifacts come back]<br />Student: [growling] \"Now it is\"<br />[adult]: \"I wonder if it\'s just trying to do too many sounds at the same..\"<br />[peer 1]: \"Yeah, you\'re doing too many.\"<br />Student: \"I don\'t even care anymore about that stuff.\"',NULL,NULL),
	(232,13,10,65,'Sound \"glitch\"',NULL,35,1172,NULL,NULL,NULL),
	(233,13,10,65,'Sound \"glitch\"',NULL,51,1172,'The peer, adult, and student all discuss at various points. The adult mostly focuses on the student\'s emotional state while the peer is mostly focused on the problem, but the adult is the one who eventually points to the right solution.',NULL,NULL),
