	(238,13,11,66,NULL,NULL,35,1172,NULL,NULL,NULL),
	(239,13,11,66,NULL,NULL,43,1370,'[peer 1]: [the most patient kid in the universe] \"Lightning flash? I can show you.\"<br />Student: \"I want to do it.\"<br />[peer 1]: \"Okay. I need to get on my thing...\" [indistinct] \"It\'s this. See? It\'s that code, like right there.\"<br />Student: [incredulous] \"The whole thing?\"<br />[peer 1]: \"Yes, that whole thing.\"<br />Student: [moving to block selection with switch blocks] \"Switch... but you also have the rainbow thing, too, see?\"<br />[peer 1]: \"I know. No, that doesn\'t involve the lightning flash. It\'s just that whole code.\"<br />Student: [exploring code interface] \"Switch to... lighning...\" [continues narrating actions while placing code blocks] (21:00) \"Where\'s the wait seconds?\" [it\'s visible at the top of their current menu]<br />[peer 1]: \"Wait seconds, um... right here, wait seconds!\" [student moves wait 1 seconds block into current code] \"Uh, you put the forever... you have to put the forever block.\"<br />Student: \"I know.\" [continues working]<br />(21:59)<br />[peer 1] \"Where\'s your forever block?\"<br />Student: \"I do that last.\"<br />[peer 1]: \"Okay, use that last. It has to...\"<br />Student: [interrupting, in Looks tab]\"Where\'s this thing? Next...\"<br />[peer 1]: \"Next... okay, I need to look for that... oh, it\'s in the looks tab.\"<br />Student: \"I\'m in the looks tab.\"<br />[peer 1]: \"It\'s right there! Your mouse just went past it. There. And [indistinct] the wait seconds block is in the repeat.\" [student moves to tab with the wait seconds block] \"No, you already have the wait seconds block! ... do you have it yet?\"<br />Student: [already has the wait seconds block] \"No.\"<br />[peer 1]: \"No. Kay, drag the wait seconds block in that and make it how much you want.\"<br />Student: [dragging the wait seconds block in that] \"How many did you put?\"<br />[peer 1]: \"I put... zero point one. Put zero point one.\"<br />Student: [puts 0.1]',NULL,NULL),
	(240,13,11,66,NULL,NULL,NULL,1370,'They\'ll solve it eventually, but Todd interrupts first.',NULL,NULL),
	(241,13,11,66,NULL,NULL,26,1370,'Todd: [why do you do this to me Todd] \"You know you\'re not signed in, right? It won\'t save your work if you don\'t sign in.\" [possibly reacting to something on the student\'s face, reassuring] \"You\'ll be fine if you sign in.\"<br />Student: [signing in]<br />Maya: \"That\'s good, that\'s a good thing to know, right?\"<br />Todd: \"All that hard work.\"<br />Maya: \"You definitely want to sign in.\"<br />Student: \"Is it my... CS first thing?\"<br />[peer 1]: \"Yes, it is. What\'s your passport, I can go get it for you.\"<br />Student: \"On my desk.\"<br />[peer 1]: \"Here you go!\" [papers rustling] <br />Student: \"Thank you.\"<br />[peer 1]: \"You type in that stuff.\"<br />Student: [types in that stuff] \"Can you go put this back on my desk?\" [gets to password field] \"Wait! Wait, wait a second.\"<br />[peer 1]: \"Just keep it with you.\"<br />Todd: \"Can I check something? Well, I\'ll wait till you\'re done. I want to make sure you\'re still recording.\"<br />Student: \"I\'m done, do you want to check now?\"<br />Todd: [checks]',NULL,NULL),
	(242,13,11,66,NULL,NULL,17,1479,'Todd leaves this interaction at 24:25, but the peer doesn\'t start talking to the student again until 24:39. I could code the part in between as independent work, but it seems like it\'s really just a continuation of the collaboration that was happening before Todd interrupted with the log in question. Need to figure out how to timestamp this for the purposes of visualizations.<br /><br />[peer 1] \"Oh, do you need the forever?\"',NULL,NULL),
