	(1510,55,3,371,NULL,NULL,5,186,'The student forwards the video tutorial several times, never watching more than a few seconds before moving on. She watched a total of 1:24 out of 3:59 of the video tutorial. At 4:40 the student navigates to the open Scratch project.<br /><br />The student begins looking through the sprites library. The student selects the first of four penguin sprites and adds it to the stage.<br />She then makes the sprite larger using the grow tool from the top of the page.<br />At 6:12, a one-off occurs:<br />S: Are you eating the candy I gave you? <br />Adult?: Not yet.<br />Throughout the student\'s independent work, she does not return to the tutorial.',NULL,NULL),
