	(1535,55,10,378,NULL,NULL,5,706,'The student runs the program and it seems to do what she wants it to do so far. She then clicks on the rain sprite and begins to work with the sounds. She then moves to bring out three play sound blocks onto the workspace. She changes each sound to something different related to rain. All of the blocks are put inside a forever loop and a green flag event block is attached.<br />At 14:25 the student changes to the penguin sprite and begins editing the text in the \"say\" block. Is she doing this out of frustration of not being able to get the sounds working correctly with the rain sprite?',NULL,NULL),
