	(1537,55,11,379,NULL,'Moores 21',1,932,'14:48 S: I need help (self talk?)<br />15:31<br />S: (Heard in the background) Can you come help me it (inaudible)<br />P: What? Make what? <br />S: It has the (inaudible) but I want the black, like lightning.',NULL,NULL),
