	(1541,55,11,379,NULL,NULL,89,1067,'Peer strategically asks about the code. The student ignores this query. The insistence on a \"glitch\"  versus understanding that the code is what is causing the problem is a BARRIER/CHALLENGE that runs throughout this interaction',NULL,NULL),
	(1542,55,11,379,NULL,NULL,23,1070,'An adult nearby hears the student becoming frustrated despite the help from the peer.<br />S: Ya that\'s the one I\'m trying to...UGHHHHHHHHH! O.k.<br />Adult (unknown-para?): O.k. deep breath.',NULL,NULL),
	(1543,55,11,379,NULL,NULL,16,1070,NULL,NULL,NULL),
	(1544,55,11,379,NULL,NULL,35,1074,'P: What\'s the matter?<br />S: It\'s glitching, it keeps on glitching.<br />P: Stop, stop, stop.  What do you have for your code?<br />S: That so far! For the rain.  For the rain.<br />P: Let me see if that\'s the same code I have.<br />S: No, for the rain.  I am trying to make sounds, rain sounds.<br />P: Oh. That\'s too many rain sounds! Just letting you know. That\'s too many.<br />Adult (para?):  What will happen if you put too many? (One-off)<br />P: It will kind of glitch I think.<br />S: No because...ughhhh.<br />P: I wish my dad was here.',NULL,NULL),
	(1545,55,11,379,NULL,NULL,43,1100,NULL,NULL,NULL),
	(1546,55,11,379,NULL,NULL,89,1119,NULL,NULL,NULL),
	(1547,55,11,379,NULL,NULL,8,1122,'S: It\'s not working because it\'s glitching.<br />Adult (para?): Alright, I think you are getting frustrated.  Take it down a notch.',NULL,NULL),
	(1548,55,11,379,NULL,NULL,35,1122,NULL,NULL,NULL),
	(1549,55,11,379,NULL,NULL,43,1122,'P: I wish my dad was here.<br />S: It\'s not working because it\'s glitching.<br />Adult (para?): Alright, I think you are getting frustrated.  Take it down a notch.<br />S: See?<br /><br />Adult (para?): I wonder if it is just trying to do too many sounds at the same time?<br />P: Ya, you\'re doing too many.<br />S: I don\'t even care anymore.  How did you make the lightening?  <br />P: (Inaudible)<br />S: I\'ll show you.<br />P: O.k. I need to get on my thing. It\'s this.  See? It\'s that code.  Right there.<br />S: The whole thing?<br />P: Ya.That whole thing.<br />S: But you also have the rainbow thing.<br />P: I know but doesn\'t involve the lightening flash. It\'s just that (inaudible) code, right there.<br /><br />Adult (para?): Is it this rain and thunder one?<br />S: It\'s all of them.<br />Adult (para?): Take out one of them. Let\'s see what happens.<br />P: Ya, do that. That\'s_.It\'s not glitching now!<br />S: Now it is.  Ughhhhh!<br />Student deletes the block she had removed from the script and runs the program again, which results in the \"glitch\".',NULL,NULL),
