	(1554,55,13,381,NULL,'Moores 21',2,1267,NULL,NULL,NULL),
	(1555,55,13,381,NULL,NULL,16,1267,'This is a continuation of the problem solving leading up to this code (para/student/peer).<br /><br />P: Right here.  Wait seconds. Uh, you put the...you have to have the forever block.<br />S: I know.<br />P: O.k. <br />P: Where is your forever block?<br />S: I do that last.<br />P: O.k. do that last.  It has to have this_<br />S: Where is this thing?<br />P: Oh, it\'s in the looks tab. Looks<br />S: I\'m in the looks tab.<br />P: It\'s right there! Your mouse just went past it.  There!<br />P: And the wait seconds block is in the repeat.  Do you already have the wait seconds block? Do you?<br />S: No.<br />P: Drag the wait seconds block and (inaudible).<br />P: Point one.  Zero point one. Zero point one. <br />This block is already clearly in the script.<br />Another wait seconds block is added to the loop with the next backdrop inside of it.<br />Researcher (T): You know you are not signed in right? It won\'t save your work.  You\'ll be fine if you sign in. (one-off)',NULL,NULL),
	(1556,55,13,381,NULL,NULL,35,1267,'S: Is it my CS First thing?<br />P: Yes it is.  Where is your passport.  I can (inaudible).<br />S: Let me do this.<br />P: There you go.  You don\'t (inaudible) that stuff.<br />S: Can you go put this back on my desk.<br />P: Yes I will. <br />S: Wait. Wait a second_<br />P: Do you need it again?<br />S: Ya. I forgot how to spell_<br />P: Inaudible<br />Researcher (T): Can I check something.  I need to see if you are still recording.  I\'ll wait until you are done.<br />The student signs in to her account.',NULL,NULL),
	(1557,55,13,381,NULL,NULL,42,1267,'P: Oh.  Do you need the forever one? <br />P: Oh, no!  Snap it in. Now try it.<br />The student is working on developing her script and the peer asks about the necessity of the forever block being used.  The student changes its position in the script, begins to throw away everything inside the forever loop and is told not to do so by the peer.<br />25:03<br />P: It\'s going to take a couple of minutes for it to flash.<br />The program is not running as expected.<br /><br />S: It\'s still glitching.<br />P: See, it did just flash.<br />P: Could I go on my other one? <br />S: You don\'t do nothing with that (?).<br />P: I\'m going to go to a different one o.k.?<br />The sound problem from earlier continues as it was never addressed.  The backdrop finally changes, but not as expected.<br />At this point (25:40) the student takes out three of the four sound blocks in her script, causing the sound of rain and thunder (the remaining block) to be heard clearly.<br /><br />P: Can I do my (inaudible) I need to do?<br />S: You are good.<br />P: O.k. thanks. If you need my help just ask me, o.k.?  Oh, I like that sound! Are you going to (inaudible)? <br />The student now separates each of the sounds from the script and adds a new green flag event so that each sound has its own event (and thus script).',NULL,NULL),
	(1558,55,13,381,NULL,NULL,89,1547,'Although the problem was not solved, the peer gave lots of good advice as to how to get there.  The student either ignored much of it or did not hear it.',NULL,NULL),
	(1559,55,13,381,NULL,NULL,11,1575,'S: Perfect (inaudible).<br />(The student seems to believe that she has solved the problem)<br />P: O.k.<br />S: Oh, wait a second.<br />P: Oh, my brother\'s name is Jack, just letting you know.<br />The student has selected the Penguin sprite which is programmed to so, \" Hello i need a jack it.\"<br />S: I\'m all done_<br />P: I\'m going to start on my...you want to start with me?<br />S: Ya! Just wait for me though.<br />P: O.k. I\'ll get my (inaudible).<br />S: I\'m not done...<br />It is unclear who the student is addressing, but perhaps a teacher or para?',NULL,NULL),
	(1560,55,13,381,NULL,NULL,108,1575,NULL,NULL,NULL),
	(1561,55,13,381,NULL,NULL,33,1625,'S: I think I\'m going to start packing up for my sister.',NULL,NULL),
	(1562,55,14,382,NULL,'CS Coach',3,1639,NULL,NULL,NULL),
	(1563,55,14,382,NULL,NULL,8,1639,'This interaction does not start with help-seeking.  The student is trying to tell the CS coach that she is finished with her work.  Upon investigating, the coach realizes that this is not the case.<br />S: (Faintly, in the distance) I\'m all done with my thing.<br />Coach: Can you do that (?) and then come show me and tell me about it?<br />S: Ya (inaudible).<br />S: (Much louder). Okay.  Okay.<br />Coach: O.k.  Hold on, can you stop it?  Let\'s remix it so it saves. Because we would really hate that if it deleted it.  I\'m sure you would get a little frustrated too.<br />The student seems to be in front of her computer again.<br />The student plays the program and the sound, \"glitch\" occurs.<br />28:32<br />S: Why can\'t it stop_<br />Coach: Did you record that (laughing)?<br />S: No.<br />Coach: Oh. What\'s that sound?<br />S: It\'s supposed to be rain.<br />Coach: Oh!<br />S: Is there too many blocks?<br />Coach: Ya, ya, look at how many you have of the same code.<br />The student immediately starts throwing away scripts (one event, one sound block each).<br />Coach: They are playing all of them at the same time right?<br />S: (Inaudible) Heavy thunder and rain there.<br />Coach: Is that better?<br />The student has changed the code to now have one event, and one forever loop with two different sound blocks inside.  The noise made is less chaotic.<br />S: Ya.<br />Coach: I don\'t know, do you think it is good?<br />S: Ya.<br />Coach: Do you like that better than what it was before? What did you have to debug?<br />S: I had to take some out.<br />Coach: Why?<br />Very little if any wait time here.<br />S: Because it was_<br />Coach: It was too much? What was happening?<br />S: It was glitching.<br />C: It was glitching? How was it glitching?  What did it sound like?<br />C: All of the sounds were playing all at the same time, weren\'t they? Can you imagine if four of us all tried to talk at the same time? Would you be able to hear anything?<br />S: No.<br />C: Same thing in Scratch right? How many sounds was it all playing at the same time?<br />S: (Sheepishly) uh...like six.<br />C: Ya!<br />C: It was going all over each other wasn\'t it?<br />S: Ya.',NULL,NULL),
	(1564,55,14,382,NULL,NULL,35,1639,NULL,NULL,NULL),
	(1565,55,14,382,NULL,NULL,51,1639,NULL,NULL,NULL),
	(1566,55,14,382,NULL,NULL,90,1841,'C: Are you done with it?  Want your badge? You going to write for me (in the journal). Write one thing that you learned.<br />S: Do not put lots of blocks in the same thing. (Repeated this slowly as she was writing). <br /><br />End of video.',NULL,NULL),
	(1567,55,14,382,NULL,NULL,34,1842,NULL,NULL,NULL),
	(1568,56,1,383,NULL,NULL,5,0,':31<br />S: I can\'t even get on the page. <br />The student attempts to begin the lesson but struggles to get inside the Scratch interface.  It seems her computer is running slow? She initially starts in Scratch, and tries to click, \"See Inside\" but very quickly goes to the address bar and types in the URL for Code.org, switching tasks.  Does she actually have a set task she is working on or has been assigned?  Is there a lesson?<br />1:13<br />S: Inaudible self-talk, seemingly around her navigating to the lesson.<br />The student gets to Code.org, goes to her progress page and we see that she has completed almost half of level 3 and then skipped ahead and completed the first lesson in level four. Neither of the lessons in level one are complete. (see photo).  Her first move is to click on the \"get help\" button, which is all text and doesn\'t seemed designed for student help. After this, she returns to her progress page.<br />1:34<br />S:(Inaudible self-talk).  One, two_(counting move forward blocks). Now we go right here...<br />The student selects the next puzzle in level three, puzzle six (see above). The student immediately begins coding (more familiar with this format than the Minecraft video from 12-6?).  Lots of Inaudible self-talk during this phase, which seems mostly the student thinking aloud about her progress.  For example, she counts out the number of move forward steps initially needed.  This shows the student is using a step-by-step strategy. <br />2:47<br />S: (Counting the bird sprite move) One, two_(After watching the program run to completion unsuccessfully) O.k that was (inaudible?: a good one?)<br />The student runs the program for the first time(See photo:  first-run program). She initially gets the first two blocks correct, but seems confused about how to use the right and left turn blocks.  This is notable as the student had been working on Code.org for at least a year previously and possibly two.  Does she understand left from right? After watching the program run to completion unsuccessfully the student throws away all her code despite the fact that the first two blocks worked (3:00).<br /><br /><br />3:02<br />S: So, move forward two times (thinking aloud as she moves blocks onto the screen). That...one, two, three (pulling out \"turn left\" blocks). One, two_(pulling out two turn right blocks.<br />The student now correctly identifies that the first turn is to the left, but still seems confused about what the turn blocks actually do. It is also notable that the student, even though thinking through the program in a step-wise fashion, is not testing the program as she goes.  Instead, she attempts to think through the entire program and then tests it. <br />3:29<br />S: (Inaudible response)One, two_(inaudible).<br />The student runs the program again. She again throws out all of her code.<br />4:02<br />S: (Inaudible response)One, two_(inaudible) I think I\'m not going to_(inaudible..maybe \"live\" referring to the sprite?)....and then, move forward... (Inaudible but clearly thinking aloud about her problem-solving process)...down(while her arrow is focused on the \"turn right\" block. <br />The student begins attacking the problem again. She initially drags out the two \"move forward\" blocks and then stops (to think). She then adds a \"turn left\" block after playing with a \"turn right\". A \"move forward\" block is then added, taking her farther than previous attempts. There seems to be some confusion around left and right and up and down. <br />6:11',NULL,NULL),
