	(1573,56,2,384,NULL,NULL,75,1074,'17:54<br />S: Jackie, can you help me? <br />Begin an interaction path.Note that had the student kept her code, the peer could have helped her understand what she had been doing and use this as a tool to help her correct.  There is no immediate noticeable response from the peer but the student begins with an explanation of what she has done.<br />18:04<br />S: I do move forward twice..I did that, but everytime I go this way, I put the right but I also put that (cursor on move forward block) in there.and it goes up not the way I want to go. <br />The student asks for help and then gives a description of what she has tried already.<br />18:20<br />P: So your (inaudible) is none right?<br />S: Yah.Everytime I go like that, I go like this...Let me show you what I had. (Inaudible)...not helping.<br />P: (As the student is recreating the script) Can you play it?<br />S: I am not done...<br />The student tries to recreate her previous script.  Again, had she kept the script, it could have been used by the peer to help with the debugging process.<br /><br /><br />The peer attempts to get the student to test partial code as a strategy but the student refuses saying she is not done.<br />18:54<br />S: This is what I had, but when I run it...<br />Note that the code the student recreated was not the same as the last script the student had used before throwing it all away.The student runs the program.<br /><br /><br />19:01<br />P: O.k., so its right so far...Oh, I think I see the problem_<br />S: Wait, what happened?(Inaudible)...right here (changing a left to a right in one of the later turn blocks). <br />P: Maybee_<br />S: Hold on, I\'m trying this again. Hmmm...Left right here.  No.<br />Referring to the first four blocks being executed.<br />The student interrupts the peer.<br /><br /><br /><br /><br /><br />The student is wondering if she needs a left turn block instead of a right, even though the right has worked repeatedly.  Looking at the screen a left block would seem needed, but from the perspective of the sprite it would be a right.<br />19:23<br />S: Nope<br />P: Maybe.. If you used the step block you will find a way of solving it. <br />The peer suggests using the step tool, which the student has yet to use as a strategy. The student then runs the program using the step tool.<br />19:34<br />S: O.k_.<br />P: Do you see where your problem is?<br />S: Noooooo_<br />P: Let\'s try it one more time.<br />S:Because it says right here that doesn\'t work, but I need that to go forward.<br />P: Alright, watch. What\'s wrong here?<br />S:(Pause) Its turned the other way but why? It\'s not supposed to. I didn\'t put anything to turn it the wrong way.<br />P: Are you sure?<br />S: Uh huh.<br />P: Look on your code.<br /><br /><br /><br /><br /><br /><br /><br /><br />It seems that the peer is taking over the computer and stepping through the puzzle.<br />At the first incorrect block, the peer stops stepping.<br /><br /><br />20:24<br />S: O.k.<br />P: Basically highlight it.  Press reset ...Do you think you need a turn there?<br /><br />P: Maybe...Let\'s see.<br />See: Murphy_05_2018-04-25 20_24 collaboration image<br /><br />The student changes the second turn block to turn left, seemingly ignoring the question of the peer. The student runs the program again.<br />20:46<br />S: Then what is it?  I don\'t see my problem.<br />P: You don\'t?<br />S: No.<br />P: O.k.<br />S: I didn\'t know what was wrong because I did it already (playing with the left and right in the second block).<br />P: Let me show you what\'s wrong with the left, because we already know..<br />S: I KNOW! I already know it done it because it takes that away and I don\'t want that.<br />I don\'t understand what the other problem is. <br />The program again does not run as the student expects.<br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br />Someone has run the program and is stepping through the blocks again.  The second turn block is now selected as left.<br />21:11<br />P: (Stopping on the second turn block) You see where you are facing right (into the wall).<br />S: But why???<br />P:Do you want it to face this way?<br />S: No!<br />P:You want it to keep moving forward. Your problem is highlighted (referring to the turn left block).<br />S: OMG!<br />P: Because if you don\'t want it to turn, you shouldn\'t have a turn.<br />S: Ohhhhhhhhh!<br />P: Wait, what are you doing? The bottom part was right. <br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br />The student is deleting blocks in the second half of the script. <br />. <br />21:52<br />S: I\'m just taking it step by step.<br />The student runs the shortened program again.  This time the second turn block is removed.  The sprite crashes into the wall before its goal, but has gotten farther along in the puzzle.<br />22:03<br />S: O.k. so...1,2,3...I think<br />The student counts out the number of move forward blocks needed after the first turn.She then adds a turn left block.She is now testing and refining part of her code and then adding once correct (strategy). <br /><br />21:18<br />P:I wonder if_ if you take a_<br />S: I think I know my problem.<br />P: If you don\'t_<br />S: Hold on Jackie!<br />The student refuses to listen to her peers wonderings and adds three turn left blocks at the end of the script.  She apparently did not understand her previous error related to how turn blocks work.  She is still confusing \"turn\" with move.The program again does not run as she expected.<br />22:50<br />S: Uhhh...I need a move forward block.<br />She now replaces the three turn blocks with three move forward blocks, not noticing that the hint above the workspace is showing her that she is using one more block than needed. Then, she deletes the last move forward block, runs the program and sees that it is solved (23:16).',NULL,NULL),
