	(1579,56,2,384,NULL,NULL,42,1435,'NOTE: This is a difficult one to code.  The peer is supporting but not sure if it neatly fits the codes. Discuss.<br />24:00<br />P: Hey try this one_(inaudible).<br />S: No  did try this one, I did.<br />P: I think you can really do this one.<br />S: I don\'t know.  I don\'t care.  I don\'t want a hint.<br />P: Let me tell you a hint...Hey you can\'t skip!<br />S: Yes I can.<br />The student skips ahead to the last level of the lesson at (24:09). She then goes back to the correct level after the admonition from her peer.<br />24:24<br />P: Let me tell you a tip.  If you use your hand in the direction you are (inaudible)',NULL,NULL),
