	(1582,56,2,384,NULL,NULL,75,1475,'24:35<br />S: O.k. I can help you.<br />P: No you can\'t, I\'m already (inaudible) those three.<br />S: Are you having trouble?<br />P: No.<br />TASK AVOIDANCE?<br />26:18<br />P: (Inaudible) go slow.  That way I can see if I have a problem.<br />S: Inaudible<br />P: I see I don\'t have a problem.<br />The student seems to be looking at the peer\'s computer. The student\'s cursor remains inactive.<br />The student is not giving any actual help but just seems to be watching the peer code.<br /><br />27:02<br />S: Can I see something<br />P: don\'t reset my code!<br />27:44<br />P:What is it doing?  I see why.',NULL,NULL),
	(1583,56,2,384,NULL,NULL,90,1718,'There is no way of know if the problem was solved or not as it was on the peer\'s computer and there was no verbal indication. Need an option for unknown here or an other option.  The entire remainder of the time, the student\'s cursor remains inactive and we hear mostly socialization as the period ends.',NULL,NULL),
