	(1592,58,2,386,NULL,NULL,9,219,'S: I\'m on this one. Can you do this with me?<br />Note that she immediately asks for assistance in completing the work before even seeing it. The peer does not seem to respond. This is the beginning of day four work in the storytelling project as evident by the video introduction.  The student begins watching the intro video.  Note that the video, had the student watched it, explains that this is a non-linear project and that the student has a choice as far as what aspects of the project to complete and in what order.',NULL,NULL),
	(1593,58,2,386,NULL,NULL,41,219,'There is no inherent difficulty or problem.  The student is asking for general help before attempting the problem herself.',NULL,NULL),
	(1594,58,2,386,NULL,NULL,42,219,'CCOI: We don\'t yet have codes that capture this kind of general help-seeking interaction.<br />The student is skipping a level in CS First so that she can code alongside her peer on the same project.<br />4:09<br />S: What one are you on?<br />P: I\'m on the next one...don\'t skip it.<br />S: It\'s o.k. I do that all the time.<br />S: (Inaudible) Wait, is it this? Which one do I click?<br />P: You can click any. <br />The student quickly fast forwards through the video without watching, while the peer admonishes her not to do so.<br />On the, \"Now it\'s your turn\" page, the student wonders aloud which starter link she should use.<br />BARRIER:Skipping lessons/levels.<br />4:36<br />S: Which one did you do?<br />P: Ya, that one (Sprite versus Self Starter) NO not that one.<br />S: Get me on it_(inaudible)<br />P: RIght here.<br />S: That one?<br />P: Yes.<br />There seems to be some miscommunication as to which starter the peer used.  The student picks the Sprite versus Self Starter link regardless. <br />The student then closes out the initial link and opens the third link which is the same one the peer is working on.<br />5:00<br />S: Wait for me, wait for me, o.k.?  Get me to where you are.<br />P: O.k. Now you have to watch the video.<br /> It is unclear if the peer takes over the computer here or not. <br />S: Wait for me.<br />The student again skips through most of the video which is giving extensive directions.<br />BARRIER: Not utilizing existing scaffolds/resources. <br />5:17<br />S: Wait for me.<br />The student again skips through most of the video which is giving extensive directions.<br />BARRIER: Not utilizing existing scaffolds/resources This time so that she can be in the same place as her peer.  She is prioritizing peer support over the built in support in the platform. <br />5:14<br />S: (Inaudible)  Where are you at? Are you taking a...<br /><br />5:45<br />S: What are you doing?<br />P: (Inaudible)<br />S: This?<br />P: Yes.<br />The student is asking whether the peer is working on the \"Deus Ex Machina\" section.  <br />The student once again, skips through various parts of the video, stopping now and again to watch small snippets.  The video is a step by step explanation of how to complete the project, highlighting important aspects such as blocks necessary for each sprite.  At the end of the video, these steps are reviewed in sequential order.',NULL,NULL),
