	(1612,58,6,390,NULL,NULL,8,692,'S: O.k. now I did it right, but it says I did it wrong.<br />Researcher: You have to type this (referring to the captcha which the student had thus far ignored).<br />S: O.k. That\'s it (referring to the first of two words)?<br />Researcher: This one too.<br />S: Can I try?<br />The student attempts to log in again after filling out the captcha but another error message appears.',NULL,NULL),
