	(1614,58,6,390,NULL,NULL,52,692,'Researcher 2: Number 12?<br />S: Ya.<br />R2: Oh, for the password. Let\'s see.<br />S: I typed it here_<br />R2: O.k. there is the captcha (mumbling reading the error message)<br />S: I think that is a whole different thing.<br />R2: Ya, please enter the text below.<br />S: I think its this.<br />R2: Ya, no, that\'s the password. This wants to make sure you are a human being.<br />S: Of course I\'m a human being!<br />R2: (Laughing) Sometimes computers do things automatically to do_(reading error message).<br />S: It says_<br />R2: This field is required (reading)...I wonder if I need a space in front of it_<br />R2: Enter username.<br />Possible R2 could be controlling the computer.<br />The researcher checks the username and password after entering the captcha text. He re-enters the text for both and then re-enters the captcha.  This solves the problem and the student is signed in to Scratch<br />S: Thank you.<br />R2: You\'re welcome.<br />S: Now, remix.<br />The student has spent the entire time thus far navigating websites.<br />The student remixes the project and clicks around through the backdrops and sprites.',NULL,NULL),
