	(1616,58,6,390,NULL,NULL,33,886,NULL,NULL,NULL),
	(1617,58,7,391,NULL,NULL,5,887,'16:42 (One-off)<br />S: Are you number 20?<br />P: I\'m number (confidential)...(inaudible).<br />The student moves on to begin building two scripts for the Giga 1 sprite after this interaction. This begins an independent work session. During this independent work, the student tabs back and forth looking at her code and the sample code in the paused video (strategy). Her code, differs from the sample in several ways including that she is using the same event for both scripts(attending to detail). She also does not test the code as it is being written. Instead, she puts blocks together without checking the functionality of the script.',NULL,NULL),
