	(1634,58,13,397,NULL,'Moores 21',1,1533,'Even though the peer initiates this interaction, it quickly becomes a student-driven problem-solving event.',NULL,NULL),
	(1635,58,13,397,NULL,NULL,8,1533,'P: Are you done?<br />S: Almost. Let me just check.<br />S: (Runs the program) Ohhh.  How do I get it to hide?<br />P: Oh. You want me to help you with that?<br />The student has two scripts initialized by the same event asking the sprite to perform contradictory actions (hide and show) at the same time. They are running in parallel. <br />P: Oh. You want me to help you with that?<br />S: Alright.<br />P: Oh, you have...where...try<br />again.<br />P: Click...no_<br />S: How do I turn him around?<br />P: Okay, click..hmmmm. You have the wrong character.<br />S: What character do I need?<br />P:No.<br />S: I have to start all over.<br />P: No you don\'t. (inaudible self-talk)  Let\'s now try it. Really?  Really? (exasperation)<br />This seems like the peer has taken over the computer. The program is run again. The program does not run as intended as judged by the peer\'s reaction. The peer also spends time manually moving sprites around the stage to \"starting\" positions, seemingly ignoring the \"go to\" blocks that are programmed.',NULL,NULL),
	(1636,58,13,397,NULL,NULL,35,1533,NULL,NULL,NULL),
	(1637,58,13,397,NULL,NULL,46,1533,'26:50<br />P: Why are you not hiding? Hide, now (talking to the program as she moves the event and hide blocks).<br />P: Do you have him?  Oh. It\'s working. O.k., now show! You don\'t have...oh m,y goodness! Hold on a second. <br />The student is not contributing here at all.  It seems clear the peer has indeed taken over. <br /><br />27:15<br />P: You don\'t have something that you need to do with, you need this! That\'s why it is not hiding. Back to this..when you get this (broadcast) not when flag touched. Now try it.<br />Referring to a broadcast block. The peer is doing all the intellectual work here.<br /><br />27:59<br />S: Now what does that say?<br />P: What? Oh, darn it! (Inaudible) end up right here? O.K., hold on a second.<br />The peer runs the program. The sprite does not move to where the peer thinks it should as shown by here pointing with the cursor.<br />The peer(?) switches to the tab that shows the end of the video with the completed example script.<br /><br />28:10<br />P: You don\'t have that (Go to-x/y block) you need.<br />S: Yes I do.<br />P: What...what does that look like? Ya, 26 and 115. <br />S:Sorry_(hit the magnify button).<br />P: It\'s o.k.Do you want me to change it for you?<br />S: I think I can do it.<br />P: Click it_(inaudible)<br />S: Negative what?<br />P: 26 and then...negative_<br />S: It wasn\'t negative.<br />P: Yes it was.<br />S: Oh.<br />Whoever is controlling switches back to Scratch.<br /><br />The peer points to the sprite in the wrong place and then tabs back to the example script, pointing to the \"Go to x/y\" block that reads, \"x:-26, y:-115\".<br />The peer is still controlling the computer.<br /><br />29:12<br />P: Change this (turn right by block) to 36.  Now let\'s test this.<br />S: Perfect!<br />P: O.k.<br />S: Thank you.<br />P: You\'re welcome.',NULL,NULL),
