	(1676,59,9,406,NULL,NULL,11,616,'Is this 2 or 3?<br />S: Ms. Maa? Ms. Maa?Ms. Maa, I already did this but_<br />C: Did you watch this video already?<br />S: Ya, I already did it, but I never got my sticker.<br />C: I want to see it, so sign in.  Sign in, your not even signed in right now. Use your username and password.  It\'s going to be your CS account right?<br />S: Ya. This is my username right there?<br />C: Uh ha.<br />C: Oh, no space (laughing).<br />C: Go into your folder so we can check to see (if you have already completed this task). You only have one project in there. The one that you were just working on.<br />S: I did more than just this.<br />C: Where did you save it? You didn\'t save it?<br />S: But I got my stickers.',NULL,NULL),
	(1677,59,9,406,NULL,NULL,112,616,'Both 1 and 4 happen here.<br />C: I don\'t know. Why don\'t you start over on this one.  I don\'t know where your project is so I don\'t know what happened_<br />S: It\'s right here (pointing to the current project).<br />C: This is not done.<br />S: I was going to...no a few times ago I was going to get my sticker but I had to leave.<br />C: I don\'t remember seeing it so I wanted to see your project again, so if you have already done it, it should be pretty quick o.k.?',NULL,NULL),
