	(1683,59,10,407,NULL,NULL,5,898,'The student starts by watching a few seconds of the tutorial and then tabs over to Scratch where she brings out the \"go to\" block shown in the video.  However, she has not noticed/thought which sprite the block is associated with or what she is trying to get the program to do (i.e. adding to create a rain backdrop on a person sprite doesn\'t make sense). She also has not noticed that there is no other code in the workspace in the tutorial example, yet she has other code in her own program (as she is working with a different sprite). She fast forwards through the tutorial instructions about x/y coordinates. She does attend to the exact numbers in the go to blocks.<br />The student has a go-to and a glide to block (in that order) in her script with the same coordinates in them. She takes them out of the script and puts them in her backpack.  She then selects the rain sprite and recreates the script from the video.',NULL,NULL),
