	(1703,61,6,413,NULL,NULL,52,692,'Coach (joining): Ms. S., she has that. She has to enter the captcha thing, so you are going to have to help her. They think she is a robot.<br />S: Nope, hold on a second.<br />C: No, don\'t try again. It\'s fine, but...see this part here?  You need to type in those things. Because they think...they want to make sure its a person.<br />P: Maybe we are a robot, you don\'t know! O.k.<br />(The website is asking for the student to enter a captcha but neither she nor the para seems to understand this as she continues trying to sign in. This is Ms. S., who is a parent and new para.<br />They try to log in again.<br />From the speed of the typing, it looks as though the para is entering the captcha information and has taken control of the computer. )<br />11:57<br />CS coach leaves the interaction.<br />P: Maybe we are a robot, you don\'t know! O.k.',NULL,NULL),
