	(1707,61,6,413,NULL,NULL,51,719,'P: (Student name) do you need to put the whole U4sd or just the _<br />S: No<br />P: So what do, what...is it in your binder? (To someone else) Do you know what her password would be.<br />Unknown person: You are right.  It is her student ID.<br />P: O.k. I am writing this down so we won\'t run into this problem next time.<br />S: That is my password to get into my Chromebook.<br />P: That is what I said.  Did you try it?<br />Oh, man...that took way longer than it should have.<br />Finally able to get into the student\'s Scratch account. (13:32)',NULL,NULL),
