	(1719,61,6,413,NULL,NULL,51,984,'P: Can you look online and try and find a Google image or something, know what I am saying?<br />S: I can\'t, ya, but its going to be_.uhhhhh.<br />P: You have time find some of that stuff, right?<br />S: I know but I can\'t zoom it out.  That\'s the problem.  It won\'t zoom out.<br />P: Is that something we can try and ask about? Have you tried to ask (coach) about it?<br />S: I can draw horrible_<br /><br />17:24<br />S: But I have a lot of time to work...because I just did this_<br />P: I\'m sorry.<br />S: That\'s o.k. Because I had to do (inaudible) and my coding through March and April.<br />P: Right.<br />S: And I am going to have to do that huge code.<br /><br />S: don\'t fill it in.  Just don\'t fill it in. Does this look like more water to you?<br />P: It does.<br />S: Does that look more like a water bowl?<br />P: A huh.  What is this?<br />S: Dog food. Does that look cool?  I did it with (inaudible).<br />P: Uhhh...do you want to try and Google, like a pooper scooper? (Laughs) Google pooper scooper!<br />S: When I try and type poop_<br />P: don\'t type poop! Oh, is poop blocked?<br />S: No, it\'s too (inaudible) I can\'t_<br />P: Could you try and figure it out?<br />S: I don\'t know. I\'m going to try and draw a pooper scooper.<br />P: O.k.',NULL,NULL),
