	(1723,61,6,413,NULL,NULL,102,1191,'S: That looks like a fork!<br />P: (laughter) I mean that\'s the right idea though right?<br />S: Ya.<br />P: Maybe have that part of it point to the ground right?<br />S: Ya.  I have to choose what color it is so I have to make it multiple times in different colors.<br />P: Oh, cool.<br />S: (Inaudible)<br />P: So that is part of the game.  You can choose what color it is?<br />S: You can choose what color of bowl they have, they have two different dogs and they can choose which dog they want.<br />S: (Inaudible) a lot. And I need to add more costumes to this one...probably, probably fourteen.<br />P: Is part of the game actually picking up the poop?<br />S: Yep.<br />P: Do you have to draw poop too?<br />S: Yes (inaudible)<br />P: (laughter) <br />S: Should we do that?<br />P: That is very big. Can you change it\'s size?<br />S: I can do this.  This is the only thing I can do.<br />P: That poop is the same size as the whole dog.<br />S: Oh.<br />P: You know what I mean?<br />S: That too small?<br />P: Maybe a little bit.<br />S: Does that look too big?',NULL,NULL),
