	(1736,62,2,416,NULL,NULL,120,19,'Student tries a smaller number (from 1000 to 1) in square angle. 1 obviously fails. \"Just put 10, okay?\" from peer(?). \"Or 2!\"  They have an argument over whether 100 is a bigger or smaller number than 20, but are now discussing side length instead of the angle. Peer seems to think smaller sides are better (\"see?\"), student is unconvinced (\"yeah, that doesn\'t work.\")   Peer: \"See, you\'re almost close to it! So keep adding smaller numbers.\" Student changes from 10 to 30 degrees, then 50, then 100. At this point I\'m not sure if the peer is still around - is this independent work or still collaboration?  At 24:04, student finally tries 90 degrees and succeeds. Is audibly impressed. We might want to decide when exactly we code \"problem was solved\" - I coded when the success message came up, but that won\'t be available in every problem.',NULL,NULL),
