	(1744,63,2,418,NULL,NULL,5,89,'1:36<br />S: Whoa, it\'s very (inaudible).<br />The student clicks on the \"my stuff\" folder and the website seems to be taking a longer than normal time to load. Once her projects load, she clicks on one called, \"Untitled 11\".  All of the visible projects are untitled. She then allows the browser to run the Flash plugin.<br /><br />2:37<br />Researcher (GYJ): Were you able to find your project? (one-off)<br />S: Ya.<br />The student seems to be working on the \"dog game\" project that is present in other screencast videos. She begins working on one of the costumes for the \"pooper scooper\" sprite.  One interesting note is that the coach can be heard in the background repeatedly having conversations with other students regarding the use of variables to accomplish various things in their projects, while this student is spending almost all of her time drawing/creating assets. Are the adults interacting with SWD in the same way they would be with gen ed students? Barrier?<br /><br />4:36<br />S: Unclick, unclick!<br />While painting the seventh pooper scooper costume, the student makes a mistake in the drawing.Instead of using the back arrow, she attempts to use the eraser to remedy her mistake. She ends up erasing the entire drawing and starting again.<br /><br />5:10<br />S: Is it unclicked (inaudible)...<br /><br />5:34<br />Para: You doing o.k.?<br />S: Ya, just adding more costumes.<br />S: (Inaudible)...yes I did. Oh...this color. (Self-talk)<br />Do the costumes have any functionality or will they just be a user choice as far as color?',NULL,NULL),
