	(1747,63,3,419,NULL,NULL,10,418,'6:59<br />S: Miss (para), do you have any more colors for me, like to do?  I did orange.<br />Para: For what?<br />S: For my pooper scooper/<br />P: Well you\'ve used a lot of colors.  That\'s probably enough pooper scoopers.<br />S: O.k.<br />(Is there any conversation about functionality or design? )<br />P: Can you make more dogs, more cats...that kind of thing?<br />S: Oh, is that too big?<br />P: Yes.<br />S: Let\'s just...the top part is o.k.<br />P: You\'re pooper scooper is bigger than the dogs.<br />S: I can\'t make it any smaller.<br />P: Can you make it a thinner line?<br />S: Ya.<br />P: That might make it smaller.<br />S: But you can\'t see it. You can\'t see it here.<br />P: Is there a way to like, zoom it in?<br />S: Uh, these buttons.<br />P: Go the other way.<br />S: I can only go that far.<br />S: I did all the colors I can.  Now, what else do I need? Oh, do I need backdrops? I\'ll work on backdrops.  I have this.  This would be hiding, that would be hiding, that would be hiding, except for the dogs because she (inaudible). Do I need more dogs? Let\'s move you up here.<br />S: Do I need more dogs or no?<br />P: I think you could put all kinds of things in the pet store. You know what I mean. Do you have different kinds of dogs?<br />S: There is only two kinds of dogs.<br />P: Can you make dogs that are different colors or_<br />S: I can make it change by the color block, make it change.<br />P: Who is that guy?<br />S: Oh, that is a real dog.<br />P: He is cute!<br />The student adds the dog to the project. The student continues to scroll through the pooper scooper costumes. She then adds another costume despite the conversation earlier with the para about having enough.',NULL,NULL),
