	(1773,63,7,423,NULL,NULL,52,1096,'S: I have three backdrops.<br />P: Ms. Coach, can you get a sprite from the internet, like an image.<br />Coach: Ya, she can download an image.<br />S: But every time I tried, I can\' t shrink it.<br />C: You can shrink it. Do you know how to shrink a normal, a different sprite?<br />S: No, I don\'t know how to shrink a sprite.<br />C: Can I show you how to shrink a sprite?<br />S:Uh huh.<br />C: So you care going to go up here, no that one.  No, up there. You see those little arrows. If you hover over it, likehover over it, what does it say?<br />S: Oh, thank you! Thank you!<br />C: No problem.<br />Para: Saves the day again, master coder, master coder (coach).',NULL,NULL),
