	(1777,63,7,423,NULL,NULL,102,1143,'S: I wish I was on my Chromebook because it has the picture of the poo bag and then I could shrink it.<br />P: So, I wonder if you can somehow get on your Chromebook at another time when they are not like recording and save it on your project somehow so that it is on here for next time.  So the next time you have free computer time, get on Scratch and save your images or whatever it is on there.  So can you shrink your pooper scooper?<br />S: Oh, you want me to_(inaudible) How big do you want me to shrink them?<br />P: Like to pooper scooper size because before they were bigger than the dogs.<br />S: Oh is that better?<br />P: That is much better.  It doesn\'t take up as much room on the screen.<br />S: Should I shrink this one?<br />P: You can.<br />S: No I like him. (Inaudible) the dogs, they should be bigger.<br />P: Oh, I see because they are sharing the water.<br />S: No, uh, ya, this is a bowl.<br />P: Do you have all that stuff in every room? (student) Do you have to have all that stuff in every room, or can you like, the outside has the pooper scooper? And then on the inside, like there is a kitchen that has the water bowl.<br />S: Yes, I need to find a kitchen.  I hope there is a kitchen.<br />(Para is giving the student design suggestions that she immediately takes up.)',NULL,NULL),
