	(1784,63,9,425,NULL,NULL,51,1331,'S: How do you (inaudible)?<br />P: Or you could not do a kitchen and have the water somewhere else.  I am just wondering can you put different things in different rooms.<br />S: No it all goes_<br />P: It all goes in the same_<br />S: Ya. They should have a pool because...<br />P: Maybe there is some way to code it so it would be different.<br />P: Maybe like different levels or something.<br />S: Oh my goodness, look at the pool changing.<br />P: Is your water changing color?<br />S: Yes because I have it on changing backdrop. See?<br />S: Oh I love that blue and even that pink.<br /><br />23:28<br />S: Oooh, look at the umbrellas.  Let me just move this down and move this down. Yes, look at the umbrellas change. I need to name this person.  Can I name this person?  No I can\'t. <br />Can I name this? That, come on. O.k.<br /><br />24:05<br />S: Shift. Do you_? O.k., o.k..<br />P: I think maybe you should do levels or something like one level is picking up dog poop, or one level is...because there is just so much going on.<br />S: Ya...One level they have to, um, try and find the dog place.<br />P: Ya, like the first level could be at the pet store?<br />S: No, they have to find_<br />P: They have to find the pet store_<br />S: I don\'t know how they are going to do that. How do they do that?<br />P: Well, I don;t know, you may have to conference with (coach) and get some suggestions.<br />S: Oh, I know, go to here. Cities...found it! Ya, I have to add another backdrop. Can I bring it up?  Ah!  I just duplicated it. Oh, dang it. Oh, it didn\'t copy it.<br />S: Look I found a road that can lead to the pet store and its a cool change of color.<br />P: Whoah that\'s fancy.  City, city background.<br />S: Can I work on this?<br />P: I think you need to do coding now, you can take that home.',NULL,NULL),
	(1785,63,9,425,NULL,NULL,90,1603,'The student completed adding the backdrops she had wanted.',NULL,NULL),
	(1786,63,9,425,NULL,NULL,33,1674,'S: Can I work on this?<br />P: I think you need to do coding now, you can take that home.<br /><br />26:55<br />S: Do you want me to start coding? And get a head start and get done with everything.<br />P: Ya, I think you probably need to talk to Ms. (coach).<br />S: I\'m going to start with the big, huge code first. Where do we do that at?<br /><br />27:27<br />S: I think we did it on the background? Come on_<br />P: Alright, you can take this home. You can do it tonight. I\'ll see you tomorrow.<br />S: O.k. Bye. <br />Student is looking for a sprite that has some code associated with it. Interesting that the para finally mentions coding and then leaves???',NULL,NULL),
	(1787,63,10,426,NULL,NULL,5,1674,'28:11<br />S: Come on! You get...oh!<br />The code is found on the state sprite but it is very small.  The student goes to make it larger. The student then clicks on each sprite. When she finds a single hide block on one sprite she tries several times to drag it to the \"real\" dog sprite. <br />30:06<br />S: Come on!<br />Still clicking around on the sprites.  It is unclear what she is doing. It seems she is still trying to drag the hide block from the workspace to each sprite instead of selecting the block from the menu.<br />30:46<br />S: Oh, is that too big?<br />S: That\'s enough.<br />Referring to the water bowl sprite.<br />31:47<br />Coach: O.k., you are going to want to go ahead and make sure that your project is saved.<br />The student immediately saves.<br />In the background, another student can be heard addressing the classroom teacher.  This is the first time her name is heard in the video?<br />32:39<br />Research has the student say her computer number again and stops the recording. End video.',NULL,NULL),
