	(1790,64,1,427,NULL,NULL,116,134,'2:12<br />T: That is some good focus.<br />S:  (inaudible, self-talk?)<br />An adult is in the background and announces that she has to leave. There is a loud response from the class but the student seems to initially ignore this and continues to work on her problem. The cursor seems to move on and of the move forward block, but the student does not do anything with it. At the 3:00 mark, the cursor stops moving (less than 30-sec independent work).',NULL,NULL),
	(1791,64,2,428,NULL,NULL,5,272,'(Inaudible self-talk for almost a minute)<br />The student goes from the hints section in the top middle of the screen to the arrows.  She still does not either read or comprehend the text of the hints as she is moving no blocks into the work area.',NULL,NULL),
	(1792,64,2,428,NULL,NULL,119,958,'S: I don\'t know how he can go there...<br /><br /><br />S: There is like, nowhere. There is no way he can get here...because he can\'t get out! The door is blocked_(inaudible).<br />The student presses the reset button as she says this. She then resumes clicking the arrow buttons moving the sprite around the room.<br />The student then runs the sprite into the walls repeatedly (in frustration?).<br />She continues with trying the arrow keys, ramming the sprite into the walls and door. No blocks have been moved to the workspace.<br />9:17 <br />She seems to begin reading in the middle of the second sentence where the icon for the \"pressure plate\" is shown after the words pressure plate. She is obviously having problems decoding the text and is trying to sound out words.<br />11:32<br />The student does not finish the puzzle and pushes the #2 button at the top of the screen to move on.  As the student transitions to the second level, she immediately clicks on the o.k. Button to dismiss the hints without reading them. She clicks the \"run\" button without moving any blocks to the workspace.<br />12:24<br />S: This is hard. Because I need this stay open, and I can\'t_(inaudible) go.<br />The student does not understand that she must use the \"Agent\" to do things Steve cannot. Instead, she continues to try and have Steve do multiple things at once. <br />Lots of frustration as the new puzzle requires an understanding of the previous puzzle.  Lots of frustration.<br />14:15<br />The student finally tries something new in that she walks \"Steve\" over too the pressure plate that triggers the door.  She still does not understand that she has to code the agent to activate the plate and then move Steve through.<br />15:06<br />The student again skips ahead without finishing the puzzle. At this point, she has done no actual coding. She does not watch the introduction video to the next level but closes it immediately. If she was to have watched the video, it would have explained that not only does she need to move blocks (code) out to the workspace, but that during this particular task, she will need to use a repeat block. Much of the video is given to explaining what a repeat block is and how to use it. There also is no evidence that she reads the hint for this level, but we can see her almost immediately resume the same strategy as the previous levels.',NULL,NULL),
	(1793,64,3,429,NULL,'RG',3,958,'S: This is so hard because I have to stand on this, but when I go off of it, the thing shuts.<br />A(George): (After a short pause) It kind of tells you what to do...I see.',NULL,NULL),
	(1794,64,3,429,NULL,NULL,8,958,NULL,NULL,NULL),
	(1795,64,3,429,NULL,NULL,35,958,NULL,NULL,NULL),
	(1796,64,3,429,NULL,NULL,51,958,'S: My little guy can move (referring the to the Agent)! He can help me!<br />A: (George) Ok.So you move forward_<br />S: You move forward and_<br />Here the student for the first time realizes that the she needs to code the Agent to complete the puzzles.  She continues adding \"move forward\" blocks to her script using a guess and check strategy. <br />A:  What happens when you hit the reset?<br />S: I don\'t know_<br />A: I just hope it doesn\'t_<br />S: Go, go, go...Yay! (inaudible, perhaps,\" Imaginary gray guy?\"). <br />Here the student presses the reset button while the adult is talking.  She runs the program and the Agent triggers the pressure plate to open the gate.  The student then uses the arrow keys to guide the Steve sprite to its objective, solving the problem.',NULL,NULL),
	(1797,64,3,429,NULL,NULL,90,1033,'S: Yay!<br />A: O.k.<br />S: And now...yay! Yay, (level) 4.  Now I know what to do.<br />Steve reaches the goal.  Problem solved. The student moves on to level four. Both in the hint box and in a separate pop-up that appears on the left side of the screen, the student is told that the Agent can move over water but that Steve cannot.  She closes the pop-up   (without reading).',NULL,NULL),
	(1798,64,3,429,NULL,NULL,33,1033,NULL,NULL,NULL),
