	(1800,64,4,430,NULL,NULL,117,1335,'The student moves on to the next puzzle.<br />The student takes a \"move forward\" block out of the menu and attaches it to the \"when run\" block.  This moves the Agent sprite forward across the water.  Note that the hint states, \" The Agent can move across the water!  Use an (image of a repeat block-that doesn\'t visually match those in the menu) loop to solve this puzzle and help Steve get to the bucket (word, plus image as seen on the map) behind the door.\" <br />17:46 <br />S: (inaudible)  ...he\'s going to move.<br />The student moves a \"move forward\" block out into the workspace and attaches it to the \"when run\" block. <br />S: He can go on the water (surprise)! That\'s neat, o.k.,  Now I see.<br />A: (Todd) When it\'s time to quit, bring me your computer, don\'t close it. (One-off)<br />The student runs the program with one block attached. What follows is a series of guess and check operations<br />19:03<br />The student solves puzzle four.<br /><br />19:55<br />S: Oh, oh! Gotta take one out. Reset.<br />The student responds after she has moved out three \"move forward\" blocks and attached them to the \"when run\" block and run the program.  Her response is due to the Agent sprite having been programmed to go too far, past its objective.<br />19:58<br />S: (Inaudible utterance) Yay! I want him to go this way(turn). <br />The student takes out one block and runs the program again.  She expresses excitement over her new coding working (guess and check). She hovers over each of the turn blocks, one at a time, clicks on their menu (left and right) nut does not take one out to use.<br />20:20<br />S: (Inaudible) Use_no. I wanna go like this.<br /><br /><br />20:26<br />S:  Hmmm...just me...I probably_(inaudible) ten times.<br />The student moves a repeat (2 times) block out the workspace and attaches it. She then moves a \"move forward\" block and places it inside the loop. Not sure why she would do this when her previous decision was to remove a move forward block from the script.<br />20:38<br />S: O.k., it not (inaudible)<br />The student runs the program and it <br />20:44<br />S: (Inaudible) Ten...<br />The student clicks on the parameters button in the repeat block, but does not change it. <br />20:52<br />S: It goes nowhere_ Oh, wait, I can do something.  No I can\'t. I need to step on something (inaudible). I need...<br />The student never resets and runs the program. <br />The student then tries moving the Steve sprite with the arrow keys even though the door has not been opened. <br />21:10<br />S: O.k. this is (isn\'t?) hard.<br />The student removes the repeat block and the \"move forward\" block inside it. <br />21:17<br />S: Reset<br />The student runs the program three times.<br />21:25<br />S: O.k.<br />The student moves a :turn right block and attaches it to the script. She runs the program (STRATEGY: guess and check) and then adds another \"move forward block.<br />21:50<br />S: Yeah! I need one more (\"move forward\").<br />One more \"move forward\" block is added to the program and when the student runs the program, it move the Agent to the pressure plate, releasing the Steve sprite.<br />22:10<br />S: Here we go.<br />Steve is moved out of his room and is maneuvered  to the axe using the arrow keys <br /><br />22:15 Puzzle 5 is solved.<br />The remainder of the video is the researcher saving the data and wrapping up the session.<br />NOTE: There is no way to show that the student solved a problem independently.',NULL,NULL),
