	(1804,66,2,433,NULL,NULL,5,190,'3:10<br />S: One, two...<br />Cursor begins moving again. The student moves one move forward block and attaches it to the When run block and runs the program.  This is clearly not going to solve the puzzle.  Why did she do that? STRATEGY: Guess and check<br />3:21<br />Self-talk (inaudible)<br />The student runs the program after adding more blocks.  She seems to still be confusing left and right as in the 4/25 video. CHALLENGE<br />She then uses the step button to walk through the code one block at a time.<br />STRATEGY.  However, the change that she makes as a result of this does not reflect that she understood her mistakes as a result of the strategy.  (She needs explicit instruction on how to use that strategy.) Instead of changing the direction of the turn block, she adds another turn block to the end of the script, which suggests she is not understanding some sequencing concepts. <br />5:10<br />Intermittent inaudible self-talk. (Shee seems to be thinking aloud as she programs (e.g. left, forward, forward, down). <br />After running the program again, she sees that her changes have not helped and trashes new turn block at the end and changes the direction to \"right\" in the initial turn block which does move her toward a correct solution. She does not use the step button during this phase of problem-solving. Because of this, she adds unnecessary blocks that cause her program to falter.  She also uses more blocks than the workspace hints tell her are necessary, begging the questions as to whether she understands or is paying attention to this component of scaffolding. BARRIER. Due to the fact that she can be heard to use the word \"down\" as well as left, back and forward, it is apparent that she is still having problems with direction telling.  BARRIER.<br />10:45<br />S: Stop it!  What is_(frustration). <br />The student is still utilizing a guess and check strategy and not the step button. She continues her self-talk.  Chunking code would be a helpful strategy for her here, but thus far, no one has introduced that to her (throughout her videos?).',NULL,NULL),
