	(1807,66,3,434,NULL,NULL,8,650,'10:49<br />S: (Inaudible)  can you help me?<br />P: Ya.<br />S: I don\'t know what...like, when I run...I got these right, but when it comes down here its messed up.<br />P: Oh, probably something that starts with an \"m\".  <br />S: N?<br />P: M <br />S: I know I need to move forward but I already have move forward.<br />P: You need one more<br />S: I think I need to take this one out.<br />P: You need one more move forward. Right there.<br />S: Where?<br />P: Right there.<br />S: Here?<br />P: Ya. Let\'s see if that can work.<br />P: There you go.<br />Begin an interaction path. The student understands that some of her code is correct.  Again, chunking would be helpful here.',NULL,NULL),
