	(1819,66,5,436,NULL,NULL,96,864,'P: No, you are on course 2. I am on course (inaudible).<br />S: You are on course (inaudible).  I\'m on level 3 but course 2.  You are on 7 and I am on 9. Let\'s see who can get done the fastest? You get all of those done and I will get all of mine done and then (inaudible). <br />P: Inaudible<br />S: Can I see that too real quick? Sophia! Sophia!<br />Lots of inaudible talk due to room noise, but it seems as though the students are talking about levels and getting them done quickly<br />The student attaches a move forward block to the when run block. As the student tells which course she is on, she clicks on the lesson link above and leaves the puzzle and her work. She returns after checking the course.<br />No work is observed during the entire conversation. Socialization.',NULL,NULL),
