	(1822,66,5,436,NULL,NULL,76,1638,'S: O.k. Let\'s do this.<br />S: Do you need help? Need help? I can help you. 17:38. Do you want me to help you?<br />P: You are on course 2 and I am on course_<br />S: You are on course 3 and I am on course 2.<br />P: Inaudible<br />S: We can probably figure it out.  I had this thing just like it, but it was different. I (inaudible) because then it gives you the idea.<br />S: You want to use mine?  Want me to give you a page?  I am using that page already.<br />S: My shoes fell off...<br />The cursor moves again. One move forward block is moved to the workspace. BARRIER: Helping others as hindering one\'s own opportunities for work.<br />S: O.k. so read the directions<br />P: I did read the directions (inaudible)<br />P: So wait, like the code is like walking around_<br />S: It\'s just like the blocks on your things, like pretend like you are the person<br />P: That\'s what I_<br />S: You\'ve already done that?<br />P: I\'ve done that like 3 times.<br />S: Try one block at a time.<br />P: I did that. I did step<br />Inaudible talk<br />P: I see a mistake (referring to her own screen).<br />Inaudible talk<br />S: Try one block at a time. Do you see your problem? (inaudible) ...3 times.<br />(Lots of further \"helping\" much of which is inaudible.  The words, up and down are used several times.<br /><br />27:18<br />RT: Did you guys just use this (checklist?)? Can I take a picture of it?<br />S: Yes_(inaudible).<br />RT: Did you share it?<br />S: Ya.<br />RT: So you guys did 1,2,3 did you do that because those are ones you are the most comfortable with or why did you do those first?<br />P: Well we started with (inaudible).<br />End of interaction with RT?<br />Still no cursor movement on the student\'s computer.',NULL,NULL),
