	(1827,66,6,437,NULL,NULL,76,1712,'S: Skip it and come back to it. So if you are having trouble you can just come back to it, o.k.?<br />Teacher: Nobody should be doing that.  Are you seeing someone do that?<br />S: Inaudible<br />T: Oh, so that\'s when you need to really start thinking.<br />Inaudible<br />T: That\'s part of your course, so, ya.<br />Inaudible<br />S: I think I can see the bug in it, do you see the bug?  I see the bug.<br />More inaudible<br />S: O.k. so skip that and come back to and tell me if you need help.<br />The student is advocating for the peer to skip a level/puzzle and return if they are struggling.  This is a strategy that is commonly used in math practice when problems are not linear/hierarchical.  Here, that strategy is counterproductive.  BARRIER/CHALLENGE---STRATEGY. Not all strategies are helpful<br />Not a strategy.',NULL,NULL),
