	(1830,66,7,438,NULL,NULL,5,1875,'S: One left. (Self-talk)<br />S: Move forward<br />S: Alright so I need a right which will go that way...or left which will go_<br />S: Move forward and go left two times...1,2, and then we go<br />The student begins working on her own puzzle again. She selects a turn left block for her second block when she should have selected a turn right block. She throws it away and runs the program with only one move forward block attached. Question: Can she not envision this outcome without running it?  It\'s only one block!<br />She adds a left turn block and runs it to check.  She then changes it to right. She ends up adding three move forward blocks instead of checking one block at a time. She then throws away two of those move forward blocks.',NULL,NULL),
