	(1863,69,7,445,NULL,NULL,51,863,'Multiple problems here: Spelling, asset creation, importing images, manipulating images<br />Para:  Are you wanting this person to walk a dog?<br />S: Yes, but I don\'t know how to make a leash. (The student cycles through the backdrops back to the cityscape.)<br /><br />The student opens a new tab.<br />S: How do you spell leash? <br />The para spells the word one letter at a time and the student performs a Google image search. <br /><br />S: What color should I do?<br />Para:  Oh, I\'m sorry.  What do you think?<br />S: Trying to find one that\'s stretched out, not curly.<br />Para: Can you do that and erase some of it? <br />S: I don\'t know...I can\'t find any straight ones.<br />Para:  Can you type in, can you type in...keep going...keep going. Scroll down, with just the arrows. There has got to be one somewhere right? <br /><br />S: That\'s too tiny of a collar.<br />Para: How about that?<br />S: It has a yellow bit right there. <br />Para: I don\'t know what that is.  Do \"show more\" (at the bottom of the page results).',NULL,NULL),
