	(1866,69,7,445,NULL,NULL,8,1074,'S: How do I fix that?<br />Para: I don\'t know.  Do you want to save it and see if you can erase it or something? <br />The student selects another similar photo. <br />S: Darn it.  It still has that bit. I think I can erase...<br />Para: Its just a little harness you could just_<br />S: I don\'t know how to get that around the dog.<br />Para: I don\'t either<br />S: This one\'s got a blue collar.<br />S: Darn it.  Can you help me?<br />Para: What are you trying to do?<br />S: Do a right-click to save it. <br />S: You have to do it fast!<br />Para: Do I have to do it twice?<br />S: Yes, you have to do it really fast.<br />S: Nope. Let me just show you.<br />Para: Sorry I can\'t help you (laughing).  What if you hit save?<br />S: I have to \"save image as\".',NULL,NULL),
	(1867,69,7,445,NULL,NULL,38,1074,'Also: (4) Difficulty or problem or topic is related to general computer technology (e.g., mouse, monitor, adapter).<br />The student continues to struggle with the right-click feature.  With each attempt, a new tab opens in the browser, taking the student to the website with the image location. It is actually unclear who is controlling the computer at this point.<br /><br />S: You have to do it two fingers.<br />At this point the right-click menu successfully opens. And the (para?) navigates to \"save link as\". <br />S: Oh! I was supposed to save it as...did it still save?<br />The student changes tabs back to Scratch. <br />S: I wasn\'t supposed to \"save link as\".  I was supposed to \"save image as\".',NULL,NULL),
	(1868,69,7,445,NULL,NULL,51,1074,'The student continues to struggle with the right-click feature.  With each attempt, a new tab opens in the browser, taking the student to the website with the image location. It is actually unclear who is controlling the computer at this point.<br /><br />S: You have to do it two fingers.<br />P: Oh, two fingers!<br />At this point the right-click menu successfully opens. And the (para?) navigates to \"save link as\". <br />P: how do you know? That\'s crazy!<br />S: Oh! I was supposed to save it as...did it still save?<br />The student changes tabs back to Scratch. <br />S: Did it still save?<br /><br />19:30<br />S: I wasn\'t supposed to \"save link as\".  I was supposed to \"save image as\". Did it save? Let\'s just do that. Nothing, nothing. Where did it save?<br />P: Alright do yo want me to try and double tap it again?<br />S: Where do you save image as? Double, right click.<br />P: There we go.  Now we are cracking!<br />The image has been saved and located on the computer.<br />S: How do I get_<br />P: Can you flip him around so he is going the other direction?<br />S: Yes.<br />The student imports the leash and shrinks it.<br />P: That white behind it is kinda terrible. How do we get rid of that?<br />No response<br />The student begins attempting to edit the image.<br />P: You might need to ask (CS Coach). You might need to raise your hand.  I need to go blow my nose.',NULL,NULL),
