obably refer to the wait block)? \" 21\'16 peer \"you have to have the forever block.\" 22\'00 peer \"where\'s your forever block?\" ---- student \"I do that last.\" 22\'10 student \"where\'s this thing, next\" 22\'15 peer \"oh it\'s in the looks tab\" 20\'02 student \"but you also have the rain..thing, too, see?\" 20\'08 peer \"no, that doesn\'t involve the lightening flash.\"]<br />(25:18) 5-1: Problem was solved [25\'05 peer \"ok, it\'s going to take couple of minutes for it to flash.\" 25\'18 peer \"see, it did, just fun...\"]<br />(25:25) 1-15: Peer terminates the interaction [end path] [25\'25 peer \"can I go on my other one? You do... you don\'t do nothing with us... \" 25\'35 peer \"I will do another one, ok?\"]_END<br /><br />Path #18 - data before code changes<br />(26:27) 0-1: Peer addresses Student<br />(26:27) 1-11: Peer socializes (heard on student\'s computer) [peer \"oh my brother\'s name is J.. just let you know.\"]<br />(26:29) 10-8: Student ignored or cannot hear or code student\'s response to peer<br />(26:26) 1-7: Student terminates the interaction [end path]_END',NULL,NULL,1),
